INSERT INTO `v9_block` VALUES('4','1','侧边栏联系方式','about','1','<div class=\"lianxi\" style=\"background:#eeeeee;padding:10px;line-height:150%;\">中信蓝海服务热线：<br />\r\n<br />\r\n<span style=\"color:red;\">029-68206165(总机)</span><br />\r\n<br />\r\n传 真：029-68206165<br />\r\n<br />\r\n地址：西安曲江新区雁南五路1868号曲江影视大厦10层<br />\r\n&nbsp;</div>','');
INSERT INTO `v9_block` VALUES('5','1','中信简介','zh','1','<p style=\"float:left; margin-right:30px;width: 209px;\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1014/20161014044934406.jpg\" style=\"width: 209px; height: 278px;\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 执行总裁：郭春洋</p>\r\n<p>陕西省中信蓝海工程项目管理有限公司，成立于2016年8月，注册资本1000万元。办公地址位于西安市曲江新区曲江影视大厦10层。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。</p>\r\n<p>公司主营业务有工程项目管理，工程监理，工程造价咨询，建筑设计，室内装饰设计，工程招投标报告的编制及审核，政府采购项目招标代理等。</p>\r\n<p>公司旗下分设项目管理西安区域、延安区域、榆林区域分公司，及同乘（中信）工程咨询设计公司。</p>\r\n<p>公司自成立以来始终以&ldquo;为中国建设工程贡献全部力量&rdquo;为企业使命；以&ldquo;专业、规范、周全&rdquo;为企业核心价值；以&ldquo;自律、热情、专注、高效&rdquo;为执业理念；以&ldquo;品质彰显人品，人品创造品质&rdquo;为品质理念；以&ldquo;尽力努力使我们一丝不苟的完成工作，热情专注使我们忘乎所以做到极致&rdquo;为工作理念；以&ldquo;自始至终以客户为中心是我们一贯宗旨，设身处地为客户去想是我们永恒的追求&rdquo;为服务理念，为建设美丽新中国、新陕西贡献全部力量。</p>\r\n<br />\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1017/20161017101137952.jpg\" style=\"width: 920px; height: 376px;\" /></p>','');
INSERT INTO `v9_block` VALUES('6','1','青春党建','qcdj','1','<div style=\"text-align: center;\"><a href=\"http://zhingxinlh.d152.ptzygj.com/index.php?m=content&amp;c=index&amp;a=lists&amp;catid=212\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1111/20161111041842148.jpg\" /></a></div>\r\n<div style=\"text-align: center;\"><a href=\"http://zhingxinlh.d152.ptzygj.com/index.php?m=content&amp;c=index&amp;a=lists&amp;catid=212\"><img div=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1111/20161111041844216.jpg\" /></a></div>\r\n<p>企业党建就是要把&ldquo;一个核心&rdquo;和&ldquo;六个内容&rdquo;深入在到生产一线，服务到每个岗位和每项工作中，助推生产经营，企业发展；同时要将党群组织分工深入到一线，要让每个职工都要加入到公司的党、工、青、妇的组织中，参与到各项活动中，从而实现党建建在产业链，党群工作实现全覆盖。</p>\r\n<p>一、集团党支部书记，工会主席，团委书记，妇联主席必须由区域及以上总监兼任，集团设党建办设及专职党群工作人员；</p>\r\n<p>二、板块公司党小组组长由板块总监兼任，工会主席、团支部书记、妇联主任由板块两个中心人员兼任；</p>\r\n<p>三、区域公司党小组组长由区域总监兼任，工会主席，团委书记，妇联主任由区域两个中心成员兼任；</p>\r\n<p>四、分公司党小组组长由分公司经理兼任，分公司工会主席，团支部书记，妇联主任，由部门经理担任；</p>\r\n<p>五、区域及以上党组织委员由行政中心、财经中心人员担任；分公司党小组，工会，团支部，妇联委员由员工担任。</p>','');
