INSERT INTO `v9_category` VALUES('155','1','content','0','1','144','0,144','0','155','人才招聘','','','陕西中信蓝海企业管理有限公司，成立于2016年4月11日注册资本金3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。   \r\n中信蓝海企业集团经过8年的艰苦拼搏，历经创业和转型，现已发展成为立足陕北、走向全省的规模化民营企业。公司现拥有200多名高科技管理人才和10家隶属企业，形成了以实业投资、企业管理；创业孵化、人才建设；工程咨询、项目管理、工程设计；现代农林业为主的多产业并举发展结构。','Human Resources/','rczp_1','http://zhingxinlh.d152.ptzygj.com/index.php?m=content&c=index&a=lists&catid=155','7','0','{\"workflowid\":\"\",\"ishtml\":\"0\",\"content_ishtml\":\"0\",\"create_to_html_root\":\"0\",\"template_list\":\"default\",\"category_template\":\"category\",\"list_template\":\"list_rlzy\",\"show_template\":\"show_content_sy\",\"meta_title\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"presentpoint\":\"1\",\"defaultchargepoint\":\"0\",\"paytype\":\"0\",\"repeatchargedays\":\"1\",\"category_ruleid\":\"6\",\"show_ruleid\":\"16\"}','155','1','0','rencaizhaopin','');
