INSERT INTO `v9_news_data` VALUES('51','陕西中信蓝海企业管理有限公司，成立于2016年4月11日注册资本金3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。<br />\r\n&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; 中信蓝海企业集团经过8年的艰苦拼搏，历经创业和转型，现已发展成为立足陕北、走向全省的规模民营企业。公司拥有200多名高科技管理人才和10家隶属企业，形成了以实业投资、企业管理；创业孵化、人才建设；工程咨询、项目管理、工程设计；现代农林业为主的多产业并举发展结构。<br />\r\n<img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817032749618.png\" style=\"width: 642px; height: 481px;\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style=\"color:#0000ff;\">陕西中信蓝海企业管理有限公司前台<br />\r\n<img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817032828815.png\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span><span style=\"color:#0000cd;\">&nbsp;陕西中信蓝海企业管理有限公司会议室<br />\r\n<img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817032916579.png\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 陕西中信蓝海企业管理有限公司会议室<br />\r\n<img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817033002519.png\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;陕西中信蓝海企业管理有限公司员工休息区</span><br />\r\n<strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;『集团旗下企业』</strong><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;榆林青年创业管理咨询有限公司<br />\r\n榆林青年创业管理咨询有限公司，成立于2015年4月，先后注入资本2000万，企业性质为社会性企业，位于陕西省定边县英华西路青年创业广场。公司以创业项目运营策划、市场拓展、创业项目技术支持；就业创业政务代理及信息查询、企业管理咨询；生产性服务业培训及项目投融资为核心业务；&nbsp;<br />\r\n陕西中信蓝海建设工程项目管理公司<br />\r\n&nbsp;陕西中信蓝海建设工程项目管理公司(加盟华春建设工程项目管理公司)，位于集团公司总部，具有工程咨询甲级、招标代理甲级、造价咨询甲级、建设监理甲级、中央投资甲级、政府采购甲级等资质，开展以PPP项目咨询、项目管理、招标代理、造价咨询、建设监理等核心业务，分别在西安、榆林、延安、定边、靖边、吴起、志丹开设分公司。公司汇集全省市相关土木工程，经济管理院校，工民建与工程造价类毕业生，国家注册造价师、招标师、注册评估师、工程咨询师、造价专职人员等130余人，已在全省市范围内累计承接完成各类项目管理类业务6000余项。<br />\r\n<img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817033207770.png\" /><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;同乘（中信）工程咨询设计有限公司<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 同乘（中信）工程咨询设计有限公司是一家集建筑设计、机械设计、军工设计、规划设计、市政设计、园林绿化设计、工程咨询于一体的设计咨询服务机构，公司设立于集团公司总部，现有员工230余名，其中研究员级高级工程师16名，高级工程师48名，一级注册建筑师5名，一级注册结构师8名，其他注册师30余名。公司在陕西区域下设六个分公司，各公司下设：BIM设计研究部、建筑设计部、市政公路设计部、园林景观设计、装饰设计部、工程咨询部、财务部、综合部、经营部。公司秉承&ldquo;专筑共生，心诚至臻&rdquo;的服务理念，以&ldquo;高质量、快响应&rdquo;的服务态度，专注各项工程服务，打造以&ldquo;专业、规范、高效、创新、共赢&rdquo;的服务团队。<br />\r\n<img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817033318662.png\" style=\"width: 659px; height: 498px;\" /> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;定边县春禾绿科农业发展有限公司<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;定边县春禾绿科农业发展有限公司成立于2012年9月，先后注入资本1000万元，公司以农业电子商务为核心业务，下设我家农超农村电商事业部、我家支付事业部、庄稼医院（检测和植保）事业部，其中农产品品牌电商部设立在集团总部。公司现有农林及电子商务类专业人才16名，农、林业专家4人，中青年技术骨干5人，大学毕业生15人。<br />\r\n<img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817033410534.png\" /> &nbsp; &nbsp; &nbsp;&nbsp;中信蓝海秉承&ldquo;心诚至臻 专筑共生 &rdquo;的企业理念，不断完善自我，勇担社会责任，执着的追求，严谨的工作和扎实的脚步，为社会创造更大的财富和价值，共筑蓝海梦。<br />\r\n&nbsp;<br />\r\n','0','','0','10000','','0','','0','1','|0');
INSERT INTO `v9_news_data` VALUES('6','<p><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0814/20160814123351907.jpg\" style=\"margin-right: 10px; float: left; width: 200px; height: 200px;\" />北京时间8月14日深夜，2016年里约奥运会田径大项结束了男子100米预赛争夺，中国选手两人入围半决赛，其中谢震业在决赛第三组以10秒08名列第一，直接晋级，他的预赛总排名为第五。苏炳添以10秒17列小组第三，总排名第17名晋级。张培萌以10秒36名列第48名。</p>\r\n<p>外国选手方面，美国选手加特林以10秒01列第一，牙买加选手博尔特以10秒07排名第四，牙买加选手布雷克以10秒11列第六，三人都获得了各自小组的第一名。美国和牙买加三将全部晋级。亚洲选手方面，巴林选手费什和布朗，日本选手飞鸟剑桥、山县亮太，伊朗选手塔夫蒂安晋级，亚洲纪录保持者、卡塔尔的奥古诺德出局。</p>\r\n<p>100米晋级规则是每小组前二，加上余下八个最快者入围。第一组巴林选手布朗以10秒13出人意料的排名第一，英国选手乌贾以10秒13列第二，美国选手布拉西只以10秒16列第三。亚洲纪录保持者、卡塔尔的奥古诺德只以10秒28名列第5位。</p>\r\n','0','','0','10000','','0','','0','1','|0');
