INSERT INTO `v9_news_data` VALUES('33','<p>公司名称：陕西中信蓝海企业集团</p>\r\n<p>公司地址：陕西&middot;西安曲江新区雁南五路曲江影视大厦10层</p>\r\n<p>邮政编码：710061</p>\r\n<p>联系电话：029-68206165(总机)</p>\r\n<p>传 真：029-68206165</p>\r\n<p>Email：982462627@qq.com</p>\r\n','0','','0','10000','','0','','0','1','|0');
INSERT INTO `v9_news_data` VALUES('167','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128011338281.jpg\" /></p>\r\n<p>2016年6月18日至19日，&ldquo;中信蓝海企业集团2016年夏季工作会议&rdquo;在西安集团公司总部召开。此次会议以&ldquo;夯实技术创新 拓展运营思维 强化组织建设&rdquo; 为主题，着重于总结集团公司上半年度经营管理工作，并明确下半年度及长期发展战略的经营思路、经营目标和经营重点。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('26','<p style=\"text-align: justify;\">淘宝网(<a href=\"http://www.taobao.com\">http://www.taobao.com</a>)创立于2003年5月，是注重多元化选择、价值和便利的中国消费者首选的网上购物平台。淘宝网展示数以亿计的产品与服务信息，为消费者提供多个种类的产品和服务。此外，消费者也通过淘宝网获取产品知识、与其他消费者交流、接收商家的实时资讯，以至使用当中的互动媒体接通其他消费者或品牌和零售商。根据艾瑞咨询基于2015年月度活跃用户数（MAU）的统计，淘宝网是中国最大的移动商务平台。淘宝网创立于2003年5月，是注重多元化选择、价值和便利的中国消费者首选的网上购物平台。淘宝网展示数以亿计的产品与服务信息，为消费者提供多个种类的产品和服务。此外，消费者也通过淘宝网获取产品知识、与其他消费者交流、接收商家的实时资讯，以至使用当中的互动媒体接通其他消费者或品牌和零售商。根据艾瑞咨询基于2015年月度活跃用户数（MAU）的统计，淘宝网是中国最大的移动商务平台。淘宝网创立于2003年5月，是注重多元化选择、价值和便利的中国消费者首选的网上购物平台。淘宝网展示数以亿计的产品与服务信息，为消费者提供多个种类的产品和服务。此外，消费者也通过淘宝网获取产品知识、与其他消费者交流、接收商家的实时资讯，以至使用当中的互动媒体接通其他消费者或品牌和零售商。根据艾瑞咨询基于2015年月度活跃用户数（MAU）的统计，淘宝网是中国最大的移动商务平台。淘宝网创立于2003年5月，是注重多元化选择、价值和便利的中国消费者首选的网上购物平台。淘宝网展示数以亿计的产品与服务信息，为消费者提供多个种类的产品和服务。此外，消费者也通过淘宝网获取产品知识、与其他消费者交流、接收商家的实时资讯，以至使用当中的互动媒体接通其他消费者或品牌和零售商。根据艾瑞咨询基于2015年月度活跃用户数（MAU）的统计，淘宝网是中国最大的移动商务平台。淘宝网创立于2003年5月，是注重多元化选择、价值和便利的中国消费者首选的网上购物平台。淘宝网展示数以亿计的产品与服务信息，为消费者提供多个种类的产品和服务。此外，消费者也通过淘宝网获取产品知识、与其他消费者交流、接收商家的实时资讯，以至使用当中的互动媒体接通其他消费者或品牌和零售商。根据艾瑞咨询基于2015年月度活跃用户数（MAU）的统计，淘宝网是中国最大的移动商务平台。</p>\r\n','0','','0','10000','','0','','0','1','|0');
