INSERT INTO `v9_news_data` VALUES('10','近10多年来，我国建筑行业高速发展建筑行业总产值从2001年的15362亿上升到2012年的135303亿元，涨幅将近9倍，而建筑行业的高速发展也带动了相关产业的发展，大幅提高了我国的综合国力和人民的生活水平，为全国建设小康社会提供了广阔的空间。全球建筑市场价值约7.5万亿美元，占全球GDP的13.4%。预计到2020年，其价值将达到12.7万亿美元，接下来的十年里将增长70%。到2020年，建筑业将占全球GDP的14.6%。未来10年，全球新兴市场的建筑业规模将扩大1倍，达到6.7万亿美元中国作为最大的发展中国家，2013年的建筑市场规模将接近10万亿元人民币，到2015年将达到12万亿元到2015年，全球将出现23座人口超过1000万的特大城市，这将极大地推动建筑业全球化，并为传统建造商之间的战略整合提供机会。','0','','0','10000','','0','','0','1','|0');
