INSERT INTO `v9_news_data` VALUES('165','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128115514863.jpg\" /></p>\r\n<p>为使党的路线方针政策更好地指导我司各项工作，切实将党群建设工作落到实处，实现全员重视、全员参与的良好工作氛围，经青创党支部研究决定，从2016年11月14日起，党群工作将列入每月工作进度表和日常绩效考核。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('166','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128010830279.jpg\" /></p>\r\n<p>2015年10月12日下午，团市委书记、党组织书记殷海舰、办公室主任王惠等一行四人，在团县委书记高燕、副书记乔建的陪同下到青年创业广场考察调研，公司董事长兼党支部书记郭春河引导各位领导参观了青年创业广场各入驻企业，并对今后的发展方向及工作目标进行了介绍。各位领导对我司所做的工作给予了高度肯定，并对我司今后的发展提出了指导意见和建议。</p>\r\n<p>参观结束后，市、县团委在我司五楼会议室召开了&ldquo;走进青年、转变作风、改进工作&rdquo;暨&ldquo;七个搞清楚&rdquo;座谈会。参加本次座谈会的有入驻青年创业广场的各公司经理及全县各界青年创业就业的企业代表，共计30余人。 座谈会上，殷书记高度评价了团县委和我司的引领作用，希望我司再接再厉，为全市青创工作起到引领带头、孵化作用，为榆林经济建设作出更大的贡献。</p>\r\n','0','','0','10000','','0','','0','1','|1');
