INSERT INTO `v9_news_data` VALUES('120','<p style=\"text-align: center;\"><span style=\"font-size:20px;\"><strong>重庆国际投资咨询集团（陕西）有限公司<br />\r\n倾力参与承办2016 AEC陕西建设行业高峰论坛</strong></span></p>\r\n<p>8月19日，以&ldquo;科技引领时代 &middot; 共筑产业生态&rdquo;为主题的2016陕西建设行业高峰论坛在西安开幕，来自建筑协会、高等院校、企业、媒体等各方力量上千名嘉宾共襄盛会，聚焦行业前沿新政策、新技术、新思路，探讨行业内热点、焦点、难点议题，以创新为引线，紧扣时代脉搏，推动陕西建设行业更好、更快发展。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020084425151.png\" /></p>\r\n<p>作为承办方之一的重庆国际投资咨询集团（陕西）有限公司，在本次论坛中不但以全新的面貌向前来参会的人员做以宣传、展示，介绍了当前公司的发展现状、业务范围及取得的成绩，获得来宾的纷纷称赞，而且本届论坛公司重点聚焦了建筑业的供给侧改革、BIM、大数据、PPP、绿色节能科技、互联网跨界等改变建设行业未来的热门话题，为企业的下一步发展奠定坚实的理论基础。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020090256400.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020084555336.png\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020084622326.png\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020084654370.png\" /></p>\r\n<p>本次高峰论坛议程共分两部分，第一部分为意见领袖建筑行业前沿经验分享，来自国家发改委、清华大学、陕建集团、广联达软件的四位嘉宾分别就《供给侧结构性改革下的PPP模式》、《BIM在建筑全生命周期的应用与发展趋势》、《企业基于互联网采购+企业电商实战应用案例》、《建筑产业互联网推动产业转型升级》进行了深入浅出的分析，赢得阵阵掌声。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020084749286.png\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020084807555.png\" /></p>\r\n<p>第二部分为行业典型案例分享，共设营改增、BIM、中介造价咨询三个分论坛，其中重庆国际投资咨询集团（陕西）有限公司总经理郭春河先生作为本次中介造价咨询分论坛的主持人，他别具一格的主持风格、独辟蹊径的真知灼见获得在场嘉宾的频频点赞。在三位嘉宾分别就《新常态下造价咨询企业转型创新发展思考》、《大数据在建筑行业的应用与实践》、《产业互联网下的咨询企业转型创新》与大家分享后，郭总也针对新形势下的行业特点提出了自己的见解。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1111/20161111014810855.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020090312746.jpg\" /></p>\r\n<p>他认为： 一是传统产业升级、互联网+、大数据已成为行业发展趋势，对建设行业、造价领域产生了重大影响；二是传统企业在变革过程中，要充分利用互联网、大数据给当前行业发展带来的新思路，尽快适应新形势；三是行业内要加强交流、沟通，及时适应变化了的新实际，不断更新企业自身发展，为陕西建设行业做出应有的贡献。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020085135226.png\" /></p>\r\n<p>最后，在大家热烈的掌声中，郭总宣布本此高峰论坛圆满闭幕！</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020085215361.png\" /></p>\r\n','0','','0','10000','','0','','0','1','|1');
