INSERT INTO `v9_news_data` VALUES('34','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/20161011031917495.jpg\" /></p>\r\n<p>陕西中信蓝海企业集团，成立于2016年4月11日，注册资本3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。</p>\r\n<p>从2009年创业之初，经过8年的艰苦拼搏，历经创业和转型，现已发展成为立足陕北、走向全省的规模性民营企业。公司拥有200多名高科技管理人才，分工程项目管理、园林绿化、现代农业、创业孵化四大板块和15家子分公司，形成了以实业投资、企业管理，创业孵化、工程咨询、招标代理、造价咨询、项目管理、工程设计、园林景观、电子商务、现代农林业为主的多产业并举发展结构。</p>\r\n<p>中信蓝海企业集团秉承&ldquo;心诚至臻，专筑共生 &rdquo;的企业理念，不断完善自我，勇担社会责任，执着的追求，严谨的工作和扎实的脚步，为社会创造更大的财富和价值，共筑蓝海梦。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1104/20161104083839514.jpg\" /></p>\r\n','0','','0','10000','','0','','0','1','中信蓝海企业集团|0');
INSERT INTO `v9_news_data` VALUES('40','<span font-size:=\"\" heiti=\"\" line-height:=\"\" microsoft=\"\" open=\"\" stheiti=\"\" style=\"color: rgb(51, 51, 51);\" text-indent:=\"\"><span font-size:=\"\" heiti=\"\" line-height:=\"\" microsoft=\"\" open=\"\" stheiti=\"\" text-indent:=\"\">&nbsp;近10多年来，我国建筑行业高速发展建筑行业总产值从2001年的15362亿上升到2012年的135303亿元，涨幅将近9倍，而建筑行业的高速发展也带动了相关产业的发展，大幅提高了我国的综合国力和人民的生活水平，为全国建设小康社会提供了广阔的空间。全球建筑市场价值约7.5万亿美元，占全球GDP的13.4%。预计到2020年，其价值将达到12.7万亿美元，接下来的十年里将增长70%。到2020年，建筑业将占全球GDP的14.6%。未来10年，全球新兴市场的建筑业规模将扩大1倍，达到6.7万亿美元中国作为最大的发展中国家，2013年的建筑市场规模将接近10万亿元人民币，到2015年将达到12万亿元到2015年，全球将出现23座人口超过1000万的特大城市，这将极大地推动建筑业全球化，并为传统建造商之间的战略整合提供机会。</span><br />\r\n<span font-size:=\"\" heiti=\"\" line-height:=\"\" microsoft=\"\" open=\"\" stheiti=\"\" text-indent:=\"\">&nbsp; &nbsp; &nbsp; &nbsp;近10多年来，我国建筑行业高速发展建筑行业总产值从2001年的15362亿上升到2012年的135303亿元，涨幅将近9倍，而建筑行业的高速发展也带动了相关产业的发展，大幅提高了我国的综合国力和人民的生活水平，为全国建设小康社会提供了广阔的空间。全球建筑市场价值约7.5万亿美元，占全球GDP的13.4%。预计到2020年，其价值将达到12.7万亿美元，接下来的十年里将增长70%。到2020年，建筑业将占全球GDP的14.6%。未来10年，全球新兴市场的建筑业规模将扩大1倍，达到6.7万亿美元中国作为最大的发展中国家，2013年的建筑市场规模将接近10万亿元人民币，到2015年将达到12万亿元到2015年，全球将出现23座人口超过1000万的特大城市，这将极大地推动建筑业全球化，并为传统建造商之间的战略整合提供机会。</span>从2001年的15362亿上升到2012年的135303亿元，涨幅将近9倍，而建筑行业的高速发展也带动了相关产业的发展，大幅提高了我国的综合国力和人民的生活水平，为全国建设小康社会提供了广阔的空间。全球建筑市场价值约7.5万亿美元，占全球GDP的13.4%。预计到2020年，其价值将达到12.7万亿美元，接下来的十年里将增长70%。到2020年，建筑业将占全球GDP的14.6%。未来10年，全球新兴市场的建筑业规模将扩大1倍，达到6.7万亿美元中国作为最大的发展中国家，2013年的建筑市场规模将接近10万亿元人民币，到2015年将达到12万亿元到2015年，全球将出现23座人口超过1000万的特大城市，这将极大地推动建筑业全球化，并为传统建造商之间的战略整合提供机会。</span><br />\r\n<span font-size:=\"\" heiti=\"\" line-height:=\"\" microsoft=\"\" open=\"\" stheiti=\"\" style=\"color: rgb(51, 51, 51);\" text-indent:=\"\">&nbsp; &nbsp; &nbsp; &nbsp;近10多年来，我国建筑行业高速发展建筑行业总产值从2001年的15362亿上升到2012年的135303亿元，涨幅将近9倍，而建筑行业的高速发展也带动了相关产业的发展，大幅提高了我国的综合国力和人民的生活水平，为全国建设小康社会提供了广阔的空间。全球建筑市场价值约7.5万亿美元，占全球GDP的13.4%。预计到2020年，其价值将达到12.7万亿美元，接下来的十年里将增长70%。到2020年，建筑业将占全球GDP的14.6%。未来10年，全球新兴市场的建筑业规模将扩大1倍，达到6.7万亿美元中国作为最大的发展中国家，2013年的建筑市场规模将接近10万亿元人民币，到2015年将达到12万亿元到2