INSERT INTO `v9_news_data` VALUES('38','<p style=\"text-align: justify;\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0814/20160814010644844.jpg\" style=\"margin-right: 10px; float: left; width: 200px; height: 200px;\" /><span style=\"font-size: 12px;\">北京时间8月13日，2016年里约奥运会赛艇赛事在拉戈阿体育馆进行进行。在女子单人双桨决赛A组比赛中，中国选手段静莉以7分24秒13的成绩夺得了一枚宝贵铜牌，这是中国赛艇队在本届奥运会上夺得的第二枚奖牌，段静莉也就此刷新了张秀云2008年北京奥运会时创造的中国选手在该项目第四名的历史最好成绩。澳大利亚名将布伦南摘得金牌，美国选手斯通获得亚军。</span></p>\r\n<p style=\"text-align: justify;\">女子单人双桨，中国选手段静莉亮相决赛A组。比赛开始后，段静莉并没有急于加快桨频，初段仅排名第四，不过之后段静莉很快完成超越，在500米结束时用时1分49秒53已经升至第二位，处于领先位置的是澳大利亚名将布伦南，这位伦敦奥运会铜牌得主从开始就先发制人，领先优势十分明显。<br />\r\n<br />\r\n1000米半程结束，美国选手斯通冲了上来，段静莉落到了第三名的位置，用时为3分39秒10。再完成500米，布伦南依然遥遥领先，而段静莉落后斯通已经有了近半个艇身的差距。最后冲刺阶段，新西兰选手特维格来势汹汹，不过段静莉最后一直顶住。最终段静莉以7分24秒13的成绩第三个冲线，改写了中国选手在奥运会这一项目的历史最好成绩。</p>\r\n<p>&nbsp;</p>\r\n','0','','0','10000','','0','','0','1','|0');
INSERT INTO `v9_news_data` VALUES('39','<pre>\r\n</pre>\r\n<div style=\"text-align: justify;\"><span style=\"font-family: Arial, Verdana, sans-serif;\">北京时间8月13日凌晨2点08分，2016年里约奥运会游泳大项结束了男子1500自预赛前五组争夺，<br />\r\n孙杨在第五小组预赛中，在进行到800米之后从前三位置退出，随后开始逐渐落后，最后以15分<br />\r\n01秒97排名小组第7，在已经结束的五组比赛里只排第10，已经失去决赛资格，另一中国选手邱<br />\r\n子傲以15分06秒71在头五组比赛中列第13位，同样失去决赛资格。比赛共有六组。【点击观看<br />\r\n男子1500自孙杨无缘决赛gif集锦】</span><span style=\"font-family: Arial, Verdana, sans-serif;\">男子1500自预赛，邱子傲在第四组出场，他在头250米速度不<br />\r\n错，保持在第一位置，但在300米时被追到第三，350米时被甩出前三。波兰选手沃吉达克暂时游<br />\r\n在第一位。捷克选手米卡在后半程开始领先。米卡在后面越游越快，最终他以14分58秒69第一个<br />\r\n到达终点。邱子傲以15分06秒71排名小组第四。</span><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0814/20160814011211399.jpg\" style=\"font-family: Arial, Verdana, sans-serif;\" /></div>\r\n','0','','0','10000','','0','','0','1','|0');
INSERT INTO `v9_news_data` VALUES('41','<span font-size:=\"\" heiti=\"\" line-height:=\"\" microsoft=\"\" open=\"\" stheiti=\"\" style=\"color: rgb(51, 51, 51);\" text-indent:=\"\">&nbsp; 近10多年来，我国建筑行业高速发展建筑行业总产值从2001年的15362亿上升到2012年的135303亿元，涨幅将近9倍，而建筑行业的高速发展也带动了相关产业的发展，大幅提高了我国的综合国力和人民的生活水平，为全国建设小康社会提供了广阔的空间。全球建筑市场价值约7.5万亿美元，占全球GDP的13.4%。预计到2020年，其价值将达到12.7万亿美元，接下来的十年里将增长70%。到2020年，建筑业将占全球GDP的14.6%。未来10年，全球新兴市场的建筑业规模将扩大1倍，达到6.7万亿美元中国作为最大的发展中国家，2013年的建筑市场规模将接近10万亿元人民币，到2015年将达到12万亿元到2015年，全球将出现23座人口超过1000万的特大城市，这将极大地推动建筑业全球化，并为传统建造商之间的战略整合提供机会。</span><br />\r\n<span font-size:=\"\" heiti=\"\" line-height:=\"\" microsoft=\"\" open=\"\" stheiti=\"\" style=\"color: rgb(51, 51, 51);\" text-indent:=\"\">&nbsp; &nbsp; &nbsp; &nbsp;近10多年来，我国建筑行业高速发展建筑行业总产值从2001年的15362亿上升到2012年的135303亿元，涨幅将近9倍，而建筑行业的高速发展也带动了相关产业的发展，大幅提高了我国的综合国力和人民的生活水平，为全国建设小康社会提供了广阔的空间。全球建筑市场价值约7.5万亿美元，占全球GDP的13.4%。预计到2020年，其价值将达到12.7万亿美元，接下来的十年里将增长70%。到2020年，建筑业将占全球GDP的14.6%。未来10年，全球新兴市场的建筑业规模将扩大1倍，达到6.7万亿美元中国作为最大的发展中国家，2013年的建筑市场规模将接近10万亿元人民币，到2015年将达到12万亿元到2015年，全球将出现23座人口超过1000万的特大城市，这将极大地推动建筑业全球化，并为传统建造商之间的战略整合提供机会。</span>','0','','0','10000','','0','','0','1','|0');
