INSERT INTO `v9_news_data` VALUES('171','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128013816793.jpg\" /></p>\r\n<p>2016年6月24日下午16时，榆林青年创业管理咨询有限公司召开&ldquo;三会一课，学延安精神、高西沟精神、治沙精神&rdquo;专题学习教育会。党支部成员、全体党员、积极分子参加了学习大会，大会由榆林青年创业管理咨询有限公司顾问刘前进主持召开，并做专题学习辅导。他在会上总结到：&ldquo;榆林治沙精神&rdquo;是对延安精神的传承与发展，是新时期延安精神在榆林现代化建设中的延伸与拓展，体现了党的立业之本的奋斗精神，体现了党的思想路线的求实精神，体现了共产党人高贵品格的大无畏精神和奉献精神。&ldquo;十三五&rdquo;发展大幕已拉开，面对新目标、新任务，迫切需要大力弘扬&ldquo;榆林治沙精神&rdquo;，强化践行的自觉性，把自己的工作做好、做扎实，爱岗敬业，努力成为新时期、新阶段的栋梁之才。最后，他强调：我们作为一名党员，要从&ldquo;治沙精神&rdquo;汲取作风建设的力量，面对新的任务，对照&ldquo;治沙精神&rdquo;，我们要敢于勇挑重担，奋力拼搏，大胆开拓。（图为参会成员与主讲人共同探讨&ldquo;治沙精神&rdquo;）&nbsp;</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('172','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128013956841.jpg\" /></p>\r\n<p>为迎接中秋佳节的到来，2015年10月15日榆林青年创业管理咨询有限公司工会坚持&ldquo;以人为本&rdquo;的指导思想，从员工实际需要出发，为上百名员工每人发放了炉馍和麻花各一盒，同时发放了我家支付卡，方便员工购买其他节日福利。（图为员工领用福利照）</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('173','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128014157569.jpg\" /></p>\r\n<p>扎实推进企业文化建设，提升企业团队凝聚力。2015年12月7日早上8点，由青创管理公司行政中心组织，青年创业广场各入驻企业所有员工共同参与，开展学习企业文化及青春党建思想的活动。由行政中心郑艺颖带领大家参观、学习并给大家进行了详细讲解。公司总经理郭春河对公司当前发展形式及未来规划进行了重要讲解，并要求各单位把企业文化建设与本单位核心工作、教育实践活动、管理提升活动紧密地结合起来，通过参加企业文化宣传活动，增强文化意识，提升文化自觉，立足本职岗位，为企业做更多贡献。</p>\r\n<p>&nbsp;</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('174','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128014241676.jpg\" /></p>\r\n<p>为牢记历史，缅怀英烈，深入开展&ldquo;两学一做&rdquo;学习教育活动，2016年6月17日上午，榆林青年创业管理咨询有限公司党支部副书记李进轩带领党员和入党积极分子共40余人，参观了延安革命纪念馆，开展了一次特殊的&ldquo;学党史、讲中国故事&rdquo;党课活动，喜迎建党95周年和红军长征胜利80周年。（图为讲解员介绍照）</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('175','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128014709469.jpg\" /></p>\r\n<p>在&ldquo;大众创业、万众创新&rdquo;的浪淘中，跟随党的十八大精神，全面贯彻落实科学发展观，以市场化、项目化、社会化的运作方式，培养我县广大青年人才就业创业观念，引导、帮助广大青年自主创业，自谋职业，形成&ldquo;先创业带后创业&rdquo;、&ldquo;以创业促就业&rdquo;的发展格局，为促进我县经济社会又好又快发展。由定边县人社局组织的北京考察学习第一期于2016年5月17日拉开了帷幕，一行30余人踏上了考察学习之路。（图为参观投资家咖啡公司留影）</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('176','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128014800612.jpg\" /></p>\r\n<p>2016年定边县采油厂团委书记携职工来我司参观学习团建，合影留念。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('177','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128014845985.jpg\" /></p>\r\n<p>2016年11月，我集团分公司&mdash;&mdash;同乘（中信）设计榆林区团支部为丰富公司广大青年的业余文化生活，增强青年团队协作意识，提高团组织凝聚力，调整员工心态，做好年底各项工作的攻坚冲刺，于11月13日联合公司工会、妇委会共同举办了同乘（中信）设计榆林区第一届员工运动会。出席本次开幕式的有公司党小组组长、公司经理卜一峰、工会小组组长牛彩林、团支部书记张博、妇女小组组长白月玲及全体员工。（图为男女混打篮球）</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('178','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128015401671.jpg\" /></p>\r\n<p>2016年6月18日上午，中信蓝海企业集团于集团总部举行夏季工作会议。会议中提到&ldquo;为认真贯彻落实项目管理板块服务升级，参与到实际PPP项目中去的精神&rdquo;,经研究决定，成立陕西中信蓝海企业管理有限公司项目管理公司PPP项目咨询部。（图为中信蓝海企业集团董事长郭春河为PPP咨询部颁发聘书）</p>\r\n','0','','0','10000','','0','','0','1','|1');
