INSERT INTO `v9_news_data` VALUES('181','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128015617844.jpg\" /></p>\r\n<p>2016年11月5-6日，定边县春禾绿科农业发展有限公司（以下简称&ldquo;春禾绿科&rdquo;）&ldquo;我家农超城乡一体化服务平台&rdquo;项目亮相第23届杨凌农高会。期间，集团公司董事长郭春河向崔博书记和焦利民县长介绍了项目运行情况及投资计划。春禾绿科运营的我家农超是一个服务三农的城乡一体化服务平台。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('182','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128015657460.jpg\" /></p>\r\n<p>2016年11月11日，集团公司项目管理板块延安区第四季度经营分析会在延安筑巢空间召开，参会人员有延安区各分公司总监及各司经营人员。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('183','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128015743794.jpg\" /></p>\r\n<p>通过互依托县级运营中心、村级体验店、农村消费顾问、城市社区店及电商平台、完成整个链条的无障碍流通，从而达到刺激农村发展、帮助农民致富、带动农业发展，实现网货下乡、农产品进城、城乡互通的目的。项目全国运营中心设于定边县，以定边县为示范点，在全县进行推广运营。项目计划在定边建设1个总站、5个社区站和15-20个乡村站。（图为定边县崔博书记和焦利民县长在讨论就春禾绿科项目讨论）&nbsp;</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('184','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128020132395.jpg\" /></p>\r\n<p>【青年创业广场】青年创业广场,一个集聚青年睿智的地方.在这里,怀揣梦想的青年们夜以继日，奋斗拼搏,他们付出热血、收获梦想.每当灯火阑珊之时,每当三五好友谈笑风生之时,每当KTV的歌声响彻长街之时,每当城市的喧闹销声匿迹之时,在青年创业广场里,有那么一片灯光渲染着黑夜,有那么一群人依旧闪动着身影,依旧敲击着键盘,努力的工作.因为他们懂得,青春是用来奋斗的，而不是用来享受的！</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('72','<p><strong>造价员</strong></p>\r\n<p><strong>岗位职责：</strong></p>\r\n<p>1、项目投资分析，进行日常成本测算，提供设计变更成本建议；</p>\r\n<p>2、负责对设计估算、施工图预算、招标文件编制、工程量计算进行审核；</p>\r\n<p>3、组织内部招标实施，配合外部招标；</p>\r\n<p>4、合同文件的起草与管理，跟踪分析合同执行情况，审核相关条款；</p>\r\n<p>5、工程款支付审核，结算管理，概预算与决算报告；</p>\r\n<p>6、变更洽商审核及处理索赔事宜。</p>\r\n<p><strong>任职要求：</strong></p>\r\n<p>1、建筑工程、造价、预算等相关专业大专以上学历；</p>\r\n<p>2、年以上相关工作经验，具有注册造价师资格证者优先考虑。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('126','<p>2015年12月22日，定边县物价局副局长李荣春一行莅临青年创业广场，向入驻企业&ldquo;我家农超&rdquo;颁发&ldquo;明码实价示范店&rdquo;荣誉称号，并发表讲话。公司总经理兼党支部书记郭春河、我家农超负责人郝巨杰经理及张树镭店长对物价局的领导进行了热情地接待，同时感谢领导的支持与肯定。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101014214781.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">★</span>❤李局长授予明码实价荣誉牌❤<span style=\"color:#ff0000;\">★</span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101014238941.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">★</span>❤李局长发表讲话❤<span style=\"color:#ff0000;\">★</span> &nbsp;在颁发&ldquo;明码实价示范店&rdquo;荣誉称号的同时，李荣春局长一行在我家农超负责人的带领下，参观了超市的内景布置。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101014525720.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101014544492.jpg\" /></p>\r\n<p>最后，我家农超负责人为各位领导讲解了目前超市工作的进展，李局长也为我家农超的进一步发展提出宝贵建议。</p>\r\n<p>我家农超&mdash;&mdash;&ldquo;绿色生活倡导者&rdquo;：奉献社会、服务三农是我家农超成立的初衷，在为人民谋福利的同时，还提供了就业岗位，解决了部分人的就业问题，向社会输送了人才。我家农超采用O2O（online to offline）电子商务模式，通过线上线下相结合的方式进行农产品销售。农产品来源渠道有自有春禾生态创意农场、大型农产品供应商及合作农户，所有蔬菜水果、肉禽蛋奶、粮油副食等均经过严格检测，除我家农超网上商城和第三方电子商务交易平台外，还有自建实体销售门店，提供农产品配送服务。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101014633135.jpg\" /></p>\r\n<p><strong>经营范围：</strong></p>\r\n<p><span style=\"color:#0000ff;\">一、线下体验店</span></p>\r\n<p>设有我家菜园、我家果园、我家厨房、我家粮油、我家牧场、我家生活馆、我家阳台专区</p>\r\n<p><span style=\"color:#0000ff;\">二、网上商城购物（同城配送）</span></p>\r\n<p>关注&ldquo;我家农超&rdquo;微信公众平台，随时随地购物到家</p>\r\n<p><span style=\"color:#0000ff;\">三、蔬菜宅配卡系列（营养搭配食材配送到家）</span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101014734491.jpg\" /></p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('127','<p>5月28日，由榆林市科技局、榆林市产学研合作联盟共同主办的榆林第四届创新创意创业大赛在榆林学院拉开帷幕。</p>\r\n<p>本次大赛的主题为&ldquo;创意点燃激情 创新引领未来 创业成就梦想&rdquo;，吸引了来自全市各园区、县区及省内16所知名高校的75组选手参加展示、评选。专家评审团将通过作品展示、材料评阅、现场答辩等环节，按照社会组、高校组两大组别分别评选出优秀作品。</p>\r\n<p>最终选出了12个参赛作品参加决赛进行PPT答辩，选手都竭尽全力将作品的优秀之处展示给评委，引起现场掌声阵阵，最终春禾绿科庄稼医院项目荣获社会组第二名。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101020059851.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101020119602.jpg\" /></p>\r\n<p style=\"text-align: center;\">春禾庄稼医院</p>\r\n<p>定边县春禾庄稼医院2015年9 月成立于定边县青年创业广场内，隶属于定边县春禾绿科农业发展有限公司，主要以检测服务和植保服务为核心领域，以&ldquo;精准农业、时效农业、绿色农业&rdquo;为宗旨，为农业健康有序发展提供强有力的支撑 。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101020213211.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101020229157.jpg\" /></p>\r\n<p style=\"text-align: center;\">比赛现场</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101020308388.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101020322871.jpg\" /></p>\r\n<p style=\"text-align: center;\">初赛</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101020400293.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101020418160.jpg\" /></p>\r\n<p style=\"text-align: center;\">决赛ppt答辩现场</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101020449771.png\" /></p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('73','<p><strong>美工</strong></p>\r\n<p>任职要求：</p>\r\n<p>1、大专及以上学历，精通Photoshop等图文设计软件，熟悉Flash、网页设计软件者优先；</p>\r\n<p>2、年龄：22-35之间；</p>\r\n<p>3、有耐心，能连续较长时间从事图片处理工作；思维敏捷，接受能力强，工作积极主动，有团队协作精神，沟通能力较强；</p>\r\n<p>4、较强的创新能力，独立快速完成高品质设计，对色彩的把握独到，能把设计风格和栏目特色进行有效的结合；</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('143','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128102701754.jpg\" /></p>\r\n<p>为了进一步拓宽思维、改变观念、开拓眼界、塑造格局，激发全公司的创业热情，2016年3月2日，在集团公司郭春河总经理带领下，由定边青年创业广场组织的&ldquo;中信蓝海2018在路上-思维篇&rdquo;商旅学习活动，出行人员包括青创公司旗下各事业公司总监，青年创业广场各入驻企业负责人，共计18人，于北京、上海、杭州、西安等地进行参观学习，达到了学习目的。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('129','<p>2016年7月27日，在定边县科技局的组织下，定边春禾绿科农业发展有限公司的&ldquo;我家农超&rdquo;、&ldquo;庄稼医院&rdquo;互联网+农业项目参加了展会。</p>\r\n<p>7月29日-31日呼和浩特首届科技成果博览会在内蒙古国际会展中心开展，展会以&ldquo;促进大众创业、万众创新&rdquo;，展示科技成就，推动科技成果转化，促进科技合作交流，引进科技人才为主题。参展项目有科技创新体系、高新技术产业、现代农业科技、知识产权、发明专利科技合作交流、创新人才引进等。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101023902195.jpg\" /></p>\r\n<p style=\"text-align: center;\">参展主题开幕式</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101023945361.jpg\" /></p>\r\n<p style=\"text-align: center;\">榆林展馆</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101024031265.jpg\" /></p>\r\n<p style=\"text-align: center;\">呼和浩特市长前来参观榆林展区</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101024112478.jpg\" /></p>\r\n<p style=\"text-align: center;\">榆林市科技局副局长艾小斐与白成义参观我司展厅（一)</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101024154722.jpg\" /></p>\r\n<p style=\"text-align: center;\">榆林市科技局副局长艾小斐与白成义参观我司展厅（二)</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101024231312.jpg\" /></p>\r\n<p style=\"text-align: center;\">定边科技局与公司参展人员合影</p>\r\n<p>我家农超县域电商服务平台是专业服务三农（农村、农民、农业）的综合农村电子商务平台，以互联网为平台形成网货下乡、农产品进城的完整供应链，依托县级运营中心、村级体验店、农村消费顾问、城市社区店及电商平台，完成整个链条的无障碍流通，从而达到刺激农村发展、帮助农民致富、带动农业发展的目的。</p>\r\n<p>在博览会上，&ldquo;我家农超&rdquo;项目受到现场观众的广泛关注和榆林市科技局领导的关注，他们了解项目运行方式，市场前景，并亲自体验操作过程。对&ldquo;我家农超&rdquo;项目宣传推广起到积极的推动作用。同时企业也看到了国际、国内先进的互联网技术，3D产品打印技术，农业产业新技术，学习借鉴先进科学的新方法和成功经验，提升企业核心竞争力，找到适合发展的创新之路。</p>\r\n','0','','0','10000','','0','','0','1','|1');
