INSERT INTO `v9_news_data` VALUES('140','<div style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128102426299.jpg\" /></div>\r\n<p>2016年6月18日至19日，&ldquo;中信蓝海企业集团2016年夏季工作会议&rdquo;在西安曲江集团公司总部召开。此次会议以&ldquo;夯实技术创新 拓展运营思维 强化组织建设&rdquo; 为主题，着重于总结集团公司上半年度经营管理工作，并明确下半年度及长期发展战略的经营思路、经营目标和经营重点。图为中层以上参会领导合影。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('141','<div style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128102529924.jpg\" /></div>\r\n<p>2016年10月11日上午，第二届&ldquo;爱榆林&middot;我是榆林好网民&rdquo;评选活动总结会顺利召开。会议由市委宣传部常务副部长沈效功主持，市委常委、宣传部长李博出席并讲话。我司同乘中信设计定边分公司牛彩林获得第二届&ldquo;爱榆林&middot;我是榆林好网名&rdquo;称号。</p>\r\n','0','','0','10000','','0','','0','1','|1');
