INSERT INTO `v9_news_data` VALUES('202','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128024331440.jpg\" /></p>\r\n<p>&ldquo;青年有担当，定边有力量&rdquo; 访创业精英，聚有志之士.2016年4月，在定边团县委和定边县人才交流中心的指导下，定边县青年企业家协会发起人郭春河、刘浩洋、冯倩、王婧、邢桂玮、刘慧琴、高绍维，优秀青年企业家郭小明、王智、李利利，团委王渊渊、刘书宇，秘书处李栋、付忠明、郑明月、马亚丽等人，就成立青年企业家协会对准会员单位安排走访考察。在走访过程中，考察团与定边优秀的青年企业家进行了对接交流，准会员单位对自己企业的情况进行详细介绍，青年企业家协会考察团也就协会的情况做了具体介绍。（图为考察定边县乐村淘电子商务有限公司摄）</p>\r\n<p>&nbsp;</p>\r\n','0','','0','10000','','0','','0','1','|1');
