INSERT INTO `v9_news_data` VALUES('71','<p><strong>行政专员</strong></p>\r\n<p><strong>岗位职责：</strong></p>\r\n<p>1、负责与其他部门的协调工作，做好信息的上传下达。</p>\r\n<p>2、负责公司各部门的行政后勤类相关工作。</p>\r\n<p>3、负责员工的考勤工作核算。</p>\r\n<p>4、负责部门一些日常行政事务，配合上级做好行政人事方面的工作。</p>\r\n<p>5、负责组织企业文化建设工作，包括公司庆典、年会安排、会务组织、文体活动安排等。</p>\r\n<p>6、负责离职员工的善后处理工作，包括办公用品、钥匙、出勤核算等。</p>\r\n<p>7、协助各部门做好节假日期间工作安排，包括值班安排、检查门窗、关闭电源电脑等工作。</p>\r\n<p>8、负责企业资产配置(包括办公设备、办公用品)的管理工作，包括清点、维护、登记等。</p>\r\n<p>9、负责日常的物资采购宫锁。</p>\r\n<p>10、其他突发事件的处理。</p>\r\n<p><strong>任职要求：</strong></p>\r\n<p>1、工作经验：1-3年</p>\r\n<p>2、最低学历：大专</p>\r\n<p>3、人力资源、行政管理相关专业</p>\r\n','0','','0','10000','','0','','0','1','|1');
