INSERT INTO `v9_news_data` VALUES('53','<p>2016年7月27日，重庆国际投资咨询有限公司（以下简称重咨公司）总经理贾建国先生一行5人抵达西安，考察位于西安曲江新区的中信蓝海企业集团。 同行的还有重咨公司市场部部长柳林女士、纪检部部长陈志坚先生、经营部部长黄胤先生以及质监部部长彭娟女士。本次几位领导来访意为与中信蓝海企 业集团相关合作做尽职调查。 中信蓝海企业集团经过8年的艰苦拼搏，历经创业和转型，现已发展成为立足陕北、走向全省的规模民营企业。公司拥有200多名高科技管理人才和10家 隶属企业，形成了以实业投资、企业管理；创业孵化、人才建设；工程咨询、项目管理、工程设计；现代农林业为主的多产业并举发展结构。 董事长郭 春河先生先后荣获2010年度&ldquo;榆林市优秀共青团干部&rdquo;，定边县第三届十大青年，第八届陕西省&ldquo;优秀青年创业奖&rdquo;，榆林市&ldquo;青年文明号标兵&rdquo;等称 号。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817022822324.png\" /></p>\r\n<p style=\"text-align: center;\">参观集团公司总部办公区</p>\r\n<p>贾建国总经理一行在中信蓝海企业集团董事长郭春河及集团党支部副书记李进轩等领导的陪同下，参观了集团公司总部办公区，对集团文化布展及党团建设给予了充分肯定。特别是公司关于青春党建指导思想&ldquo;青春之人、青春之地、青春之举&rdquo;的贯彻实施，给予了高度评价。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817023025287.png\" /></p>\r\n<p style=\"text-align: center;\">参观集团公司总部办公区</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817023209264.png\" /></p>\r\n<p style=\"text-align: center;\">参观集团公司总部办公区</p>\r\n<p>座谈会由中信蓝海企业集团营销总监石勇主持，集团副总裁郭春洋、集团项目管理版块延安区域总监张洋、榆林区域总监赵芳、西安区域总监张博及集团旗下同乘工程咨询设计公司总经理李栋出席会议。会上，集团董事长郭春河、党支部副书记李进轩和各版块负责人，就中信蓝海企业集团整体工作和近三年各项经营情况及党建工作，逐一做了介绍。</p>\r\n<p>陕西中信蓝海建设工程项目管理公司设立在集团公司总部，具有工程咨询甲级、招标代理甲级、造价咨询甲级、建设监理甲级、中央投资甲级、政府采购甲级等资质，开展以PPP项目咨询、项目管理、招标代理、造价咨询、建设监理等核心业务，分别在西安、榆林、延安、定边、靖边、吴起、志丹开设分公司。公司汇集全省市相关土木工程，经济管理院校，工民建与工程造价类毕业生，国家注册造价师、招标师、注册评估师、工程咨询师、造价专职人员等130余人，已在全省市范围内累计承接完成各类项目管理类业务6000余项。同乘（中信）工程咨询设计有限公司是一家集建筑设计甲级、机械设计甲级、军工设计甲级、规划设计甲级、市政设计甲级、园林绿化设计甲级、工程咨询甲级于一体的设计咨询服务机构，公司设立于集团公司总部，现有员工50余名，其中研究员级高级工程师3名，高级工程师6名，一级注册建筑师2名，一级注册结构师2名，其他注册师3名。公司在陕西区域下设西安、延安、榆林三个分公司，各公司下设：BIM设计研究部、建筑设计部、市政公路设计部、园林景观设计、装饰设计部、工程咨询部、财务部、综合部、经营部。公司秉承&ldquo;高质量、快响应&rdquo;的服务态度，专注各项工程服务，打造以&ldquo;专业、规范、高效、创新、共赢&rdquo;的服务团队。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817023312119.png\" /></p>\r\n<p style=\"text-align: center;\">座谈会现场</p>\r\n<p>一串串令人瞩目的业绩和令人羡慕的荣誉，是这个创业团队共同努力奋斗的结晶，浸透着全体员工的汗水和心血。&ldquo;把创业当做一生的事业去做&rdquo;、&ldquo;既然选择，必定创造奇迹&rdquo;是郭董事长及他的团队对事业坚定的态度。青春因奋斗而精彩，令人瞩目的业绩和令人羡慕的荣誉，是他与他的创业团队共同努力奋斗的结晶，浸透着全体员工的汗水和心血。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817023424132.png\" /></p>\r\n<p style=\"text-align: center;\">中信蓝海企业集团董事长郭春河先生致辞</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817023529493.png\" /></p>\r\n<p style=\"text-align: center;\">中信蓝海企业集团党支部副书记李进轩</p>\r\n<p>重咨公司贾建国总经理听了介绍后说：中信蓝海企业集团是一家极具潜力的创业型公司，团队建设良好，技术力量过硬，在行业的整体发展趋势中呈上升态势。特别是党建工作&ldquo;1316模式&rdquo;很有创意，很有活力，今后两个集团要互通有无，互相学习，放大思路，迈开脚步，以利润带动新型产业。我们有理由相信董事长郭春河，这个一米八的男人像一条北方的河一样不屈、雄强而又深沉艰忍，将继续带领着他的团队，不断超越，勇往直前，为陕西经济建设做出新的贡献。相信中信蓝海的明天会更好！</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0905/20160905102246492.png\" /></p>\r\n<p style=\"text-align: center;\">重庆国际投资咨询有限公司总经理贾建国先生致辞</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817023908105.png\" /></p>\r\n<p style=\"text-align: center;\">双方互赠纪念品</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817023953387.png\" /></p>\r\n<p style=\"text-align: center;\">合影留念</p>\r\n<p>中信蓝海企业集团认为企业必须承担社会责任，而跟正直善良、互相关爱、尊重的一帮人，一起合法干净地做事，过有尊严、有信心的生活，就是我们最实在的社会责任。中信蓝海企业集团将继续凭借&ldquo;人品创造品质，品质彰显人品&rdquo;的品质理念，&ldquo;心诚至臻，专筑共生&rdquo;的企业理念，勇于开拓市场，设身处地为客户着想，成就梦想，共享荣耀！</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('130','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128111527645.jpg\" /></p>\r\n<p>2016年5月17日下午14时，榆林青年创业管理咨询有限公司党支部召开&ldquo;学党章党规、学系列讲话、做合格党员&rdquo;学习教育动员大会，榆林青创党支部班子成员、全体党员、积极分子及工、青、妇负责人共计23人参加了动员大会。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('131','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128111638237.jpg\" /></p>\r\n<p>为牢记历史，缅怀英烈，深入开展&ldquo;两学一做&rdquo;学习教育活动，2016年6月17日上午，榆林青年创业管理咨询有限公司党支部副书记李进轩带领党员和入党积极分子共40余人，参观了延安革命纪念馆，开展了一次特殊的&ldquo;学党史、讲中国故事&rdquo;党课活动，喜迎建党95周年和红军长征胜利80周年。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('132','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128111750484.jpg\" /></p>\r\n<p>2016年 6月24日 下午16时，榆林青年创业广场管理咨询有限公司召开&ldquo;三会一课，学延安精神、高西沟精神、治沙精神&rdquo;专题学习教育会。党支部成员、全体党员、积极分子参加了学习大会，大会由榆林青创公司顾问刘前进主持召开，并做专题学习辅导。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('133','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128111859891.jpg\" /></p>\r\n<p>2016年7月29日上午10时，榆林青年创业管理咨询有限公司党支部召开&ldquo;习近平总书记在庆祝中国共产党成立95周年大会上的重要讲话&rdquo;及第二次专题学习教育会。党支部成员、全体党员、积极分子共计15人参加了学习大会，大会由党支部副书记李进轩主持并做专题学习辅导,会后党员佩戴党徽、亮身份、践承诺。</p>\r\n','0','','0','10000','','0','','0','1','|1');
