INSERT INTO `v9_news_data` VALUES('138','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128113234781.jpg\" /></p>\r\n<p>2016年5月31日下午，定边县青年创业广场组织创业分享会，由前去北京培训的春禾绿科农业发展有限公司员工范茸茸、华春建设工程项目管理有限责任公司定边分公司员工万云云以及中信建筑设计有限公司员工牛彩林三位分享了由定边县人社局组织的，关于推动&ldquo;大众创业、万众创新&rdquo;工作，开展外出学习培训。分享了她们去北京中关村的学习心得，介绍了中关村的一些情况。</p>\r\n','0','','0','10000','','0','','0','1','|1');
