INSERT INTO `v9_news_data` VALUES('128','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101021532222.jpg\" /></p>\r\n<p>7月6日，榆林市青年企业家协会第二次会员代表大会成功召开，同时举行了会员企业新四板揭牌、挂牌仪式，并与省、市多个单位签署了多方战略合作协议。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101021619175.jpg\" /></p>\r\n<p style=\"text-align: center;\">榆林市金融办与陕西股权交易中心战略协议签署仪式</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101021652817.jpg\" /></p>\r\n<p style=\"text-align: center;\">榆林市青年企业家协会与陕西股权交易中心挂牌孵化基地合作协议签订仪式</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101021739223.jpg\" /></p>\r\n<p style=\"text-align: center;\">榆林青年企业家与金开贷、汇鑫担保战略合作协议签订仪式</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101021812344.jpg\" style=\"width: 550px; height: 370px;\" /></p>\r\n<p style=\"text-align: center;\">榆林市委书记、市人大常委会主任胡志强，陕西金融控股集团董事长权永生为陕西股权交易中心榆林孵化基地揭牌</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101021851212.jpg\" /></p>\r\n<p>在榆林市青企协会员企业新四板揭牌仪式上，定边县春禾绿科农业发展有限公司、榆林市长运集团、绥德县老闫家炒货食品有限责任公司等21家会员单位成功挂牌新四板，为践行榆林市加快建设多层次资本市场、帮助我市中小微企业健康成长，主推经济转型升级起到了重要的推动作用。</p>\r\n<p>7月6日，榆林市首批21家企业通过陕西股权交易中心审核，在榆集中挂牌&ldquo;新四板&rdquo;。定边县春禾绿科农业发展有限责任公司与榆林市其他20家企业一起，成为榆林市第一批进入陕西股权交易中心的企业。</p>\r\n<p><strong>春禾绿科 &nbsp; &nbsp;</strong></p>\r\n<p>农&middot;天下之第一本 &nbsp;为农&middot;春禾之第一使命</p>\r\n<p>春禾绿科，这个即将走过四年青春岁月的企业，自2012年成立以来，一路开拓进取，拼搏创新，力争前列，敢为人先，秉承以服务现代农业为发展方向，描绘属于春禾绿科的美好蓝图。</p>\r\n<p>定边县春禾绿科农业发展有限公司成立于2012年9月，先后注入资本1000万元，公司以农业电子商务为核心业务，下设我家农超农村电商事业部、我家支付事业部、庄稼医院（植保和检测）事业部，其中农产品品牌电商部设立在集团总部。公司现有农林及电子商务类专业人才16名，农、林业专家4人，中青年技术骨干5人，大学毕业生15人。</p>\r\n<p><strong>庄稼医院</strong></p>\r\n<p>精准农业 &nbsp;实效农业 &nbsp;绿色农业</p>\r\n<p>庄稼医院主要以检测服务和植保服务为核心领域，以&ldquo;精准农业、时效农业、绿色农业&rdquo;为宗旨，为农业健康有序发展提供强有力的支撑 。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101022010512.jpg\" /></p>\r\n<p><strong>我家农超</strong></p>\r\n<p>网货下乡 农产品进城 城乡互通</p>\r\n<p>我家农超城乡一体化综合服务平台，通过互联网平台嫁接各种服务于农村的资源，拓展农村信息服务业务、服务领域，使之兼而成为遍布县、镇、村的三农信息服务站，作为农村电子商务平台的实体终端直接扎根于农村，实现网货下乡，农产品进城的目的，真正使三农服务落地，使农民成为平台的最大受益者。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101022114379.jpg\" /></p>\r\n<p style=\"text-align: center;\">我家农超城乡一体化服务平台 定边总站</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101022147533.jpg\" /></p>\r\n<p style=\"text-align: center;\">我家农超城乡一体化服务平台 乡村站</p>\r\n<p><strong>我家支付</strong></p>\r\n<p>我的支付管家</p>\r\n<p>我家支付&mdash;我的支付管家，提供&ldquo;简单、安全、快速&rdquo;的支付解决方案。致力于服务于农业，农村，农民在生产、生活为一体的全功能农村金融产品，注册我家支付账号，可在所有我家农超一体化服务站及加盟商家使用，真正成为服务三农得力的金融助手。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101022254760.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101022312392.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101022344156.jpg\" /></p>\r\n<p style=\"text-align: center;\">陕西股权交易中心张凤鹄为挂牌企业授牌</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101022432236.jpg\" /></p>\r\n<p style=\"text-align: center;\">共青团陕西省委书记段小龙与董事长郭春河共同敲响新四板挂牌的钟声</p>\r\n<p>让我们记住这具有历史纪念意义的时刻：2016年07月06日挂牌成长版，见证了春禾绿科踏入资本市场的重要一步！春禾绿科，农业服务业的新标杆！春禾绿科站在新的起点，将汇聚群力，扬帆起航！</p>\r\n','0','','0','10000','','0','','0','1','|1');
