INSERT INTO `v9_news_data` VALUES('185','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128020224364.jpg\" /></p>\r\n<p>2014年，我集团分公司春禾绿科公司，组织承办了定边县第二十三届&ldquo;科技之春-科普教育宣传月&ldquo;活动。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('186','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128020333649.jpg\" /></p>\r\n<p>2016年7月29日&mdash;31日，呼和浩特首届科技成果博览会在内蒙古国际会展中心开展，展会以&ldquo;促进大众创业、万众创新&rdquo;，展示科技成就，推动科技成果转化，促进科技合作交流，引进科技人才为主题。我集团公司分公司春禾绿科农业发展有限公司的&ldquo;我家农超&rdquo;、&ldquo;庄稼医院&rdquo;互联网+农业项目参加了呼和浩特首届科技成果博览会。</p>\r\n<p>我家农超县域电商服务平台是专业服务三农（农村、农民、农业）的综合农村电子商务平台，其以互联网为平台形成网货下乡、农产品进城的完成供应链，依托县级运营中心、村级体验店、农村消费顾问、城市社区店及电商平台、完成整个链条的无障碍流通，从而达到刺激农村发展、帮助农民致富、带动农业发展的目的。</p>\r\n<p>在博览会上，&ldquo;我家农超&rdquo;项目受到观众及榆林市科技局领导关注，他们了解项目运行方式，市场前景，亲自体验操作过程。对&ldquo;我家农超&rdquo;项目宣传推广起到积极的推动作用。同时企业也看到了国际、国内先进的互联网技术，3D产品打印技术，农业产业新技术，学习借鉴先进科学的新方法和成功经验，提升企业核心竞争力，找到适合发展的创新之路。</p>\r\n','0','','0','10000','','0','','0','1','|1');
