INSERT INTO `v9_news_data` VALUES('193','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1129/20161129010330351.jpg\" /></p>\r\n<p>遵照县非公有制经济组织党建工作委员会&ldquo;关于在全县星级非公企业党组织中开展精准扶贫工作的通知精神&rdquo;，2016年6月30日上午，集团公司副总兼党支部副书记李进轩同春禾绿科公司经理兼青创工会主席郝巨杰到郝滩镇，向镇领导说明来意之后，在郝滩镇政府副镇长郭茸、镇政府办公室副主任徐东进的陪同下，一块来到帮扶的李坑村，看过村容村貌后，同镇、村领导就精准扶贫工作进行了座谈。</p>\r\n','0','','0','10000','','0','','0','1','|1');
