INSERT INTO `v9_news_data` VALUES('195','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128023241382.jpg\" /></p>\r\n<p>2015年9月20日，我司团委在定边县十里沙场馆组织、承办了定边县首届&ldquo;青创杯&rdquo;球类运动会（图为比赛圆满结束后，我司参赛团队在活动场馆合影）</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('196','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128023330210.jpg\" /></p>\r\n<p>2016年11月19日，集团公司华春榆林区分公司，为丰富党群文化生活，在定边县十里沙开展了&ldquo;冬季户外活动&rdquo;。（图为拔河比赛现场，项管部vs招标部）。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('197','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128023452457.jpg\" /></p>\r\n<p>为积极响应公司党支部关于认真贯彻落实省委、省政府和市委关于加强&ldquo;百日攻坚&rdquo;实施方案的一系列指示精神，我集团分公司&mdash;&mdash;同乘（中信）设计榆林区团支部为丰富公司广大青年的业余文化生活，增强青年团队协作意识，提高团组织凝聚力，调整员工心态，做好年底各项工作的攻坚准备，于2016年11月13日联合公司工会、妇委会共同举办了同乘（中信）设计榆林区第一届员工运动会。</p>\r\n<p>出席本次开幕式的有公司党小组组长、公司经理卜一峰、工会小组组长牛彩林、团支部书记张博、妇女小组组长白月玲及全体员工。（图为桌球比赛，决出的3个单项奖获得者合影。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('198','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128023548285.jpg\" /></p>\r\n<p>展团队精神，扬青春风采。2013年10月，我集团公司华春定边分公司团支部组织全体青年员工在秦岭开展拓展训练</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('70','<p>陕西省中信蓝海工程项目管理有限公司具有国家甲级工程造价咨询、国家甲级工程招标代理、国家甲级政府采购、国家甲级价格评估、中央投资建设项目招标代理、陕西省室内装饰工程招标代理，工程咨询，工程监理和陕西省高等法院，陕西省司法厅司法鉴定资格的建设工程项目管理单位，是全国首家行业内主管业务，通过ISO9001：2000国际质量管理体系认证企业。</p>','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('74','<p style=\"text-indent:0;\"><strong>岗位职责：</strong></p>\r\n<p style=\"text-indent:0;\">1、负责商城店铺整体策划，店铺风格定位；</p>\r\n<p style=\"text-indent:0;\">2、负责淘宝商城的选品、定价、活动策划；</p>\r\n<p style=\"text-indent:0;\">3、流量引入，提升转化率；</p>\r\n<p style=\"text-indent:0;\">4、维护淘宝、厂商客情关系，做好日常信息的对接；</p>\r\n<p style=\"text-indent:0;\">5、提高库存周转率，负责每日营销数据、交易数据的统计分析；</p>\r\n<p style=\"text-indent:0;\">6、研究竞争对手，制定并实施相应的竞争对策；</p>\r\n<p style=\"text-indent:0;\">7、提高商城店铺的各项评价数据；</p>\r\n<p style=\"text-indent:0;\">8、擅长商城旗舰店运作,精通聚划算,直通车,淘宝客,掌柜说,淘宝帮派,社区及淘宝内部活动等操作和数据分析管理；</p>\r\n<p style=\"text-indent:0;\"><strong>任职要求：</strong></p>\r\n<p style=\"text-indent:0;\">1、一年以上淘宝、京东等平台工作经验，熟悉对应平台规则；</p>\r\n<p style=\"text-indent:0;\">2、乐于在电子商务领域挥霍青春、挥洒汗水；</p>\r\n<p style=\"text-indent:0;\">3、大专以上学历；</p>\r\n<p style=\"text-indent:0;\">4、有食品运营经验者优先。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('169','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128012031309.jpg\" /></p>\r\n<p>2016年11月24日，集团公司项目管理延安区志丹分公司，工会小组组织公司全体举行&ldquo;志丹分公司第一届职工大会&rdquo;，出席会议的有延安区域技术总监兼志丹分公司工会小组组长、公司经理兼党小组组长李小斌等。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('168','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128011041281.jpg\" /></p>\r\n<p>2016年11月2日上午11时，我司党支部在党建活动室召开关于&ldquo;全体党员学习贯彻党的十八届六中全会精神&rdquo;的会议。各党群组织负责人、党支部成员、全体党员、积极分子共计18人参加了本次会议，大会由党支部书记郭春河主持并做重要讲话，他讲到：我司&ldquo;青春党建&rdquo;的指导思想是应党的十八大要求，要关注青年，关心青年，关爱青年，倾听青年心声，鼓励青年成长，支持青年创业。对我司党群来说一要凝聚&ldquo;青春之人&rdquo;即梦想起航、不忘初心、永在路上；二要驻进&ldquo;青春之地&rdquo;即创业孵化、科技创新、平台搭建；三要擅作&ldquo;青春之举&rdquo;即创业就业、改变观念、勇担责任；各子分公司群团必须紧密结合实际，以对接发展、服务大局、拓展领域、强化功能为切入点，更好地确立工作目标、工作内容、工作方式、工作机制，切实提高宣传教育、创新技术、项目推进、安全保障的能力和实效，加强党组织建设和党员的教育管理，不断扩大党的组织和工作覆盖，充分发挥工青妇作用，维护职工群众合法权益、引领建设先进企业文化，紧紧围绕党的中心任务和企业生产经营开展工作，始终使党组织真正成为党在企业中的战斗堡垒，增强党组织的凝聚力、战斗力和影响力，促进企业成为生产经营好、企业文化好、劳动关系好、党组织班子好、党员队伍好、社会反映好的先进非公企业示范点，为青创服务事业的快速发展提供坚实的组织保障，确保我司党组织在2017年晋位升级，在全省起到旗帜示范作用。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('66','<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0907/20160907045632614.jpg\" /></p>\r\n<p>榆林青年创业管理咨询有限公司（以下简称公司）注册成立于2015年5月，注册资金2000万，法定代表人郭春河，企业性质为社会性企业。公司位于定边县英华西路英华小区商业楼，建筑面积为3150平米，上下5层结构，其中的2-5层主要以商用写字办公为主体，分割为100-300㎡面积不等的办公格局，可以满足各类中小企业办公，1层为商业，办公楼装修设计呈现现代气息，内部设有办公区、党团（群团组织）活动室、多功能会议大厅、工作休闲区、员工休息区，无线网络全覆盖，工作环境优雅，服务设施齐全，现代时尚的办公场所符合青年人创意气氛。<br />\r\n&nbsp;</p>\r\n<p style=\"font-weight:bold\"><span style=\"color:#ff0000;\"><span style=\"font-size:16px;\">一、公司组织架构</span></span></p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1012/20161012111335961.jpg\" /></p>\r\n<p style=\"font-weight:bold\"><br />\r\n<span style=\"color:#ff0000;\"><span style=\"font-size:16px;\">二、核心业务</span></span></p>\r\n<p><strong>培训中心：</strong></p>\r\n<p>（1）创业就业培训 ：</p>\r\n<p>致力于帮助应往届大学生就业创业，培训辅导解决大学生就业难；下岗职工再就业，通过培训相关人员使其掌握一定技能胜任相关工作，解决下岗职工失业再就业问题。</p>\r\n<p><strong>培训流程：</strong></p>\r\n<p>摸底调查&rarr;收集企业所需人才&rarr;集中培训大学生及下岗职工&rarr;测试考核&rarr;联系相关企业&rarr;输送优秀人才</p>\r\n<p>（2）行业类培训</p>\r\n<p>致力于社会各行业的专业技术型人才的培训。主要培训范围有：电子商务培训、计算机网络管理及相关专业技术信息服务、礼仪类培训、财务类培训、服务行业的培训、农业各项种植类技术培训、畜牧业各类禽畜养殖技术培训。</p>\r\n<p><strong>培训流程：</strong></p>\r\n<p>定期组织相关领域专家&rarr;为所需服务的企业设计相关课程&rarr;集中培训&rarr;奖励制测试考核&rarr;企业落地跟踪</p>\r\n<p>（3）建筑类资格认证培训</p>\r\n<p>经过理论培训和实际操作培训，并且通过相关测试考核，使其取得相关岗位的从业资格证书。</p>\r\n<p><strong>培训流程：</strong></p>\r\n<p>定期组织开设相关课程&rarr;专家理论课程培训&rarr;实践操作培训&rarr;理论及操作考核&rarr;申请相关资格证</p>\r\n<p>（4）企业管理类培训 &nbsp;&nbsp;</p>\r\n<p>针对企业开展的一种提高人员素质、能力、工作绩效和对组织的贡献，而实施的有计划、系统的培养和训练活动。使得员工的知识、技能、工作方法、工作态度以及工作的价值观得到改善和提高，从而发挥出最大的潜力提高个人和组织的业绩，推动组织和个人的不断进步，实现组织和个人的双重发展。</p>\r\n<p><strong>孵化中心：</strong></p>\r\n<p>孵化器搭建&ldquo;创业咨询、市场开拓、投融资、技术支撑、信息管理&rdquo;五大专业特色服务平台，为入驻的创业企业提供全方位综合性服务。</p>\r\n<p><strong>五大服务平台：</strong></p>\r\n<p>A.创业咨询平台</p>\r\n<p>依托政府相关职能部门和管理运营团队，为创业企业提供包含政策、法律、工商、税务等方面的专业咨询及营销策略服务和&ldquo;一站式&rdquo;代理服务。</p>\r\n<p>B.市场开拓平台</p>\r\n<p>积极整合各方面资源，为创业企业提供产品推介、成果展示、业务拓展、文化活动、品牌营销等服务，实现大学生创业与市场的有效链接。</p>\r\n<p>C.投融资平台</p>\r\n<p>通过引进创投机构跟踪和投资、自筹资金投入、开展投融资培训、金融贷款等方式，不断拓宽创业企业的融资渠道。</p>\r\n<p>D.技术支撑平台</p>\r\n<p>从&ldquo;软技术&rdquo;&ldquo;硬技术&rdquo;两方面入手，为创业企业提供导师技术指导。</p>\r\n<p>E.信息管理平台</p>\r\n<p>信息管理平台</p>\r\n<p>运用现代信息技术，集成化管理&ldquo;孵化器&rdquo;的各种信息，搭建信息资源整合平台，实现&ldquo;孵化器&rdquo;内外部信息的共享和有效利用。<br />\r\n&nbsp;</p>\r\n<p style=\"font-weight:bold\"><span style=\"color:#ff0000;\"><span style=\"font-size:16px;\">三、业务流程</span></span></p>\r\n<p><strong>孵化中心：</strong></p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0825/20160825095706770.png\" /></p>\r\n<p style=\"font-weight:bold\"><br />\r\n<span style=\"color:#ff0000;\"><span style=\"font-size:16px;\">四、战略规划</span></span></p>\r\n<p>榆林青年创业管理咨询有限公司整体以建设创新创业孵化器为突破，夯实科技发展基础;以增强科技孵化能力为重点，打造&ldquo;大众创业服务、万众创新服务和科技成果转化服务&rdquo;的&ldquo;众创空间&rdquo;服务平台;以市场为导向，采用现代企业和科技管理运营模式，充分利用社会及民间资源，强化与大专院校、科研部门的技术联合，为广大创新创业人员提供良好的工作空间、网络空间、社交空间和资源空间，以创业促进就业，孵化培育一大批创新型小微企业，形成新的产业业态，为建设创新创业型榆林提供科技支撑和新的经济增长点。在2018年成为全陕西省最具潜质的创新创业平台。</p>\r\n<p style=\"font-weight:bold\"><br />\r\n<span style=\"font-size:16px;\"><span style=\"color:#ff0000;\">五、公司资质</span></span></p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1013/20161013020253778.jpg\" /></p>\r\n<p style=\"font-weight:bold\"><br />\r\n<span style=\"font-size:16px;\"><span style=\"color:#ff0000;\">六、政府职能部门对公司的授牌</span></span></p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0907/20160907045652820.jpg\" /></p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0907/20160907045706921.jpg\" /></p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0907/20160907045718584.jpg\" /></p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0907/20160907045731295.jpg\" /></p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('149','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128110227112.jpg\" /></p>\r\n<p style=\"text-align: center;\">2008年公司董事长兼总经理郭春河代表我司&ldquo;情系玉树奉献爱心&rdquo;。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('67','<p><strong>一、广场建设的背景和意义</strong></p>\r\n<p>当前，我国就业形势十分严峻，青年实现就业创业找到合适的工作岗位是融入社会生活，解决生存最基本的途径和迫切的需求。为了帮助带动广大有志青年共同创业，实现就业，本项目积极响应政府各项就业创业支持政策，本着服务于大众的宗旨，从创业环境的建设、创业项目的推介、创业意识的启迪、创业模式的探索、创业人才的培育，创业岗位的开发等多方面进行了积极有效的探索。</p>\r\n<p>创业广场建成后，将提供职业指导、岗位对接、人力资源培训、电子商务培训及电子商务技术外包服务、创业项目指导、政策咨询、资金扶持，开展不同内容的创业活动或论坛，切实地推动我县就业创业事业的蓬勃发展。</p>\r\n<p>以青年创业广场为载体，充分发挥人力资源辐射带动优势，是实现高质量创业和充分就业的重要举措，对于推动为县经济发展市场资源配置，提高劳动者素养和企业管理创新转变具有十分重要的社会意义。</p>\r\n<p><strong>二、软件服务力量</strong></p>\r\n<p>1、政策依托</p>\r\n<p>依托陕西省创业联盟、陕西省青年企业家协会、阿里巴巴集团、初橙&mdash;阿里校友创业服务平台、洪泰基金会等，为中小企业初创者提供产业政策咨询、市场预测、可行性研究以及投资概算和人才设备等创办初期的策划咨询。</p>\r\n<p><strong>三、师资力量</strong></p>\r\n<p>1、与&ldquo;陕西省创业导师俱乐部&rdquo;形成长期合作关系；</p>\r\n<p>2、与省级以上同行业之间建立导师团队资源共享；</p>\r\n<p>3、与陕西省西北大学、西北农林科技大学等高校形成校企合作充分利用高校内电子商务、企业管理等业内专家教授；</p>\r\n<p>4、向省、市范围内招募有实践经验的精英导师来针对不同课程授课；</p>\r\n<p>5、公司以&ldquo;引进与培养并举&rdquo;的导师管理理念，不断培养企业自身导师力量。</p>\r\n<p><strong>四、入孵企业：</strong></p>\r\n<table align=\"center\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"border-color:#CCC;\" width=\"660\">\r\n<tbody>\r\n	<tr>\r\n	<td height=\"30\" width=\"314\">&nbsp; 公司名称</td>\r\n	<td align=\"center\" height=\"30\" width=\"126\">负责人</td>\r\n	<td align=\"center\" height=\"30\" width=\"105\">人数</td>\r\n	<td align=\"center\" height=\"30\" width=\"105\">备 注</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"30\">&nbsp; 榆林中信设计</td>\r\n	<td align=\"center\" height=\"30\">李 栋</td>\r\n	<td align=\"center\" height=\"30\">25</td>\r\n	<td align=\"center\" height=\"30\">&nbsp;</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"30\">&nbsp; 华春项目管理</td>\r\n	<td align=\"center\" height=\"30\">赵 芳</td>\r\n	<td align=\"center\" height=\"30\">32</td>\r\n	<td align=\"center\" height=\"30\">&nbsp;</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"30\">&nbsp; 我家农超</td>\r\n	<td align=\"center\" height=\"30\">张树磊</td>\r\n	<td align=\"center\" height=\"30\">16</td>\r\n	<td align=\"center\" height=\"30\">&nbsp;</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"30\">&nbsp; 春禾绿科</td>\r\n	<td align=\"center\" height=\"30\">郝巨杰</td>\r\n	<td align=\"center\" height=\"30\">11</td>\r\n	<td align=\"center\" height=\"30\">&nbsp;</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"30\">&nbsp; 东臻帮付</td>\r\n	<td align=\"center\" height=\"30\">高绍伟</td>\r\n	<td align=\"center\" height=\"30\">6</td>\r\n	<td align=\"center\" height=\"30\">&nbsp;</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"30\">&nbsp; 橘子科技</td>\r\n	<td align=\"center\" height=\"30\">何云洁</td>\r\n	<td align=\"center\" height=\"30\">8</td>\r\n	<td align=\"center\" height=\"30\">&nbsp;</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"30\">&nbsp; 榆林惠农易购</td>\r\n	<td align=\"center\" height=\"30\">孟 旭</td>\r\n	<td align=\"center\" height=\"30\">8</td>\r\n	<td align=\"center\" height=\"30\">项目团队</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"30\">&nbsp; 定边农业技术协会</td>\r\n	<td align=\"center\" height=\"30\">赵 磊</td>\r\n	<td align=\"center\" height=\"30\">6</td>\r\n	<td align=\"center\" height=\"30\">项目团队</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"30\">&nbsp; 定边益起电子商务有限公司</td>\r\n	<td align=\"center\" height=\"30\">汪奕存</td>\r\n	<td align=\"center\" height=\"30\">10</td>\r\n	<td align=\"center\" height=\"30\">&nbsp;</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"30\">&nbsp; 舞之韵少儿艺术教育</td>\r\n	<td align=\"center\" height=\"30\">冯 倩</td>\r\n	<td align=\"center\" height=\"30\">12</td>\r\n	<td align=\"center\" height=\"30\">&nbsp;</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"30\">&nbsp; 红盖头文化传媒有限公司</td>\r\n	<td align=\"center\" height=\"30\">曹海飞</td>\r\n	<td align=\"center\" height=\"30\">6</td>\r\n	<td align=\"center\" height=\"30\">&nbsp;</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"30\">&nbsp; 定边县昱通工贸有限公司</td>\r\n	<td align=\"center\" height=\"30\">任志佳</td>\r\n	<td align=\"center\" height=\"30\">9</td>\r\n	<td align=\"center\" height=\"30\">&nbsp;</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"30\">&nbsp; 众诚法律咨询中心</td>\r\n	<td align=\"center\" height=\"30\">张 楠</td>\r\n	<td align=\"center\" height=\"30\">6</td>\r\n	<td align=\"center\" height=\"30\">&nbsp;</td>\r\n	</tr>\r\n</tbody>\r\n</table>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1013/20161013015033433.jpg\" /></p>\r\n<p><strong>五、硬件服务力量</strong></p>\r\n<p style=\"text-align: center;\">青年创业广场实地景象</p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0825/20160825101420342.png\" /></p>\r\n<p style=\"text-align: center;\">青年创业广场外景</p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0825/20160825101458805.png\" /></p>\r\n<p style=\"text-align: center;\">&mdash;&mdash;多功能会议大厅</p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1017/20161017034654348.jpg\" /></p>\r\n<p style=\"text-align: center;\">&mdash;&mdash;多媒体会议室</p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1017/20161017034711985.jpg\" /></p>\r\n<p style=\"text-align: center;\">&mdash;&mdash;党、团、工会、组织</p>\r\n<p><strong>六、公司相关业绩荣誉</strong></p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0825/20160825101703611.png\" /></p>\r\n<p style=\"text-align: center;\">省人社厅领导视察</p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1017/20161017035023791.jpg\" /></p>\r\n<p style=\"text-align: center;\">榆林市团市委书记殷海舰实践体验电子商城的便利服务</p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1017/20161017035037597.jpg\" /></p>\r\n<p style=\"text-align: center;\">定边县常务副县长&mdash;&mdash;焦利民考察青年创业广场</p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1017/20161017035051939.jpg\" /></p>\r\n<p style=\"text-align: center;\">市组织部领导视察公司农产品电子商务运营中心</p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0825/20160825103406262.png\" /></p>\r\n<p style=\"text-align: center;\">青创公司组织定边县全民创业公益培训现场</p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0825/20160825103459308.png\" /></p>\r\n<p style=\"text-align: center;\">定边县电子商务&mdash;全民微店项目培训现场</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('151','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128110312682.jpg\" /></p>\r\n<p>2015年2月青创工会主席、春禾绿科公司经理郝巨杰带领工会一行为定边辛勤奉献的环卫工人送上爱心蔬菜。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('150','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128110248371.jpg\" /></p>\r\n<p>2013年公司董事长兼总经理郭春河代表我司参与团县委组织的&ldquo;助梦未来&rdquo;青年企业家助学活动，向困难学子自助5000元人民币，助其完成学业。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('104','<p>9月8号在青年创业广场五楼会议室召开了2016年见习生入司培训会，参与本次会议的有行政中心陈丹、窦丽萍，经财中心李晓云。</p>\r\n<p>培训主要针对于公司管理手册上的内容进行理解，针对员工在日常工作中会遇到的一些业务知识进行了讲解培训时间为2小时。</p>\r\n<p><span style=\"color:#14a1fb;\"><span style=\"font-size:16px;\"><strong>此次培训的目的是：</strong></span></span></p>\r\n<p>一、帮助新进员工快速融入公司文化，树立统一的企业价值观、行为模式，了解和认同公司的发展战略。</p>\r\n<p>二、帮助新进员工尽快熟悉公司规章制度、利于新员工工作开展过程中有章可循、有制可依。</p>\r\n<p>三、帮助新进员工尽快胜任本职工作及了解人事行政的各项工作流程，提高员工履行职责的能力及工作效率。</p>\r\n<p>四、协助新进人员尽快适应新的工作环境，顺利进入工作状态。</p>\r\n<p>五、培养良好的工作心态、职业素质，提高员工工作热情、团队精神，为胜任岗位工作打下坚实的基础。</p>\r\n<p><span style=\"color:#14a1fb;\"><span style=\"font-size:16px;\"><strong>此次培训内容：</strong></span></span></p>\r\n<p><strong>一、培训开始，员工陆续到场</strong></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1017/20161017052616381.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1017/20161017052629493.jpg\" /></p>\r\n<p><strong>二、行政窦丽萍针对公司制度等进行培训</strong></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1017/20161017052725597.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1017/20161017052737594.jpg\" /></p>\r\n<p><strong>三、人事陈丹针对公司日常人事管理进行培训</strong></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1017/20161017052811640.jpg\" /></p>\r\n<p><strong>四、财务李晓云针对基础财务制度进行培训</strong></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1017/20161017052846656.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1017/20161017052903716.jpg\" /></p>\r\n<p>培训最后现场进行了交流，针对新进员工有疑问的现场进行了解答，由培训主持窦丽萍对本次培训进行了总结，并对新进员工表示热烈欢迎。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('144','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128105914536.jpg\" /></p>\r\n<p>2012年3月我司成立华春靖边分公司，建立靖边办公区。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('105','<p><strong>一、项目名称：</strong>陕西延长中煤榆林能源化工有限公司信息化规划编制项目</p>\r\n<p><strong>二、招标人：</strong>陕西延长中煤榆林能源化工有限公司</p>\r\n<p><strong>三、招标代理机构：</strong>华春建设工程项目管理有限责任公司</p>\r\n<p><strong>四、招标范围：</strong></p>\r\n<p>（1）设计信息化目标体系架构，包括业务功能、应用、数据、基础设施、管控和安全等，编制企业未来5年信息化规划；</p>\r\n<p>（2）遵循企业的长期业务目标，制定信息化整体应用架构；</p>\r\n<p>（3）制定信息化技术架构和信息化管理体系；</p>\r\n<p>（4）调研目前企业现有运行系统模块，分析相关系统之间的集成关系，提出明确的系统集成方案；</p>\r\n<p>（5）根据总体规划，提出信息化项目建设的步骤、路线图；</p>\r\n<p>（6）制定出项目实施清单及投入费用估算。</p>\r\n<p><strong>五、标段划分：</strong>共划分为一个标段。</p>\r\n<p><strong>六、服务周期：</strong>合同签订后三个月。</p>\r\n<p><strong>七、投标人资格及条件：</strong></p>\r\n<p>1、投标单位必须是依据中华人民共和国有关法律设立的，并在中华人民共和国境内正式注册的、具有独立法人资格，注册资本金500万元及以上；投标企业经营范围包含IT服务、IT系统开发与实施、IT咨询或信息系统规划相关业务；</p>\r\n<p>2、投标单位须具有2013年至今至少5套以上大型石化企业信息化规划编制或信息化项目建设的经验和业绩，且有改造和持续改进的业绩；</p>\r\n<p>3、投标单位须具有完善的质量保证体系及质量管理体系认证证书；</p>\r\n<p>4、投标单位须具有中华人民共和国工业和信息化部颁发的计算机信息系统集成壹级资质,软件企业能力成熟度CMMI 3以上（包括3级）；</p>\r\n<p>5、本项目不接受联合体投标。</p>\r\n<p><strong>八、招标文件的获取</strong></p>\r\n<p>1、获取招标文件时间：2016年9月13日起至2016年9月20日（法定节假日、公休日除外）；</p>\r\n<p>2、获取招标文件地址：陕西省西安市雁南五路1868号曲江影视大厦10层（华春建设工程项目管理有限责任公司）；</p>\r\n<p>3、招标文件售价：500元/本，售后不退；</p>\r\n<p>4、投标人购买招标文件时需携带下列资料原件及逐页加盖单位公章的复印件2套：</p>\r\n<p>①企业介绍信；②法定代表人身份证（法定代表人直接参与投标时），或法定代表人身份证复印件、法定代表人授权书及被授权人身份证（法定代表人不直接参与投标时）；③具有独立法人资格的营业执照、组织机构代码证、税务登记证（或者三证合一的营业执照，注册资金500万元及以上）；④质量管理体系认证证书；⑤具有中华人民共和国工业和信息化部颁发的计算机信息系统集成壹级资质；⑥软件企业能力成熟度CMMI 3以上（包括3级）；⑦具有2013年至今至少5套以上大型石化企业信息化规划编制或信息化项目建设的经验和业绩，且有改造和持续改进的业绩。</p>\r\n<p><strong>九、资格审查方式和办法：</strong>资格后审，综合评估法。</p>\r\n<p><strong>十、投标文件的递交及开标</strong></p>\r\n<p>1、投标截止时间/开标时间：2016年10月14日上午9:00；</p>\r\n<p>2、投标文件递交地点/开标地点：陕西省西安市雁南五路1868号曲江影视大厦10层中信蓝海大会议室（华春建设工程项目管理有限责任公司）；</p>\r\n<p>3、逾期送达的或者未送达定地点的投标文件，将不予受理。</p>\r\n<p><strong>十一、联系人、联系电话：</strong>冯工/刘工 &nbsp; &nbsp;029-68766991-616/18509292765</p>\r\n<p><strong>十二、公告发布媒介：</strong>本公告在&ldquo;陕西采购与招标网（www.sntba.com）&rdquo;发布，本公告的变更、澄清以&ldquo;陕西采购与招标网&rdquo;为准。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('86','<p><strong>岗位职责：</strong></p>\r\n<p>1、公司人力资源管理制度的起草、修订、实施。</p>\r\n<p>2、负责公司人员的招聘、录用、试用期管理。</p>\r\n<p>3、负责公司人员的劳动合同签署、人事档案的建立及管理。</p>\r\n<p>4、负责公司各级管理人员和职能单位人员的薪资、社保与福利管理。</p>\r\n<p>5、负责公司人员的异动、离职管理，依据集团战略发展要求，组建员工晋升体系及竞聘上岗机制。</p>\r\n<p>6、对员工进行培训管理，制定培训计划，并安排落实。</p>\r\n<p>7、绩效管理，制定绩效考核方案，并安排落实。</p>\r\n<p>8、研究和分析国家、地区人力资源类相关政策、法规，保障集团政策合法性；与相关政府机构(当地的社会保障局、社保中心、职介服务中心等机构)建立良好的关系。</p>\r\n<p>9、负责人力资源配置与战略信息搜集，为相关决策提供支持。</p>\r\n<p>10、负责与员工进行积极沟通，促进公司与员工关系和谐发展，处理企业内部发生的员工劳动纠纷。</p>\r\n<p>11、领导交办的其他工作。</p>\r\n<p><strong>任职要求：</strong></p>\r\n<p>1、工作经验：1-3年</p>\r\n<p>2、最低学历：大专</p>\r\n<p>3、人力资源、行政管理相关专业</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('87','<p><strong>岗位职责：</strong></p>\r\n<p>1、参与制定本公司财务制度及相应的实施细则，参与本公司的项目可行性研究和项目评估中的财务分析工作。</p>\r\n<p>2、负责对财务工作有关的外部及政府部门，如税务局、财政局、银行、会计事务所等联络、沟通工作，维护公司利益。</p>\r\n<p>3、负责资金管理、调度。编制月、季、年度财务情况说明分析，向公司领导报告公司经营情况，提供董事会及总经理所需的财务数据资料的整理编报。</p>\r\n<p>4、负责每月凭证的编制，汇总所有的记账凭证。</p>\r\n<p>5、负责公司总帐及所有明细分类账的记账、结账、核对。</p>\r\n<p>6、负责公司全年的会计报表、帐薄装订及会计资料保管工作。</p>\r\n<p>7、负责分子公司工资审核，报表审核，日报数据检查汇总上报。</p>\r\n<p>8、负责税务申报审核工作，做到监督审查，提出合理避税必要措施。了解学习最新税收优惠政策并实际应用于对口分子公司。</p>\r\n<p><strong>任职要求：</strong></p>\r\n<p>1、工作经验：1-3年</p>\r\n<p>2、最低学历：本科</p>\r\n<p>3、财政学、会计学等相关专业</p>\r\n','0','','0','10000','','0','','0','1','|1');
