INSERT INTO `v9_news_data` VALUES('157','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128114129262.jpg\" /></p>\r\n<p>2016年7月青创党支部副书记、公司副总经理李进轩同青创工会主席、春禾绿科公司经理郝巨杰在郝滩镇政府副镇长郭茸、镇政府办公室副主任徐东进的陪同下，到郝滩镇李坑村，同镇、村领导就精准扶贫工作进行座谈。</p>\r\n','0','','0','10000','','0','','0','1','|0');
INSERT INTO `v9_news_data` VALUES('121','<p style=\"text-align: center;\"><strong><span style=\"font-size:20px;\">榆林市青年企业家协会一行<br />\r\n莅临中信蓝海企业集团进行考察交流活动</span></strong></p>\r\n<p>8月23日下午3时，榆林市青年企业家协会在黄小波会长的带领下，来到中信蓝海企业集团考察指导工作，针对集团公司在全省开展PPP咨询、PPP投资业务展开讨论。考察一行的有汇鑫担保高鹏先生，荣洋惠农刘浩洋先生，神木县青企协会长贺杰先生，通海绒业董事长田其生先生，汇鑫担保周小妮女士，平安银行西安支行郑彦军先生，清涧县青企协会长杨小静先生及神木金钻投资池波先生。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020090731488.png\" /></p>\r\n<p>集团董事长郭春河先生对考察团一行的到来表示热烈欢迎，并就我集团公司的组织架构、业务开展、文化建设情况作以介绍并陪同考察团一行参观了集团公司总部各办公区域，一行人对集团公司的硬件设施、文化建设等给予了高度评价，纷纷表示彼此间要加强沟通学习。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020090813506.png\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020090832145.png\" /></p>\r\n<p>在正式的交流环节，首先由集团总经理郭春洋先生对公司当前的发展现状、业务范围及取得的成绩做了详实介绍，并对各企业家向中信蓝海企业集团的关注和指导表示感谢。接下来由项目管理板块营销总监石勇先生、设计公司总经理李栋先生，分别就目前我集团重庆国际投资咨询集团（陕西）有限公司（以下简称&ldquo;重咨（陕西）分公司&rdquo;）重点业务&mdash;PPP项目咨询、BIM技术，进行了全面的介绍和分析，引起了与会人员的高度关注。最后，集团董事长郭春河先生，对各位企业家的莅临指导再次表示感谢，并希望企业家们通过此次交流考察，进一步增进对中信蓝海企业集团的了解，以创新合作方式，建立起长期、互惠、合作、共赢的关系，实现资源共享、优势互补。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020090917105.png\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020090936270.png\" /></p>\r\n<p>黄小波会长听取完大家的报告后，对集团取得的成绩进行了充分肯定和高度赞扬，希望在以后的工作中能够再接再厉，加强交流，实现集团公司的长足发展。高鹏副会长对我重咨（陕西）分公司的品牌优势、硬件优势及信息优势也给予了高度评价，并对今后的业务发展做了补充建议：一是要以创新为抓手，实现该行业各区域的协同发展；二是把握三大机遇，利用政策机遇顺势而为，抓好市场机遇力争上游，抢占资源机遇做到人才储备充足、资本储备正常、技术储备丰厚、人脉储备广阔；三是实现一个思考，降低企业运营成本，提高工作效率，做好风险把控，力争集团化公司朝着科学、合理、健康的模式发展。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020091011153.png\" /></p>\r\n<p>这次考察交流活动，旨在实现青年企业家相互学习、共同提高、拓宽视野、合作事业。通过此次活动，为我集团公司的发展注入了一股新的思想流，也为以后各项业务的开展奠定了一定的基础。相信在各位青年企业家的合力沟通协作下，中信蓝海企业集团定能实现新的展望！</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('122','<p>丹桂飘香时，月圆中秋到，在一年一度的传统节日来临之际，为了让公司员工度过一个欢乐祥和的节日，让每位员工充分感受到公司大家庭的温暖，公司于9月13-14日陆续为全体职工发放节日慰问品及慰问金，以表最诚挚的节日问候。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020092132488.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020092145802.jpg\" /></p>\r\n<p>近年来，每逢传统佳节公司都会在第一时间将关爱送到每位员工手中，充分体现了公司坚持以人为本的优先发展导向，不断为职工办实事、办好事，提升职工的幸福指数，从员工的笑语中，可以看出员工们感受到了公司的人文关怀，在接过慰问品时员工们不忘说道：&ldquo;感谢公司的节日慰问，我们深切地感受到了家一样的温暖。&rdquo;大家纷纷表示要一如既往的认真工作，全力以赴干好本职工作，化关怀为动力，为公司的发展壮大，齐心协力贡献自己的应有的力量。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020092158731.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020092210993.jpg\" /></p>\r\n<p>同时，公司第一时间也为员工发送了中秋祝福信息，让所有人都能在点滴中感受到家的氛围。但愿人长久，千里共婵娟。在此，中信蓝海企业集团再次感谢每位员工的辛勤付出，衷心祝愿全体员工及其家人：中秋快乐！身体健康！万事如意！</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020091727556.png\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020092226435.jpg\" /></p>\r\n<p style=\"text-align: right;\">中信蓝海企业集团<br />\r\n2016年9月14日</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('156','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1128/20161128114041893.jpg\" /></p>\r\n<p>2014年10月公司党支部书记、公司总经理郭春河在榆林参加团县委组织的&ldquo;我的中国梦&mdash;&mdash;奋斗的青春最美丽&rdquo;分享会，并做创业分享报告。</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('123','<p style=\"text-align: center;\"><span style=\"font-size:20px;\"><strong>延安市副市长杨霄、西安市定边商会一行<br />\r\n莅临中信蓝海集团延安分公司检查指导工作</strong></span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020092645434.png\" /></p>\r\n<p>9月25日上午，延安市副市长杨霄、西安市定边商会一行莅临中信蓝海企业集团延安分公司进行工作检查、指导。集团董事长郭春河、延安区域总监张洋及相关部室负责人对来访人员进行了热情接待，并对集团的基本情况做了深入介绍。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020092751573.png\" /></p>\r\n<p>首先，董事长郭春河先生，对公司的机构组成、人员结构、党团工妇建设、公司发展历程做了详细介绍，并引导一行人员对延安分公司的办公环境进行了参观，杨霄副市长、魏云章会长对我司的硬件设施、文化建设等给予了充分肯定，杨副市长鼓舞大家：&ldquo;延安公司办公环境虽然不大，但设施完全。当年毛主席就是在延安一所小小的指挥所里完成了伟大事业，今天你们在这小小的办公室也要创造属于自己的梦想。&rdquo;</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020092824783.png\" /></p>\r\n<p>接着，延安区域总监张洋先生对公司当前的发展现状、业务范围及发展规划向领导进行了一一介绍，列举了企业目前在行业领域取得的一些进展及成绩。董事长郭春河先生，对公司目前的重点项目、重点合作伙伴做了补充介绍，并对公司的未来展望向各位领导做了汇报。听取完汇报后，杨副市长、魏会长一行对中信蓝海企业集团的整体综合实力及艰苦创业、开拓创新的精神给予了高度赞赏并对我司的未来发展提出了几点希望：</p>\r\n<p>一是凝心聚力，建设一支忠诚度高、素质过硬的人才队伍；二是履行责任，充分践行&ldquo;大众创新、万众创业&rdquo;的号召，积极发挥中信蓝海人员年轻化的优势，带动更多的人敢创业、会创业；三是加大创新，要充分利用互联网、大数据给当前行业发展带来的新思路，尽快适应新形势；四是把握机遇，利用政策机遇顺势而为，抓好市场机遇力争上游，不断壮大公司的发展。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020092911985.png\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020092927315.png\" /></p>\r\n<p>整个视察过程，轻松愉快，公司上下士气高涨，以杨副市长、魏会长一行检查指导为契机，在接下来的工作中，公司全体定会不断完善各项机制，加强学习、不断提高，充分发扬艰苦奋斗的红色革命精神，强化创新合作意识，为延安区域乃正整个陕西地区的行业发展贡献应有的力量！</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('124','<p style=\"text-align: center;\"><strong><span style=\"font-size:20px;\">风雨兼程七春秋 一路高歌写辉煌<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; －中信蓝海企业集团2016年海南品质之旅</span></strong></p>\r\n<p>2016年是公司规模发展壮大，企业管理日渐完善，各项业务蒸蒸日上的突破之年。为感谢员工的辛勤付出，营造和谐融洽的集体氛围，在金秋送爽，喜获丰收的9月，公司特组织员工到海南欣赏祖国大好海域风光。大家置身于大自然的怀抱之中，纵情山水，度过了愉快的六天。</p>\r\n<p>本次出行公司上下高度重视，经过前期的周密计划、详细安排， 9月28日，大家怀着兴奋的心情，踏上了旅程，一路上欢声笑语、其乐融融。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020100741377.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020100757404.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">机场出发前合影留念</span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020100828365.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020100842706.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">到达当晚就餐合影留念</span></p>\r\n<p>首站抵达海口，清新的空气、和煦的阳光、湛蓝的海水、柔和的沙滩，海天相接，在这一片美好的景象下拉开了本次旅行的帷幕，并在日后的时间先后奔赴三亚、陵水等地，游览了分界洲岛、椰田古寨、海南槟榔谷黎苗文化旅游区、南山佛教文化苑、天涯海角、大东海等著名风景区。</p>\r\n<p>分界洲岛，碧蓝的海水，让大家充分地享受了海上、海底之无限乐趣。这里海水清澈晶莹、海底资源丰富，有珊瑚礁和各种热带鱼，是最佳的世界级潜水基地之一。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020100921216.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020100932531.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">员工在分界洲岛体验潜水，享受山水一色好风光</span></p>\r\n<p>椰田古寨，是海南最美古村落，在这里我们体验了海南本土原生态的生活场景，感受纯正黎苗族风情。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020101006373.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">热情的苗族姑娘用特有的民族舞蹈欢迎我们</span></p>\r\n<p>海南槟榔谷黎苗文化旅游区，宏大的规模、独特的自然景观、丰富多彩的民间娱乐、独具韵味的原住民风情、神秘迷人的原始雨林风光让员工们流连忘返！</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020101033684.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">槟榔谷合影留念</span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020101106394.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">槟榔谷特有的手工编制工艺展示</span></p>\r\n<p>南山佛教文化苑，位于南海之上的108米观音圣象，一路梵音相伴，仿若行止于梵天净土，身心俱感清灵空阔。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020101609845.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020101628433.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">远处眺望观影圣象</span></p>\r\n<p>天涯海角风景区，是海南就发声明的景点，观&ldquo;天涯&rdquo;、&ldquo;海角&rdquo;&ldquo;南天一柱&rdquo;等石刻全景，海水澄碧，烟波浩瀚，帆影点点，充分感受了椰风海韵。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020101723386.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020101737159.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020101758635.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">员工在天涯海角体验阳光碧水，兴奋合影留念</span></p>\r\n<p>大东海，沙滩、阳光、碧水、绿树构成一幅美丽的滨海风光，是海上娱乐的天堂，也让大家尽情享受大自然赐予人类的氧气SPA。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020101836613.jpg\" /></p>\r\n<p>此行，不仅享受了秀丽的风景、愉悦了心情、增进了感情。使大家真正做到了放松心情，感受大自然的博大襟怀，而且给予了我们每个中信蓝海人以最大的精神鼓舞。一路上，大家热情高涨，相互关心，旅途中充满了欢歌笑语、温情和谐，在尽兴游玩之余，深切感受到来自公司大家庭的温暖，也坚定了为公司发展贡献智慧和力量的决心和信心。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020101907841.jpg\" /></p>\r\n<p>&ldquo;莫道路艰难，回头喜笑颜&rdquo;，回顾槟榔谷的原始森林，我们凭着坚强的意志和团结友爱互相帮助的精神登上顶峰赏无限风光；回顾中信蓝海企业集团 七载风雨曲折路，我们秉承&ldquo;心诚至臻，专筑共生&rdquo;的企业理念一路高歌。通过这次海南旅游，不仅缓解了员工们平时的工作压力和紧张情绪，而且陶冶了情操，提高了员工的修养，进而增加了公司员工的凝聚力，充分展现了我公司员工的良好精神面貌，相信在郭春河董事长的带领下，大家心相连、手相牵，扎实工作，朝着既定的目标奋进，定能以崭新的姿态，昂首阔步踏上新的征途，续写中信蓝海的美好明天，筑就新的辉煌。</p>\r\n<p><span style=\"color:#ff0000;\"><span style=\"font-size:16px;\"><strong>【我们在一起】</strong></span></span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102053480.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102112396.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102130686.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102147645.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102206411.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102227744.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102242227.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102259866.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102316519.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102334808.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102421687.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102445188.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102502594.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102516631.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102530556.jpg\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102548525.jpg\" /></p>\r\n<p><span style=\"color:#ff0000;\"><strong><span style=\"font-size:16px;\">【旅行中的我们】</span></strong></span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102638715.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">人生并非虚度，捉紧生命浓度。</span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102710434.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">快乐生活，慢慢长大。</span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102800126.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">纯洁的友谊，真挚的感情。</span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102859591.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">青年是生命之晨，是日之黎明，充满了纯净、幻想及和谐。</span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020102932151.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">追随&mdash;&mdash;只愿自己飞得更高！</span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020103003317.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">散是满天星，聚是一团火。</span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1020/20161020103025397.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\">面朝大海，春暖花开。</span></p>\r\n','0','','0','10000','','0','','0','1','|1');
