INSERT INTO `v9_news_data` VALUES('238','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1129/20161129085433259.jpg\" /></p>\r\n<p>2016年4月1日至14日，在定边团县委和定边县人才交流中心的指导下，定边青企协发起人郭春河、刘浩洋、冯倩、王婧、邢桂玮、刘慧琴、高绍维，优秀青年企业家郭小明、王智、李利利，团委王渊渊、刘书宇，秘书处李栋、付忠明等人，就成立青年企业家协会对准会员单位安排走访考察。在走访过程中，考察团与定边优秀的青年企业家进行了对接交流，准会员单位对自己企业的情况进行详细介绍，青年企业家协会考察团也就协会的情况做了具体介绍。（图为红黄蓝亲子园）</p>\r\n<p>&nbsp;</p>\r\n','0','','0','10000','','0','','0','1','|1');
INSERT INTO `v9_news_data` VALUES('239','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1129/20161129094903900.jpg\" /></p>\r\n<p>2016年6月18日至19日，&ldquo;中信蓝海企业集团2016年夏季工作会议&rdquo;在西安集团公司总部召开。集团公司董事长兼党支部书记郭春河在听完各板块公司负责人的工作汇报后做出讲话，应加强技术创新，建立强有力的技术团队；加强人才建设，集团经财中心及行政中心应以&ldquo;服务为核心&rdquo;。同时指出，要组织培训工作，以强化所有职能人员管理水平，积极执行公司的各项管理制度。加强党建工作，做好公益活动，做一个让社会认可和受社会尊重的企业。</p>\r\n','0','','0','10000','','0','','0','1','|1');
