INSERT INTO `v9_page` VALUES('43','集团概况',';','概况 公司','<h3><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817111449250.png\" style=\"margin-right: 10px; float: left; width: 400px; height: 200px;\" /></h3>\r\n<p><span style=\"color: rgb(0, 0, 0); font-family: 宋体; font-size: 14pt; line-height: 150%;\">陕西中信蓝海企业管理有限公司，成立于2016年4月11日注册资本金3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: 宋体; color: rgb(0, 0, 0); font-size: 14pt;\">中信蓝海企业集团经过8年的艰苦拼搏，历经创业和转型，现已发展成为立足陕北、走向全省的规模民营企业。公司拥有200多名高科技管理人才和10家隶属企业，形成了以实业投资、企业管理；创业孵化、人才建设；工程咨询、项目管理、工程设计；现代农林业为主的多产业并举发展结构。</span></p>\r\n<br />\r\n','','0');
INSERT INTO `v9_page` VALUES('143','成长历程',';','历程','<style type=\"text/css\">\r\n.relative {\r\n    position: relative;\r\n    }\r\n    .about_lc .wz_list {\r\n    width: 398px;\r\n    padding-top: 20px;\r\n    }\r\n    .wz_list h1, .hr_i h1, .wz_box2 h1 {\r\n    color: #c7000a;\r\n    font-size: 22px;\r\n    padding-top: 28px;\r\n    }\r\n    .wz_list p {\r\n    background: url(../images/line.gif) no-repeat left top;\r\n    margin-top: 25px;\r\n    }\r\n    .w600 {\r\n    width: 463px;\r\n    }\r\n\r\n    .f_y20 {\r\n    right: -20%;\r\n    }\r\n    .f_z20 {\r\n        left: -20%;\r\n    }\r\n    .absolute {\r\n        position: absolute;\r\n    }\r\n    .web_widht {\r\n        height: 240px;\r\n        width: 100%;\r\n        overflow: hidden;\r\n    }\r\n    .a_box_2 {\r\n        padding:0 20px;\r\n    }</style>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_z20\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2009.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_y20\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2009年</h1>\r\n<p>&bull; 9月加盟华春，成立华春定边分公司。</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_y20\" style=\"opacity: 1; right: 0px;\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2010.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_z20\" style=\"opacity: 1; right: 0px;\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2010年</h1>\r\n<p>&bull; 9月业务赢得第一桶金。</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_z20\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2011.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_y20\" style=\"opacity: 1; right: 0px;\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2011年</h1>\r\n<p>&bull; 1月成立团支部，企业青年不断增加；<br />\r\n&bull; 3月公司被列为&ldquo;定边县高校毕业生见习基地&rdquo;；<br />\r\n&bull; 5月公司被团县委评为&ldquo;定边县青年文明号&rdquo;称号；总经理郭春河评为&ldquo;榆林市先进团干部&rdquo;称号。</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_y20\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2012.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_z20\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2012年</h1>\r\n<p>&bull; 3月华春建设工程项目管理有限责任公司靖边分公司成立；<br />\r\n&bull; 4月成立春禾现代农林科技发展有限公司；<br />\r\n&bull; 10月公司列为定边商会会员单位；<br />\r\n&bull; 12月中共华春建设工程项目管理有限责任公司定边分公司党支部成立。</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_z20\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2013.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_y20\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2013年</h1>\r\n<p>&bull; 4月公司收购榆林市中信建筑设计有限公司；<br />\r\n&bull; 5月公司总经理郭春河被团县委评为&ldquo;定边县十大杰出青年称号&rdquo;；<br />\r\n&bull; 9月成立中信建筑设计有限公司靖边分公司；<br />\r\n&bull; 12月&ldquo;春禾生态创意园&rdquo;项目荣获陕西省首届青年创业大赛，&ldquo;优秀青年创业奖&rdquo;。</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_y20\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2014.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_z20\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2014年</h1>\r\n<p>&bull; 1月春禾公司互联网交易平台正式全面上线；<br />\r\n&bull; 4月以&ldquo;我家菜园&rdquo;为载体的都市农业项目正式启动；<br />\r\n&bull; 5月成立华春建设工程项目管理有限责任公司吴起分公司；<br />\r\n&bull; 12月企业产品推向市场。</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_z20\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2015.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_y20\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2015年</h1>\r\n<p>&bull; 5月公司入驻定边青年创业广场，成立&ldquo;青创总公司&rdquo;；<br />\r\n&bull; 8月春禾绿科&ldquo;我家农超&rdquo;020电子商务启动，线下体验店开业。</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_y20\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2016.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_z20\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2016年</h1>\r\n<p>&bull; 公司迁至古都西安，开启创业发展阶段美好篇章。</p>\r\n</div>\r\n</div>\r\n</div>\r\n<br />\r\n<script type=\"text/javascript\">\r\n        $(function(){\r\n            $(\'.nav li\').removeClass(\'current-cat\');\r\n            //内页块滑动效果\r\n            $(\'.a_box_1,.a_box_2\').css({\'opacity\':\'0\'});\r\n            function scrollbox(){\r\n                var st=$(window).scrollTop();\r\n                var wh=$(window).height();\r\n                $(\'.a_box\').each(function(index, element) {\r\n                    if(st>$(this).offset().top-wh+200){\r\n                        $(this).find(\'.f_z20\').stop().animate({\'left\':\'0\',\'opacity\':\'1\'},600,function(){});\r\n                        $(this).find(\'.f_y20\').stop().animate({\'right\':\'0\',\'opacity\':\'1\'},500,function(){});\r\n                    };\r\n                });\r\n            }\r\n            $(window).scroll(function(){\r\n                scrollbox();\r\n            })\r\n        });\r\n    </script>','','0');
INSERT INTO `v9_page` VALUES('2','公司简介',';','公司简介','<h3><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0824/20160824022722575.png\" style=\"margin-right: 10px; float: left; width: 200px; height: 300px;\" /></h3>\r\n<br />\r\n<br />\r\n陕西中信蓝海企业管理有限公司，成立于2016年4月11日注册资本金3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。<br />\r\n中信蓝海企业集团经过8年的艰苦拼搏，历经创业和转型，现已发展成为立足陕北、走向全省的规模民营企业。公司拥有200多名高科技管理人才和10家隶属企业，形成了以实业投资、企业管理；创业孵化、人才建设；工程咨询、项目管理、工程设计；现代农林业为主的多产业并举发展结构。<br />\r\n<br />\r\n陕西中信蓝海企业管理有限公司，成立于2016年4月11日注册资本金3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。<br />\r\n中信蓝海企业集团经过8年的艰苦拼搏，历经创业和转型，现已发展成为立足陕北、走向全省的规模民营企业。公司拥有200多名高科技管理人才和10家隶属企业，形成了以实业投资、企业管理；创业孵化、人才建设；工程咨询、项目管理、工程设计；现代农林业为主的多产业并举发展结构。<br />\r\n<br />\r\n陕西中信蓝海企业管理有限公司，成立于2016年4月11日注册资本金3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。<br />\r\n中信蓝海企业集团经过8年的艰苦拼搏，历经创业和转型，现已发展成为立足陕北、走向全省的规模民营企业。公司拥有200多名高科技管理人才和10家隶属企业，形成了以实业投资、企业管理；创业孵化、人才建设；工程咨询、项目管理、工程设计；现代农林业为主的多产业并举发展结构。<br />\r\n<br />\r\n陕西中信蓝海企业管理有限公司，成立于2016年4月11日注册资本金3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。<br />\r\n中信蓝海企业集团经过8年的艰苦拼搏，历经创业和转型，现已发展成为立足陕北、走向全省的规模民营企业。公司拥有200多名高科技管理人才和10家隶属企业，形成了以实业投资、企业管理；创业孵化、人才建设；工程咨询、项目管理、工程设计；现代农林业为主的多产业并举发展结构。<br />\r\n<br />\r\n陕西中信蓝海企业管理有限公司，成立于2016年4月11日注册资本金3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。<br />\r\n中信蓝海企业集团经过8年的艰苦拼搏，历经创业和转型，现已发展成为立足陕北、走向全省的规模民营企业。公司拥有200多名高科技管理人才和10家隶属企业，形成了以实业投资、企业管理；创业孵化、人才建设；工程咨询、项目管理、工程设计；现代农林业为主的多产业并举发展结构。<br />\r\n<br />\r\n陕西中信蓝海企业管理有限公司，成立于2016年4月11日注册资本金3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。<br />\r\n中信蓝海企业集团经过8年的艰苦拼搏，历经创业和转型，现已发展成为立足陕北、走向全省的规模民营企业。公司拥有200多名高科技管理人才和10家隶属企业，形成了以实业投资、企业管理；创业孵化、人才建设；工程咨询、项目管理、工程设计；现代农林业为主的多产业并举发展结构。<br />\r\n<br />\r\n陕西中信蓝海企业管理有限公司，成立于2016年4月11日注册资本金3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区