INSERT INTO `v9_page` VALUES('53','我们的价值观',';','','<h2 style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 16px; line-height: 20px; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 我们的价值观</h2>\r\n<h1 class=\"title\" style=\"box-sizing: border-box; margin: 0px 0px 26px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 400; font-stretch: inherit; font-size: 22px; line-height: 35px; font-family: inherit; vertical-align: baseline; color: rgb(51, 51, 51); text-transform: uppercase;\">&nbsp;</h1>\r\n<div class=\"titleText\" heiti=\"\" microsoft=\"\" open=\"\" stheiti=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 45px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 16px; line-height: 16px; font-family: \" text-align:=\"\" vertical-align:=\"\">\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 22px; font-family: inherit; vertical-align: baseline;\">集团的六个价值观对于我们如何经营业务、招揽人才、考核员工以及决定员工报酬扮演着重要的角色，该六个价值观为：</p>\r\n</div>\r\n<div class=\"cultureBox\" float:=\"\" height:=\"\" heiti=\"\" id=\"cultureBox1\" microsoft=\"\" open=\"\" stheiti=\"\" style=\"box-sizing: border-box; margin: 0px 30px 16px; padding: 0px 5px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 16px; line-height: 16px; font-family: \" text-align:=\"\" vertical-align:=\"\" width:=\"\">\r\n<div class=\"image\" style=\"box-sizing: border-box; margin: 0px auto; padding: 0px 0px 23px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; width: 120px;\"><img src=\"http://docs.alibabagroup.com/assets2/images/en/about/culture_box_1.gif\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; display: block;\" /></div>\r\n</div>\r\n<h2 style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 16px; line-height: 20px; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">客户第一</h2>\r\n<h1 class=\"title\" style=\"box-sizing: border-box; margin: 0px 0px 26px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 400; font-stretch: inherit; font-size: 22px; line-height: 35px; font-family: inherit; vertical-align: baseline; color: rgb(51, 51, 51); text-transform: uppercase;\">&nbsp;</h1>\r\n<div class=\"cultureBox\" float:=\"\" height:=\"\" heiti=\"\" microsoft=\"\" open=\"\" stheiti=\"\" style=\"box-sizing: border-box; margin: 0px 30px 16px; padding: 0px 5px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 16px; line-height: 16px; font-family: \" text-align:=\"\" vertical-align:=\"\" width:=\"\">\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 20px; font-family: inherit; vertical-align: baseline;\">客户是衣食父母</p>\r\n</div>\r\n<div class=\"cultureBox\" float:=\"\" height:=\"\" heiti=\"\" id=\"cultureBox2\" microsoft=\"\" open=\"\" stheiti=\"\" style=\"box