INSERT INTO `v9_page` VALUES('46','联系我们：',';','联系我们：','西安市碑林区长安北路1号<br />\r\n会展国际旁<br />\r\n联系电话：\r\n<div>029-8XX86666 &nbsp;8XX86665&nbsp;</div>\r\n','','0');
INSERT INTO `v9_page` VALUES('48','联系我们',';','联系我们','中信蓝海企业集团<br />\r\n邮编：710061<br />\r\n传真：029-68206165<br />\r\n电话：029-68206165(总机)<br />\r\nEmail：982462627@qq.com<br />\r\n地址：西安曲江新区雁南五路1868号曲江影视大厦10层&nbsp;\r\n<div id=\"map\" style=\"width:700px;height:550px;border:#ccc solid 1px;font-size:12px\">&nbsp;</div>\r\n<script type=\"text/javascript\">\r\n    //创建和初始化地图函数：\r\n    function initMap(){\r\n      createMap();//创建地图\r\n      setMapEvent();//设置地图事件\r\n      addMapControl();//向地图添加控件\r\n      addMapOverlay();//向地图添加覆盖物\r\n    }\r\n    function createMap(){ \r\n      map = new BMap.Map(\"map\"); \r\n      map.centerAndZoom(new BMap.Point(108.855808,34.441176),11);\r\n    }\r\n    function setMapEvent(){\r\n      map.enableScrollWheelZoom();\r\n      map.enableKeyboard();\r\n      map.enableDragging();\r\n      map.enableDoubleClickZoom()\r\n    }\r\n    function addClickHandler(target,window){\r\n      target.addEventListener(\"click\",function(){\r\n        target.openInfoWindow(window);\r\n      });\r\n    }\r\n    function addMapOverlay(){\r\n      var markers = [\r\n        {content:\"我的备注\",title:\"我的标记\",imageOffset: {width:0,height:3},position:{lat:34.240218,lng:108.953903}}\r\n      ];\r\n      for(var index = 0; index < markers.length; index++ ){\r\n        var point = new BMap.Point(markers[index].position.lng,markers[index].position.lat);\r\n        var marker = new BMap.Marker(point,{icon:new BMap.Icon(\"http://api.map.baidu.com/lbsapi/createmap/images/icon.png\",new BMap.Size(20,25),{\r\n          imageOffset: new BMap.Size(markers[index].imageOffset.width,markers[index].imageOffset.height)\r\n        })});\r\n        var label = new BMap.Label(markers[index].title,{offset: new BMap.Size(25,5)});\r\n        var opts = {\r\n          width: 200,\r\n          title: markers[index].title,\r\n          enableMessage: false\r\n        };\r\n        var infoWindow = new BMap.InfoWindow(markers[index].content,opts);\r\n        marker.setLabel(label);\r\n        addClickHandler(marker,infoWindow);\r\n        map.addOverlay(marker);\r\n      };\r\n    }\r\n    //向地图添加控件\r\n    function addMapControl(){\r\n      var scaleControl = new BMap.ScaleControl({anchor:BMAP_ANCHOR_BOTTOM_LEFT});\r\n      scaleControl.setUnit(BMAP_UNIT_IMPERIAL);\r\n      map.addControl(scaleControl);\r\n      var navControl = new BMap.NavigationControl({anchor:BMAP_ANCHOR_TOP_LEFT,type:BMAP_NAVIGATION_CONTROL_LARGE});\r\n      map.addControl(navControl);\r\n      var overviewControl = new BMap.OverviewMapControl({anchor:BMAP_ANCHOR_BOTTOM_RIGHT,isOpen:true});\r\n      map.addControl(overviewControl);\r\n    }\r\n    var map;\r\n      initMap();\r\n  </script><br />\r\n','','0');
INSERT INTO `v9_page` VALUES('74','集团概括',';','集团','<h3><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0818/20160818094210445.png\" style=\"margin-right: 10px; float: left; width: 200px; height: 200px;\" /></h3>\r\n<p><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 陕西中信蓝海企业管理有限公司，成立于2016年4月11日注册资本金3000万元。<br />\r\n总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西<br />\r\n安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 中信蓝海企业集团经过8年的艰苦拼搏，历经创业和转型，现已发展成为立足陕北、<br />\r\n走向全省的规模民营企业。公司拥有200多名高科技管理人才和10家隶属企业，形成了<br />\r\n以实业投资、企业管理；创业孵化、人才建设；工程咨询、项目管理、工程设计；现代<br />\r\n农林业为主的多产业并举发展结构。</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('50','这是免责申明',';','这是免责申明','<p style=\"text-align: justify;\"><span style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\">豆瓣网（以下简称豆瓣）非常重视对您的个人隐私保护，有时候我们需要某些信息才能为您提供您请求的服务，本隐私声明解释了这些情况下的数据收集和使用情况。</span><br style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\" />\r\n<span style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\">　　本隐私声明适用于豆瓣的所有相关服务，随着豆瓣服务范围的扩大，隐私声明的内容可由豆瓣随时更新，且毋须另行通知。更新后的隐私声明一旦在网页上公布即有效代替原来的隐私声明。</span></p>\r\n<p style=\"margin: 20px 0px 1px 4px; padding: 0px; font-size: 14px; font-weight: normal; font-stretch: normal; font-family: Arial, Helvetica, sans-serif; color: rgb(102, 102, 102); line-height: 1.8; text-align: justify;\"><span class=\"wrap\" style=\"display: block; color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px; background-color: rgb(242, 251, 242);\">我们收集哪些信息</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\">　　通常，您能在匿名的状态下访问豆瓣并获取信息。当我们需要能识别您的个人信息或者可以与您联系的信息时，我们会征求您的同意。通常，在您注册豆瓣或申请开通新的功能时，我们可能收集这些信息：姓名，Email地址，住址和电话号码，并征求您的确认。</span></p>\r\n<p style=\"margin: 20px 0px 1px 4px; padding: 0px; font-size: 14px; font-weight: normal; font-stretch: normal; font-family: Arial, Helvetica, sans-serif; color: rgb(102, 102, 102); line-height: 1.8; text-align: justify;\"><span class=\"wrap\" style=\"display: block; color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px; background-color: rgb(242, 251, 242);\">关于您的个人信息</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\">　　豆瓣严格保护您个人信息的安全。我们使用各种安全技术和程序来保护您的个人信息不被未经授权的访问、使用或泄露。</span><br style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\" />\r\n<span style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\">　　豆瓣会在法律要求或符合豆瓣的相关服务条款、软件许可使用协议约定的情况下透露您的个人信息，或者有充分理由相信必须这样做才能：(a) 满足法律或行政法规的明文规定，或者符合豆瓣网站适用的法律程序；（b）符合豆瓣相关服务条款、软件许可使用协议的约定；(c) 保护豆瓣的权利或财产，以及 (d) 在紧急情况下保护豆瓣员工、豆瓣产品或服务的用户或大众的个人安全。</span><br style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\" />\r\n<span style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\">　　豆瓣不会未经您的允许将这些信息与第三方共享，本声明已经列出的上述情况除外。</span></p>\r\n<p style=\"margin: 20px 0px 1px 4px; padding: 0px; font-size: 14px; font-weight: normal; font-stretch: normal; font-family: Arial, Helvetica, sans-serif; color: rgb(102, 102, 102); line-height: 1.8; text-align: justify;\"><span class=\"wrap\" style=\"display: block; color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px; background-color: rgb(242, 251, 242);\">Cookie的使用</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\">　　使用 Cookie 能帮助您实现您的联机体验的个性化，您可以接受或拒绝 Cookie ，大多数 Web 浏览器会自动接受 Cookie，但您通常可根据自己的需要来修改浏览器的设置以拒绝 Cookie。</span><br style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\" />\r\n<span style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\">　　豆瓣有时会使用 Cookie 以便知道哪些网站受欢迎，使您在访问豆瓣时能得到更好的服务。Cookie不会跟踪个人信息。</span><br style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\" />\r\n<span style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\">　　当您注册豆瓣时，豆瓣亦会使用 Cookie。在这种情况下，豆瓣会收集并存储有用信息，当您再次访问豆瓣时，我们可辨认您的身份。来自豆瓣的 Cookie 只能被豆瓣读取。</span><br style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\" />\r\n<span style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; line-height: 19.44px;\">　　如果您的浏览器被设置为拒绝 Cookie，您仍然能够访问豆瓣的大多数网页。</span></p>\r\n','','0');
