INSERT INTO `v9_page` VALUES('52','组织架构',';','组织架构','<span style=\"font-size:16px;\">&nbsp; &nbsp; &nbsp; 陕西中信蓝海企业管理有限公司系有限责任公司，成立于2016年4月11日，位于陕西省西安市曲江新区雁南五路影视大厦10层，集团总部占地面积1500m<sup>2</sup>，全集团合计办公面积约占地约10000㎡。集团公司下设董事长办公室，常务总裁办公室，总经理办公室、总监、财务部、经营部、市场发展部。集团旗下有创业管理板块、项目管理板块、建筑设计板块、农业发展四大板块，共计九个分公司，由集团总部统一管理。<br />\r\n&nbsp; &nbsp;&nbsp;<img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0817/20160817105351862.png\" /></span><br />\r\n<br />\r\n<br />\r\n','','0');
INSERT INTO `v9_page` VALUES('55','历史及里程碑',';','里程碑 历史','<div class=\"title\" color:=\"\" heiti=\"\" microsoft=\"\" open=\"\" stheiti=\"\" style=\"box-sizing: border-box; margin: 0px 0px 25px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 30px; line-height: 30px; font-family: \" text-align:=\"\" text-transform:=\"\" vertical-align:=\"\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0814/20160814121038626.png\" style=\"width: 960px; height: 196px;\" /><br />\r\n历史及里程碑</div>\r\n<p class=\"desc\" color:=\"\" heiti=\"\" microsoft=\"\" open=\"\" stheiti=\"\" style=\"box-sizing: border-box; margin: auto auto 30px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 16px; line-height: 22px; font-family: \" vertical-align:=\"\" width:=\"\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0814/20160814105553677.jpg\" style=\"width: 500px; height: 440px;\" /></p>\r\n','','0');
INSERT INTO `v9_page` VALUES('59','企业价值观',';','','<span style=\"font-size:16px;\"><span style=\"color:#8b4513;\">『企业愿景』</span><br />\r\n<span style=\"color:#8b4513;\">企业使命：</span>把创业当成一生的事业去做；<br />\r\n<span style=\"color:#8b4513;\">企业愿景：</span>2018年成为陕西省内最有潜质的创新创业平台；<br />\r\n<br />\r\n<span style=\"color:#8b4513;\">『发展理念』</span><br />\r\n<span style=\"color:#ff0000;\">创业理念：</span>创业就是勇于去做不可能的事；<br />\r\n<span style=\"color:#ff0000;\">创新理念：</span>创业精神+科学精神=创新；<br />\r\n<span style=\"color:#ff0000;\">发展理念：</span>思维改变观念，眼界改变格局，既然选择，必定创造奇迹；<br />\r\n<span style=\"color:#ff0000;\">风险理念：</span>心要热，头要冷，步要稳；<br />\r\n<br />\r\n<span style=\"color:#ff0000;\">『工作理念』</span><br />\r\n<span style=\"color:#ff0000;\">工作理念：</span>认真生活，快乐工作；<br />\r\n<span style=\"color:#ff0000;\">品质理念：</span>人品创造品质，品质彰显人品；<br />\r\n<span style=\"color:#ff0000;\">成长理念：</span>在学习中不断成长，在成长中深化学习；<br />\r\n<span style=\"color:#ff0000;\">执行理念：</span>信守承诺到没有任何退路，成果导向到没有任何借口，精益求精到没有任何折扣；<br />\r\n<span style=\"color:#ff0000;\">服务理念：</span>自始至终以客户为中心是我们一贯的宗旨，设身处地为客户去着想是我们永恒的追求；<br />\r\n<span style=\"color:#ff0000;\">用人理念：</span>忠诚组织的人委以重任，成果惯性的人回报优厚，同心协力的人共享荣耀，心存感恩的人走的更远。<br />\r\n<br />\r\n<span style=\"color:#ff0000;\">『中信蓝海责任』</span><br />\r\n企业必须承担社会责任，而什么是社会责任？<br />\r\n跟正直善良的一帮人，互相关爱、尊重的一帮人一起合法干净的成功，<br />\r\n过有尊严、有信心的生活，就是我们最实在的社会责任。<br />\r\n创业就业&nbsp;改变观念&nbsp;服务三农&nbsp;公益事业<br />\r\n&nbsp;<br />\r\n<span style=\"color:#ff0000;\">『中信蓝海创业理念：创业就是勇于去做不可能的事』</span><br />\r\n每个人的成功都不会是一帆风顺的，<br />\r\n其中需要艰辛的付出，充足的谋略和胆识，<br />\r\n也需要足够的机遇和勇气。<br />\r\n&nbsp;<br />\r\n<span style=\"color:#ff0000;\">『中信蓝海语录』</span><br />\r\n为梦想而来：一个人至少有一个梦想，有一个理由去坚强，心若没有栖息的地方，到哪里都是流浪！--项目管理公司总经理&nbsp;&nbsp;郭春洋<br />\r\n&nbsp;为成就而来：所有伟大的成就，都是战胜了看来不可能的事情而取得的，我为成就而来！--春禾绿科运营总监 &nbsp;郝巨杰<br />\r\n为奉献而来：奉献是一种不求回报的给予，我们的奉献永不止步！--同乘设计营销总监 李栋<br />\r\n为快乐而来：认真生活，快乐工作！--华春项目管理技术总监 &nbsp;刘旦<br />\r\n为极致而来：100-1=0！--华春项目管理西安区营销总监 张博<br />\r\n为感恩而来：我们生活在感恩的世界里，感谢一切使自己坚定的人！--华春项目管理延安区营销总监 张洋<br />\r\n为幸福而来：选择创业，就要忍受痛苦，但这份痛苦是幸福的！--华春项目管理榆林区营销总监 赵芳<br />\r\n为荣耀而来：成就梦想，共享荣耀！--集团董事长 郭春河</span><br />\r\n','','0');
INSERT INTO `v9_page` VALUES('77','关于我们',';','关于我们','<p><strong>榆林区域：</strong>下设项目管理定边分公司、项目管理靖边分公司、行政中心、经财中心。成立于2009年9月，位于定边县英华西路青年创业广场。项目管理靖边分公司成立于2012年2月，位于陕西省靖边县统万路政府对面。</p>\r\n<p><strong>西安区域：</strong>下设项目管理西安分公司、项目管理宝鸡分公司、项目管理安康分公司、行政中心、经财中心。项目管理西安分公司成立于2016年3月，位于西安曲江新区雁南五路影视大厦10层，项目管理宝鸡分公司、项目管理安康分公司正在筹建中。</p>\r\n<p><strong>延安区域：</strong>下设项目管理延安分公司、项目管理吴起分公司、项目管理志丹分公司、行政中心、经财中心。项目管理延安分公司成立于2016年7月，位于延安市宝塔区枣园公园C区5栋，项目管理吴起分公司成立于2014年5月，位于陕西省延安市吴起县，项目管理志丹分公司成立于2016年4月，位于陕西省延安市志丹县。</p>\r\n<p><strong>同乘（中信）设计：</strong>下设榆林市中信建筑设计有限公司，中信建筑设计有限公司靖边分公司， 同乘（中信）建筑设计延安分公司， 同乘（中信）建筑设计西安分公司。榆林市中信建筑设计有限公司成立于2013年3月，位于陕西省榆林市定边县定边镇英华西路青年创业广场。中信建筑设计有限公司靖边分公司成立于2013年9月，位于陕西省靖边县统万路政府对面。同乘（中信）建筑设计延安分公司成立于2016年7月，位于延安市宝塔区枣园公园C区5栋。同乘（中信）建筑设计西安分公司成立于2016年3月，位于西安曲江新区雁南五路影视大厦10层。</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('3','测试',';','','','','0');
INSERT INTO `v9_page` VALUES('80','业务介绍',';','业务','<p><strong>一、招标代理</strong></p>\r\n<p>资质等级：国家甲级工程招标代理，国际甲级招标，中央投资项目招标代理甲级</p>\r\n<p>业务范围：可承担各类工程的招标代理业务。包括：各类土木工程、建筑工程、线路管道和设备安装工程及装修工程项目的勘察、设计、施工、监理以及与工程建设有关的重要设备(进口机电设备除外)、材料采购招标的代理。</p>\r\n<p><strong>二、工程咨询</strong></p>\r\n<p>资质等级：国家甲级工程咨询</p>\r\n<p>业务范围：规划咨询、编制项目建议书、编制项目可行性研究报告、项目申请报告、资金申请报告、评估咨询、招标代理、工程监理、工程项目管理等。</p>\r\n<p><strong>三、造价咨询</strong></p>\r\n<p>资质等级：国家甲级工程造价咨询</p>\r\n<p>业务范围：</p>\r\n<p>(一)承接建设项目建议书与可行性研究投资估算、项目经济评价报告的编制和审核;</p>\r\n<p>(二)建设项目概预算的编制与审核，并配合设计方案比选、优化设计、限额设计的工作进行工程造价分析与控制;</p>\r\n<p>(三)建设项目合同价款的确定(包括招标工程工程量清单和标底、投标报价的编制和审核);合同价款的签订与调整(包括工程变更、工程洽商和索赔费用的计算)及工程款支付，工程结算及竣工结(决)算报 告的编制与审核等;</p>\r\n<p>(四)工程造价经济纠纷的鉴定和仲裁的咨询;</p>\r\n<p>(五)提供工程造价信息咨询服务;工程造价咨询企业可以对建设项目的组织实施进行全过程或者若干阶段的管理和服务。</p>\r\n<p><strong>四、工程监理</strong></p>\r\n<p>资质等级：国家甲级建设工程监理</p>\r\n<p>业务范围：房屋建筑工程监理甲级，可以开展相应类别建设工程的项目管理、技术咨询等业务。市政公用工程监理乙级，可以开展相应类别建设工程的项目管理、技术咨询等业务。</p>\r\n<p><strong>五、项目管理</strong></p>\r\n<p>业务范围：</p>\r\n<p>1.工程项目设计咨询;</p>\r\n<p>2.工程项目招标代理;</p>\r\n<p>3.工程监理造价咨询;</p>\r\n<p>4.工程监理施工管理;</p>\r\n<p>5.工程监理施工决算;</p>\r\n<p>6.工程监理施工各阶段造价监控。</p>\r\n<p><strong>六、投融资咨询（PPP咨询）与服务</strong></p>\r\n<p>（一）完成的PPP政策研究和技术规范</p>\r\n<p>1、《重庆市PPP投融资模式改革实施方案》</p>\r\n<p>2、《重庆市公共停车场PPP实施方案》</p>\r\n<p>3、《重庆市PPP操作指南》</p>\r\n<p>4、《重庆市区县PPP项目规划（项目库）》</p>\r\n<p>（二）承接的部分PPP项目 集团承接了铁路、轨道交通、市政公共设施、土地整治开发、经营性 社会事业设施等领域的 40 余个PPP市级示范项目和区县项目。</p>\r\n<p>1、轨道交通基础设施领域类PPP项目.</p>\r\n<p>招标业绩：</p>\r\n<p>重庆市郊铁路北碚至合川PPP项目招标代理</p>\r\n<p>重庆市郊铁路合川至大足PPP项目招标代理</p>\r\n<p>重庆市郊铁路跳蹬至江津PPP项目招标代理</p>\r\n<p>咨询业绩：</p>\r\n<p>巴南区南彭-茶园有轨电车项目PPP投融资方案编制</p>\r\n<p>轨道交通九号线PPP投融资方案综合咨询</p>\r\n<p>轨道交通延长线跳蹬至江津段土建工程项目PPP投融资咨询</p>\r\n<p>2、市政公共设施领域类PPP项目</p>\r\n<p>招标业绩：</p>\r\n<p>重庆市第三垃圾焚烧发电厂PPP项目招标代理</p>\r\n<p>涪陵区垃圾焚烧发电厂PPP项目招标代理</p>\r\n<p>红岩村桥隧PPP项目招标代理、招标方案编制</p>\r\n<p>重庆木鱼石公园投资人招标代理</p>\r\n<p>沙区滨江路磁井段改造PPP项目招标代理 咨询业绩</p>\r\n<p>重庆长寿长江二桥工程PPP投融资方案编制</p>\r\n<p>巴南区龙洲湾隧道项目PPP投融资方案编制、招标代理整体解决方案</p>\r\n<p>新疆乌鲁木齐南旅基地综合客运枢纽项目PPP模式实施方案</p>\r\n<p>新疆阿克苏乌什县托什干河生态治理低位调蓄水池建设项目PPP实施方案编制</p>\r\n<p>九龙坡民安公园建设项目PPP实施方案编制</p>\r\n<p>九龙坡华岩儿童公园建设项目PPP实施方案编制</p>\r\n<p>新疆建设兵团十二师三坪新区污水处理厂项目实施方案编制</p>\r\n<p>重庆市丰都县 2016 年农村环境连片整治项目PPP投融资方案</p>\r\n<p>九龙园污水处理厂提标改造项目PPP实施方案编制</p>\r\n<p>彩云湖公园青少年拓展及老年湿地活动馆建设项目PPP实施 方案编制</p>\r\n<p>九龙坡区政府立体停车库建设项目PPP实施方案编制</p>\r\n<p>南岸区江南停车场PPP项目</p>\r\n<p>伍家岗长江大桥PPP项目咨询 决策咨询：</p>\r\n<p>海口市三公园PPP决策咨询报告编制 全过程咨询服务：</p>\r\n<p>宜昌高新区景观绿化项目全过程咨询服务</p>\r\n<p>宜昌伍家岗大桥（江城大道-花溪路）项目全过程咨询服务</p>\r\n<p>3、土地整治开发类PPP项目</p>\r\n<p>招标业绩：</p>\r\n<p>​&laquo;重庆市大渡口区钓鱼嘴南部片区土地一级开发整治PPP项目招标代理</p>\r\n<p>&laquo;巴南区鹿角组团北区土地一级开发整治PPP项目招标代理</p>\r\n<p>&laquo;重庆市沙坪坝区巴渝老街土地一级整治PPP项目招标代理、招标方案编制</p>\r\n<p>决策咨询：</p>\r\n<p>重庆市长寿区公开出让长寿区殡仪馆治丧守灵业务经营权以</p>\r\n<p>及西山蔚林苑公墓国有建设用地使用权方案决策咨询</p>\r\n<p>重庆市长寿区公开出让长寿区三段石水库地块国有建设用地 使用权方案决策咨询</p>\r\n<p>全过程咨询服务：</p>\r\n<p>西部物流园国际物流社区土地整治项目PPP实施方案、招商协 议等招标前全过程咨询服务</p>\r\n<p>4、经营性社会事业设施领域类PPP项目：</p>\r\n<p>招标业绩：</p>\r\n<p>重庆市巴南区三级甲等医院建设项目政府与社会资本合作招 标代理</p>\r\n<p>重庆中美协同创新加速器及大数据学院PPP项目招标代理</p>\r\n<p>重庆机场过夜房 BOT（PPP）项目招标代理 咨询业绩：</p>\r\n<p>龙桥园区化纤纺织基地标准化厂房项目PPP投融资实施方案 编制</p>\r\n<p>高新区人民医院迁建工程项目PPP实施方案编制</p>\r\n<p>南坪中学体育场改造项目PPP实施方案编制</p>\r\n<p>巴南区经济园区商务大厦等 3 项目PPP打包实施方案编制</p>\r\n<p>重庆市巴南区三级甲等医院建设项目政府与社会资本合作招 标咨询服务项目</p>\r\n<p>5、其他PPP项目（保障房类）</p>\r\n<p>招标业绩：</p>\r\n<p>巴南区樵枰春晓&bull;巴桂苑安置房政府与社会资本合作项目招标 代理</p>\r\n<p>西部物流园土地整治PPP交流协议&nbsp;</p>\r\n<p>咨询业绩：</p>\r\n<p>巴南区 N01/02、N03/02 地块安置房项目、巴南区 S03/02 地块安置房项目政府与社会资本合作项目；</p>\r\n<p>另外，云南省丽江市中心城区海绵城市建设和综合管廊建设两个 项目的PPP实施方案合同拟定中。</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('68','投资者联系方式',';','','<h3 color:=\"\" heiti=\"\" microsoft=\"\" open=\"\" stheiti=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: 400; font-stretch: inherit; font-size: inherit; line-height: 22px; font-family: \" vertical-align:=\"\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: inherit; vertical-align: baseline;\">公司地址： &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 联系我们：<br />\r\n西安市碑林区长安北路1号</span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: inherit; vertical-align: baseline;\">会展国际旁 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-family: inherit; font-size: 14px; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;\">029-8XX86666 8XX86665</span></h3>\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\r\n<br />\r\n<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n<hr />\r\n<span style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\">&nbsp; 时光的轮回，眨眼一甲子，六十年的风雨兼程，历史的长河山川有着父辈艰辛的付出，留下他们奔劳的足迹和汗水的流淌。一份责任的担当和奉献，成就了渭北高原一颗璀璨之星，见证了铜局发展的历程和辛酸，经历了辉煌时的骄傲，也有低谷时的忍受和期盼，执着和守望是你们不变的信仰和追求，一晃而过，我，作为煤矿职工的后代，踏着父辈的足迹，延续着父辈坚韧不屈，倔强、任劳任怨的性格，默默无闻的在企业工作已经二十余载，时间的流失，岁月的无情，曾经的热血气盛，年轻风华，时间的沧桑，也多了些许中年的沉稳和淡定，步入不惑之年的窝，也让时间敲打了年轻的轻狂 ，岁月磨平了锋芒的棱角。</span><br style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\" />\r\n<span style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\">回首经历的岁月，平平淡淡，却也没有什么辉煌去值得骄傲，去留恋，细想起来，毕竟还是有了经历，有了过程，自己成长了许多，矜持了好些，也不觉得有所遗憾。追忆所思，只想怀着一颗平常心，去感恩企业，去回报这个大家庭，以平常的心态与企业共成长，也有了收获，进步成熟中慢慢长大。</span><br style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\" />\r\n<span style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\">&ldquo;感恩的心，感谢有你&rdquo;这是一声深情的倾诉，内心的感激，人间浓情犹在，真情依旧温存，感恩父母，是他们赐予了我生命；感恩师长，耳濡目染，是他们用智慧、经历、经验使我长大；感恩同事朋友，茫茫人海、芸芸众生，相遇相知就是缘分；更需要感恩的是我们的企业，是她给我提供了一个发挥自我、展现自我、施展才华的平台和机遇。组织的关心，领导的爱护，同事间的情谊，环境的氛围，人情世故的冷暖，尤如屡屡春风掠过，时刻暖意相伴，而结果的好坏，在于自己的悟性和吸纳，也总是伴着一路成熟，慢慢长大，有了一分收获，也就知足了许多，问心无愧于自己的付出。</span><br style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\" />\r\n<span style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\">也在成长中，慢慢懂得了付出是一种回报，知足是一种心境，也就加倍珍惜自己的岗位，体会到了&ldquo;有活干是幸运的，干好活是幸福的&rdquo;境界，常常劝诫：&ldquo;感觉自己穿鞋的时候，别人还没有脚，鞋是否合适，只有自己去适应&rdquo;的良好心态约束和提醒自己，也就有了知足常乐的心怀。</span><br style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\" />\r\n<br style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\" />\r\n<span style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\">&nbsp;</span>','','0');
INSERT INTO `v9_page` VALUES('69','媒体联系',';','媒体','<h3 color:=\"\" heiti=\"\" microsoft=\"\" open=\"\" stheiti=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: 400; font-stretch: inherit; font-size: inherit; line-height: 22px;\" vertical-align:=\"\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: inherit; vertical-align: baseline;\">公司地址： &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 联系我们：<br />\r\n西安市碑林区长安北路1号</span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: inherit; vertical-align: baseline;\">会展国际旁 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-family: inherit; font-size: 14px; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;\">029-8XX86666 8XX86665</span></h3>\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\r\n<br />\r\n<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n<hr />\r\n<span style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\">&nbsp; 时光的轮回，眨眼一甲子，六十年的风雨兼程，历史的长河山川有着父辈艰辛的付出，留下他们奔劳的足迹和汗水的流淌。一份责任的担当和奉献，成就了渭北高原一颗璀璨之星，见证了铜局发展的历程和辛酸，经历了辉煌时的骄傲，也有低谷时的忍受和期盼，执着和守望是你们不变的信仰和追求，一晃而过，我，作为煤矿职工的后代，踏着父辈的足迹，延续着父辈坚韧不屈，倔强、任劳任怨的性格，默默无闻的在企业工作已经二十余载，时间的流失，岁月的无情，曾经的热血气盛，年轻风华，时间的沧桑，也多了些许中年的沉稳和淡定，步入不惑之年的窝，也让时间敲打了年轻的轻狂 ，岁月磨平了锋芒的棱角。</span><br style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\" />\r\n<span style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\">回首经历的岁月，平平淡淡，却也没有什么辉煌去值得骄傲，去留恋，细想起来，毕竟还是有了经历，有了过程，自己成长了许多，矜持了好些，也不觉得有所遗憾。追忆所思，只想怀着一颗平常心，去感恩企业，去回报这个大家庭，以平常的心态与企业共成长，也有了收获，进步成熟中慢慢长大。</span><br style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\" />\r\n<span style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\">&ldquo;感恩的心，感谢有你&rdquo;这是一声深情的倾诉，内心的感激，人间浓情犹在，真情依旧温存，感恩父母，是他们赐予了我生命；感恩师长，耳濡目染，是他们用智慧、经历、经验使我长大；感恩同事朋友，茫茫人海、芸芸众生，相遇相知就是缘分；更需要感恩的是我们的企业，是她给我提供了一个发挥自我、展现自我、施展才华的平台和机遇。组织的关心，领导的爱护，同事间的情谊，环境的氛围，人情世故的冷暖，尤如屡屡春风掠过，时刻暖意相伴，而结果的好坏，在于自己的悟性和吸纳，也总是伴着一路成熟，慢慢长大，有了一分收获，也就知足了许多，问心无愧于自己的付出。</span><br style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\" />\r\n<span style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\">也在成长中，慢慢懂得了付出是一种回报，知足是一种心境，也就加倍珍惜自己的岗位，体会到了&ldquo;有活干是幸运的，干好活是幸福的&rdquo;境界，常常劝诫：&ldquo;感觉自己穿鞋的时候，别人还没有脚，鞋是否合适，只有自己去适应&rdquo;的良好心态约束和提醒自己，也就有了知足常乐的心怀。</span><br style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\" />\r\n<br style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\" />\r\n<span style=\"color: rgb(79, 93, 65); font-family: Simsun; font-size: 14px; line-height: 24px;\">&nbsp;</span>','','0');
