INSERT INTO `v9_page` VALUES('81','联系我们',';','','<div><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1110/20161110091454479.jpg\" /></div>\r\n<div>&nbsp;</div>\r\n<style type=\"text/css\">\r\n.iw_poi_title {color:#CC5522;font-size:14px;font-weight:bold;overflow:hidden;padding-right:13px;white-space:nowrap}\r\n    .iw_poi_content {font:12px arial,sans-serif;overflow:visible;padding-top:4px;white-space:-moz-pre-wrap;word-wrap:break-word}</style>\r\n<script type=\"text/javascript\" src=\"http://api.map.baidu.com/api?key=&v=1.1&services=true\"></script><!--百度地图容器-->\r\n<div id=\"dituContent\" style=\"width:920px;height:420px;border:#ccc solid 1px;\">&nbsp;</div>\r\n<script type=\"text/javascript\">\r\n    //创建和初始化地图函数：\r\n    function initMap(){\r\n        createMap();//创建地图\r\n        setMapEvent();//设置地图事件\r\n        addMapControl();//向地图添加控件\r\n        addMarker();//向地图中添加marker\r\n    }\r\n    \r\n    //创建地图函数：\r\n    function createMap(){\r\n        var map = new BMap.Map(\"dituContent\");//在百度地图容器中创建一个地图\r\n        var point = new BMap.Point(108.961769,34.199121);//定义一个中心点坐标\r\n        map.centerAndZoom(point,18);//设定地图的中心点和坐标并将地图显示在地图容器中\r\n        window.map = map;//将map变量存储在全局\r\n    }\r\n    \r\n    //地图事件设置函数：\r\n    function setMapEvent(){\r\n        map.enableDragging();//启用地图拖拽事件，默认启用(可不写)\r\n        map.enableScrollWheelZoom();//启用地图滚轮放大缩小\r\n        map.enableDoubleClickZoom();//启用鼠标双击放大，默认启用(可不写)\r\n        map.enableKeyboard();//启用键盘上下左右键移动地图\r\n    }\r\n    \r\n    //地图控件添加函数：\r\n    function addMapControl(){\r\n        //向地图中添加缩放控件\r\n	var ctrl_nav = new BMap.NavigationControl({anchor:BMAP_ANCHOR_TOP_LEFT,type:BMAP_NAVIGATION_CONTROL_LARGE});\r\n	map.addControl(ctrl_nav);\r\n        //向地图中添加缩略图控件\r\n	var ctrl_ove = new BMap.OverviewMapControl({anchor:BMAP_ANCHOR_BOTTOM_RIGHT,isOpen:1});\r\n	map.addControl(ctrl_ove);\r\n        //向地图中添加比例尺控件\r\n	var ctrl_sca = new BMap.ScaleControl({anchor:BMAP_ANCHOR_BOTTOM_LEFT});\r\n	map.addControl(ctrl_sca);\r\n    }\r\n    \r\n    //标注点数组\r\n    var markerArr = [{title:\"陕西省中信蓝海工程项目管理有限公司\",content:\"西安市雁南五路曲江影视大厦\",point:\"108.961396|34.199293\",isOpen:0,icon:{w:21,h:21,l:0,t:0,x:6,lb:5}}\r\n		 ];\r\n    //创建marker\r\n    function addMarker(){\r\n        for(var i=0;i<markerArr.length;i++){\r\n            var json = markerArr[i];\r\n            var p0 = json.point.split(\"|\")[0];\r\n            var p1 = json.point.split(\"|\")[1];\r\n            var point = new BMap.Point(p0,p1);\r\n			var iconImg = createIcon(json.icon);\r\n            var marker = new BMap.Marker(point,{icon:iconImg});\r\n			var iw = createInfoWindow(i);\r\n			var label = new BMap.Label(json.title,{\"offset\":new BMap.Size(json.icon.lb-json.icon.x+10,-20)});\r\n			marker.setLabel(label);\r\n            map.addOverlay(marker);\r\n            label.setStyle({\r\n                        borderColor:\"#808080\",\r\n                        color:\"#333\",\r\n                        cursor:\"pointer\"\r\n            });\r\n			\r\n			(function(){\r\n				var index = i;\r\n				var _iw = createInfoWindow(i);\r\n				var _marker = marker;\r\n				_marker.addEventListener(\"click\",function(){\r\n				    this.openInfoWindow(_iw);\r\n			    });\r\n			    _iw.addEventListener(\"open\",function(){\r\n				    _marker.getLabel().hide();\r\n			    })\r\n			    _iw.addEventListener(\"close\",function(){\r\n				    _marker.getLabel().show();\r\n			    })\r\n				label.addEventListener(\"click\",function(){\r\n				    _marker.openInfoWindow(_iw);\r\n			    })\r\n				if(!!json.isOpen){\r\n					label.hide();\r\n					_marker.openInfoWindow(_iw);\r\n				}\r\n			})()\r\n        }\r\n    }\r\n    //创建InfoWindow\r\n    function createInfoWindow(i){\r\n        var json = markerArr[i];\r\n        var iw = new BMap.InfoWindow(\"<b class=\'iw_poi_title\' title=\'\" + json.title + \"\'>\" + json.title + \"</b><div class=\'iw_poi_content\'>\"+json.content+\"</div>\");\r\n        return iw;\r\n    }\r\n    //创建一个Icon\r\n    function createIcon(json){\r\n        var icon = new BMap.Icon(\"http://app.baidu.com/map/images/us_mk_icon.png\", new BMap.Size(json.w,json.h),{imageOffset: new BMap.Size(-json.l,-json.t),infoWindowOffset:new BMap.Size(json.lb+5,1),offset:new BMap.Size(json.x,json.h)})\r\n        return icon;\r\n    }\r\n    \r\n    initMap();//创建和初始化地图\r\n</script>','','0');
INSERT INTO `v9_page` VALUES('83','关于我们',';','','<p>榆林青年创业管理咨询有限公司（以下简称公司）注册成立于2015年4月，先后注入资本2000万元。公司以创业项目运营策划、市场拓展、创业项目技术支持；就业创业政务代理及信息查询、企业管理咨询；生产性服务业培训及项目投融资为核心业务；投资建设的定边青年创业广场，建筑面积3150m2，被定边县人社局设为&ldquo;创业孵化基地&rdquo;，&ldquo;就业见习基地&rdquo;，被团定边县委设为&ldquo;青春驿站&rdquo;，科协授予&ldquo;科普示范基地&rdquo;，青创公司一直注重党工青妇建设，先后评为榆林市非公党建四星级党支部，定边县非公党建示范党支部荣誉称号，青创公司力争成为全省最具潜质创新创业平台，坚持不懈带动定边青年创业，助力定边经济发展。</p>\r\n<p>主营业务：|项目产业孵化|企业管理咨询|</p>\r\n<p>企业地址：榆林市定边县青年创业广场</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1012/20161012111335961.jpg\" /> <img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1012/20161012104700788.jpg\" /><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1012/20161012105046883.jpg\" /><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1012/20161012105057358.jpg\" /><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1012/20161012105111746.jpg\" /><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1012/20161012105147623.jpg\" /><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1012/20161012113852751.jpg\" /> <img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1012/20161012110244716.jpg\" /></p>\r\n','','0');
INSERT INTO `v9_page` VALUES('102','创业就业培训',';','就业培训','<strong>&nbsp; &nbsp;（1）创业就业培训 ：</strong>致力于帮助应往届大学生就业创业，培训辅导解决大学生就业难；下岗职工再就业，通过培训相关人员使其掌握一定技能胜任相关工作，解决下岗职工失业再就业问题。<br />\r\n培训流程：<br />\r\n摸底调查&rarr;收集企业所需人才&rarr;集中培训大学生及下岗职工&rarr;测试考核&rarr;联系相关企业&rarr;输送优秀人才<br />\r\n<strong>（2）行业类培训 &nbsp;</strong>致力于社会各行业的专业技术型人才的培训。主要培训范围有：电子商务培训、计算机网络管理及相关专业技术信息服务、礼仪类培训、财务类培训、服务行业的培训、农业各项种植类技术培训、畜牧业各类禽畜养殖技术培训。<br />\r\n培训流程：<br />\r\n定期组织相关领域专家&rarr;为所需服务的企业设计相关课程&rarr;集中培训&rarr;奖励制测试考核&rarr;企业落地跟踪<br />\r\n<strong>&nbsp;&nbsp;&nbsp;&nbsp;（3）建筑类资格认证培训 &nbsp;</strong>经过理论培训和实际操作培训，并且通过相关测试考核，使其取得相关岗位的从业资格证书。<br />\r\n培训流程：<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;定期组织开设相关课程&rarr;专家理论课程培训&rarr;实践操作培训&rarr;理论及操作考核&rarr;申请相关资格证<br />\r\n<strong>&nbsp;&nbsp;&nbsp;（4）企业管理类培训 &nbsp;&nbsp;</strong>针对企业开展的一种提高人员素质、能力、工作绩效和对组织的贡献，而实施的有计划、系统的培养和训练活动。使得员工的知识、技能、工作方法、工作态度以及工作的价值观得到改善和提高，从而发挥出最大的潜力提高个人和组织的业绩，推动组织和个人的不断进步，实现组织和个人的双重发展<strong>。</strong>&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n<strong>&nbsp;&nbsp;&nbsp;&nbsp;孵化中心：</strong>孵化器搭建&ldquo;创业咨询、市场开拓、投融资、技术支撑、信息管理&rdquo;五大专业特色服务平台，为入驻的创业企业提供全方位综合性服务。<br />\r\n五大服务平台：<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>A.创业咨询平台</strong><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;依托政府相关职能部门和管理运营团队，为创业企业提供包含政策、法律、工商、税务等方面的专业咨询及营销策略服务和&ldquo;一站式&rdquo;代理服务。<br />\r\n<strong>&nbsp;&nbsp;&nbsp;&nbsp;B.市场开拓平台</strong>场开拓平台<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;积极整合各方面资源，为创业企业提供产品推介、成果展示、业务拓展、文化活动、品牌营销等服务，实现大学生创业与市场的有效链接。<br />\r\n<strong>&nbsp;C.投融资平台</strong><strong>D</strong>&nbsp;&nbsp;投融资平台<br />\r\n通过引进创投机构跟踪和投资、自筹资金投入、开展投融资培训、金融贷款等方式，不断拓宽创业企业的融资渠道。<br />\r\n<strong>&nbsp;D.技术支撑平台</strong><strong>E</strong>&nbsp;技术支撑平台<br />\r\n从&ldquo;软技术&rdquo;&ldquo;硬技术&rdquo;两方面入手，为创业企业提供导师技术指导。<br />\r\n<strong>E.信息管理平台</strong>信息管理平台<br />\r\n运用现代信息技术，集成化管理&ldquo;孵化器&rdquo;的各种信息，搭建信息资源整合平台，实现&ldquo;孵化器&rdquo;内外部信息的共享和有效利用。<br />\r\n','','0');
INSERT INTO `v9_page` VALUES('89','联系我们',';','','<div><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1110/20161110085532540.jpg\" style=\"width: 920px; height: 110px;\" /></div>\r\n<div>&nbsp;</div>\r\n<!--引用百度地图API-->\r\n<style type=\"text/css\">\r\n.iw_poi_title {color:#CC5522;font-size:14px;font-weight:bold;overflow:hidden;padding-right:13px;white-space:nowrap}\r\n    .iw_poi_content {font:12px arial,sans-serif;overflow:visible;padding-top:4px;white-space:-moz-pre-wrap;word-wrap:break-word}</style>\r\n<script type=\"text/javascript\" src=\"http://api.map.baidu.com/api?key=&v=1.1&services=true\"></script><!--百度地图容器-->\r\n<div id=\"dituContent\" style=\"width:920px;height:420px;border:#ccc solid 1px;\">&nbsp;</div>\r\n<script type=\"text/javascript\">\r\n    //创建和初始化地图函数：\r\n    function initMap(){\r\n        createMap();//创建地图\r\n        setMapEvent();//设置地图事件\r\n        addMapControl();//向地图添加控件\r\n        addMarker();//向地图中添加marker\r\n    }\r\n    \r\n    //创建地图函数：\r\n    function createMap(){\r\n        var map = new BMap.Map(\"dituContent\");//在百度地图容器中创建一个地图\r\n        var point = new BMap.Point(107.607848,37.600404);//定义一个中心点坐标\r\n        map.centerAndZoom(point,12);//设定地图的中心点和坐标并将地图显示在地图容器中\r\n        window.map = map;//将map变量存储在全局\r\n    }\r\n    \r\n    //地图事件设置函数：\r\n    function setMapEvent(){\r\n        map.enableDragging();//启用地图拖拽事件，默认启用(可不写)\r\n        map.enableScrollWheelZoom();//启用地图滚轮放大缩小\r\n        map.enableDoubleClickZoom();//启用鼠标双击放大，默认启用(可不写)\r\n        map.enableKeyboard();//启用键盘上下左右键移动地图\r\n    }\r\n    \r\n    //地图控件添加函数：\r\n    function addMapControl(){\r\n        //向地图中添加缩放控件\r\n	var ctrl_nav = new BMap.NavigationControl({anchor:BMAP_ANCHOR_TOP_LEFT,type:BMAP_NAVIGATION_CONTROL_LARGE});\r\n	map.addControl(ctrl_nav);\r\n        //向地图中添加缩略图控件\r\n	var ctrl_ove = new BMap.OverviewMapControl({anchor:BMAP_ANCHOR_BOTTOM_RIGHT,isOpen:1});\r\n	map.addControl(ctrl_ove);\r\n        //向地图中添加比例尺控件\r\n	var ctrl_sca = new BMap.ScaleControl({anchor:BMAP_ANCHOR_BOTTOM_LEFT});\r\n	map.addControl(ctrl_sca);\r\n    }\r\n    \r\n    //标注点数组\r\n    var markerArr = [{title:\"榆林青年创业管理咨询有限公司\",content:\"陕西省榆林市定边县青年创业广场\",point:\"107.598937|37.606808\",isOpen:0,icon:{w:21,h:21,l:0,t:0,x:6,lb:5}}\r\n		 ];\r\n    //创建marker\r\n    function addMarker(){\r\n        for(var i=0;i<markerArr.length;i++){\r\n            var json = markerArr[i];\r\n            var p0 = json.point.split(\"|\")[0];\r\n            var p1 = json.point.split(\"|\")[1];\r\n            var point = new BMap.Point(p0,p1);\r\n			var iconImg = createIcon(json.icon);\r\n            var marker = new BMap.Marker(point,{icon:iconImg});\r\n			var iw = createInfoWindow(i);\r\n			var label = new BMap.Label(json.title,{\"offset\":new BMap.Size(json.icon.lb-json.icon.x+10,-20)});\r\n			marker.setLabel(label);\r\n            map.addOverlay(marker);\r\n            label.setStyle({\r\n                        borderColor:\"#808080\",\r\n                        color:\"#333\",\r\n                        cursor:\"pointer\"\r\n            });\r\n			\r\n			(function(){\r\n				var index = i;\r\n				var _iw = createInfoWindow(i);\r\n				var _marker = marker;\r\n				_marker.addEventListener(\"click\",function(){\r\n				    this.openInfoWindow(_iw);\r\n			    });\r\n			    _iw.addEventListener(\"open\",function(){\r\n				    _marker.getLabel().hide();\r\n			    })\r\n			    _iw.addEventListener(\"close\",function(){\r\n				    _marker.getLabel().show();\r\n			    })\r\n				label.addEventListener(\"click\",function(){\r\n				    _marker.openInfoWindow(_iw);\r\n			    })\r\n				if(!!json.isOpen){\r\n					label.hide();\r\n					_marker.openInfoWindow(_iw);\r\n				}\r\n			})()\r\n        }\r\n    }\r\n    //创建InfoWindow\r\n    function createInfoWindow(i){\r\n        var json = markerArr[i];\r\n        var iw = new BMap.InfoWindow(\"<b class=\'iw_poi_title\' title=\'\" + json.title + \"\'>\" + json.title + \"</b><div class=\'iw_poi_content\'>\"+json.content+\"</div>\");\r\n        return iw;\r\n    }\r\n    //创建一个Icon\r\n    function createIcon(json){\r\n        var icon = new BMap.Icon(\"http://app.baidu.com/map/images/us_mk_icon.png\", new BMap.Size(json.w,json.h),{imageOffset: new BMap.Size(-json.l,-json.t),infoWindowOffset:new BMap.Size(json.lb+5,1),offset:new BMap.Size(json.x,json.h)})\r\n        return icon;\r\n    }\r\n    \r\n    initMap();//创建和初始化地图\r\n</script>','','0');
INSERT INTO `v9_page` VALUES('210','简介',';','','<p>中共榆林青年创业管理咨询有限公司支部委员（前身为中共华春建设工程项目管理有限责任公司定边分公司支部委员）成立于2010年10月。目前下设专业党小组9个，有党员37人，其中预备党员4人、女党员19人。公司工会、团委、妇委群团组织健全，172名职工分别加入到了党、工、青、妇组织，平均年龄27岁，是一支富有朝气的年轻党建群体。</p>\r\n<p>自党群组织成立以来，在支部书记郭春河的带领下，提出了&ldquo;青春党建引领青年创业&rdquo;的党建核心，抓住公司全员青年特点，不断将党群组织建设和公司发展深度融合，形成了&ldquo;1316&rdquo;青春党建模式，有力推动了非公党组织发挥实质性作用，实现了&ldquo;党建建在产业链，党群工作全覆盖&rdquo;的全新工作局面。</p>\r\n<p style=\"text-align: center;\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1111/20161111055104501.jpg\" /><br />\r\n<img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1111/20161111055106443.jpg\" /><br />\r\n<img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1111/20161111055108682.jpg\" /><br />\r\n<img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1111/20161111055109197.jpg\" /><br />\r\n<img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1111/20161111055111121.jpg\" /></p>\r\n','','0');
INSERT INTO `v9_page` VALUES('220','妇委会简介',';','','<p>榆林青年创业管理咨询有限公司妇女联合会成立于2015年5月，先后注入资本2000万元，企业性质为社会性企业。位于定边县英华西路青年创业广场。自成立以来，一路开拓进取，拼搏创新，力争前列，敢为先人，秉承服务以青年创业为发展方向，描绘属于青创管理的美好蓝图。公司以创业项目运营策划，市场拓展，法律业务咨询、创业项目技术支持服务、就业创业政务代理及信息查询、公共关系维护服务、企业管理咨询、创业就业人才培养、建筑职业资格培训及各类生产性服务业培训为核心业务。</p>\r\n<p>榆林青年创业管理咨询有限公司是一个支持女大学生创业的社会性企业。现有女职工65人，其中中高层管理达到20人，骨干人员35人，综合岗位人员10人。张芳已安排相关岗位负责人或技术能手组成导师队伍，认真贯彻落实国家促进高校毕业生就业创业有关政策，主动与实习见习合格的女大学生签订就业协议，吸纳实习见习女大学生就业，现已有一定的经营规模和较好的经济、社会效益。为在校女大学生、应届女大学生和毕业未就业大学生提供实习见习和创业指导，使她们在参与企业运作中积累实践经验，提升就业创业能力，从而形成较为成熟的帮扶女大学生就业创业的工作机制。</p>\r\n<p>在赵芳的带领下，以女性为主体，积极开展妇女创业就业技能创业培训，为加强公司妇女工作，维护女职工的合法权利，促进社会稳定和县妇联各项工作顺利开展以及当地妇女创业就业服务。</p>\r\n<p style=\"text-align: center;\"><span style=\"color:#ff0000;\"><strong>根据《妇女联合会章程》的有关规定和我公司女职工人数，成立妇委会共计14人，具体人员职务如下：</strong></span></p>\r\n<p style=\"text-align: center;\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1102/20161102115432361.jpg\" /></p>\r\n','','0');
INSERT INTO `v9_page` VALUES('90','春禾绿科',';','','<span style=\"font-size:16px;\">定边县春禾绿科农业发展有限公司成立于2012年9月，先后注入资本1000万元，公司以农业项目策划、农业项目科研和农业电子商务为核心业务，先后成立农业项目规划设计所(以农业项目策划咨询、规划、设计为核心业务)，农业项目科研所(庄稼医院，春禾生态创意农场示范基地)，我家农超电子商务运营中心(我家农超020社区电子商务，我家农超第三方网络销售平台，实现优质农产品全网络营销)。下设我家农超事业部(城乡一体化农村电商)、庄稼医院事业部、我家支付事业部，春禾绿科总体运营设立在集团总部，目前我家农超城乡一体化服务站项目已经在定边落地推广(1个总站+10个乡村站+5个社区站)，全省第一家庄稼医院同时在定边成立。公司现有农林及电子商务类专业人才16名，全国农、林业专家4人，农业技师5人，大学毕业生15人。</span><br />\r\n','','0');
INSERT INTO `v9_page` VALUES('92','人才招聘',';','','陕西中信蓝海企业管理有限公司，成立于2016年4月11日注册资本金3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。 &nbsp;&nbsp;<br />\r\n中信蓝海企业集团经过8年的艰苦拼搏，历经创业和转型，现已发展成为立足陕北、走向全省的规模化民营企业。公司现拥有200多名高科技管理人才和10家隶属企业，形成了以实业投资、企业管理；创业孵化、人才建设；工程咨询、项目管理、工程设计；现代农林业为主的多产业并举发展结构。<br />\r\n为满足陕西中信蓝海企业集团快速发展的需要，公司决定公开招聘一批责任心强、专业素养高、愿与企业一起成长发展的英才。<br />\r\n<strong>招聘职位</strong><br />\r\n<strong>一、行政经财中心</strong><br />\r\n<strong>（一）行政专员</strong><br />\r\n岗位职责：<br />\r\n1.负责与其他部门的协调工作，做好信息的上传下达;<br />\r\n2.负责公司各部门的行政后勤类相关工作;<br />\r\n3.负责员工的考勤工作核算;<br />\r\n4.负责部门一些日常行政事务，配合上级做好行政人事方面的工作;<br />\r\n5.负责组织企业文化建设工作，包括公司庆典、年会安排、会务组织、文体活动安排等;<br />\r\n6.负责离职员工的善后处理工作，包括办公用品、钥匙、出勤核算等;<br />\r\n7.协助各部门做好节假日期间工作安排，包括值班安排、检查门窗、关闭电源电脑等工作;<br />\r\n8.负责企业资产配置(包括办公设备、办公用品)的管理工作，包括清点、维护、登记等;<br />\r\n9.负责日常的物资采购宫锁<br />\r\n10.其他突发事件的处理。<br />\r\n<strong>任职要求</strong>：<br />\r\n1.工作经验：1-3年<br />\r\n2.最低学历：大专<br />\r\n3.人力资源、行政管理相关专业<br />\r\n<strong>（二）人事专员</strong><br />\r\n岗位职责：<br />\r\n1.公司人力资源管理制度的起草、修订、实施。<br />\r\n2.负责公司人员的招聘、录用、试用期管理。<br />\r\n3.负责公司人员的劳动合同签署、人事档案的建立及管理。<br />\r\n4.负责公司各级管理人员和职能单位人员的薪资、社保与福利管理。<br />\r\n5.负责公司人员的异动、离职管理，依据集团战略发展要求，组建员工晋升体系及竞聘上岗机制。<br />\r\n6.对员工进行培训管理，制定培训计划，并安排落实。<br />\r\n7.绩效管理，制定绩效考核方案，并安排落实。<br />\r\n8.研究和分析国家、地区人力资源类相关政策、法规，保障集团政策合法性;与相关政府机构(当地的社会保障局、社保中心、职介服务中心等机构)建立良好的关系。<br />\r\n9.负责人力资源配置与战略信息搜集，为相关决策提供支持。<br />\r\n10.负责与员工进行积极沟通，促进公司与员工关系和谐发展，处理企业内部发生的员工劳动纠纷。<br />\r\n&nbsp;11.领导交办的其他工作。<br />\r\n<strong>任职要求：</strong>1.工作经验：1-3年<br />\r\n2.最低学历：大专<br />\r\n3.人力资源、行政管理相关专业<br />\r\n<strong>（三）会计</strong><br />\r\n岗位职责：1.参与制定本公司财务制度及相应的实施细则，参与本公司的项目可行性研究和项目评估中的财务分析工作。<br />\r\n2.负责对财务工作有关的外部及政府部门，如税务局、财政局、银行、会计事务所等联络、沟通工作，维护公司利益。<br />\r\n3.负责资金管理、调度。编制月、季、年度财务情况说明分析，向公司领导报告公司经营情况，提供董事会及总经理所需的财务数据资料的整理编报。<br />\r\n4.负责每月凭证的编制，汇总所有的记账凭证。&nbsp;<br />\r\n5.负责公司总帐及所有明细分类账的记账、结账、核对。&nbsp;<br />\r\n6.负责公司全年的会计报表、帐薄装订及会计资料保管工作。&nbsp;<br />\r\n7.负责分子公司工资审核，报表审核，日报数据检查汇总上报。<br />\r\n8.负责税务申报审核工作，做到监督审查，提出合理避税必要措施。了解学习最新税收优惠政策并实际应用于对口分子公司。<br />\r\n任职要求：1.工作经验：1-3年<br />\r\n2.最低学历：本科<br />\r\n3.财政学、会计学等相关专业<br />\r\n<strong>（四）出纳</strong><br />\r\n岗位职责：1.负责银行财务管理，负责支票等有关结算凭证的购买、领用及保管，办理银行收付业务。&nbsp;<br />\r\n2.负责现金管理，审核收付原始凭证。&nbsp;<br />\r\n3.负责编制银行收付凭证、现金收付凭证，登记银行存款及现金日记账。<br />\r\n4.负责公司员工工资的发放工作，现金收付工作。<br />\r\n<strong>任职要求：</strong>1.工作经验：1-3年<br />\r\n2.最低学历：本科<br />\r\n3.财政学、会计学等相关专业<br />\r\n<strong>二、项目部</strong><br />\r\n<strong>（一）造价员</strong><br />\r\n岗位职责：岗位职责:<br />\r\n1、项目投资分析，进行日常成本测算，提供设计变更成本建议；<br />\r\n2、负责对设计估算、施工图预算、招标文件编制、工程量计算进行审核；<br />\r\n3、组织内部招标实施，配合外部招标；<br />\r\n4、合同文件的起草与管理，跟踪分析合同执行情况，审核相关条款；<br />\r\n5、工程款支付审核，结算管理，概预算与决算报告；<br />\r\n6、变更洽商审核及处理索赔事宜。<br />\r\n任职要求：<br />\r\n1、建筑工程、造价、预算等相关专业大专以上学历；<br />\r\n2、年以上相关工作经验，具有注册造价师资格证者优先考虑。<br />\r\n<strong>三、设计部</strong><br />\r\n（一）美工<br />\r\n任职要求：<br />\r\n1、大专及以上学历，精通Photoshop等图文设计软件，熟悉Flash、网页设计软件者优先；&nbsp;<br />\r\n2、年龄：22-35之间；<br />\r\n3、有耐心，能连续较长时间从事图片处理工作；思维敏捷，接受能力强，工作积极主动，有团队协作精神，沟通能力较强；&nbsp;<br />\r\n4、较强的创新能力，独立快速完成高品质设计，对色彩的把握独到，能把设计风格和栏目特色进行有效的结合；&nbsp;<br />\r\n<strong>四、运营中心</strong><br />\r\n岗位职责：<br />\r\n1、负责商城店铺整体策划，店铺风格定位；<br />\r\n2、负责淘宝商城的选品、定价、活动策划；<br />\r\n3、流量引入，提升转化率；<br />\r\n4、维护淘宝、厂商客情关系，做好日常信息的对接；<br />\r\n5、提高库存周转率，负责每日营销数据、交易数据的统计分析；&nbsp;<br />\r\n6、研究竞争对手，制定并实施相应的竞争对策；&nbsp;<br />\r\n7、提高商城店铺的各项评价数据；<br />\r\n8、擅长商城旗舰店运作,精通聚划算,直通车,淘宝客,掌柜说,淘宝帮派,社区及淘宝内部活动等操作和数据分析管理；<br />\r\n<strong>任职要求：</strong><br />\r\n1、一年以上淘宝、京东等平台工作经验，熟悉对应平台规则；<br />\r\n2、乐于在电子商务领域挥霍青春、挥洒汗水；<br />\r\n3、大专以上学历；<br />\r\n4、有食品运营经验者优先。<br />\r\n','','0');
INSERT INTO `v9_page` VALUES('93','联系我们',';','','<table align=\"center\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"border-color:#ccc; margin-bottom:15px;\" width=\"700\">\r\n<tbody>\r\n	<tr>\r\n	<td height=\"35\" valign=\"middle\" width=\"74\">&nbsp;地 &nbsp;址：</td>\r\n	<td height=\"35\" valign=\"middle\" width=\"620\">&nbsp;西安曲江新区雁南五路1868号曲江影视大厦10层</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"35\" valign=\"middle\">&nbsp;邮 &nbsp;编：</td>\r\n	<td height=\"35\" valign=\"middle\">&nbsp;710061</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"35\" valign=\"middle\">&nbsp;电 &nbsp;话：</td>\r\n	<td height=\"35\" valign=\"middle\">&nbsp;029-68206165(总机)</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"35\" valign=\"middle\">&nbsp;传 &nbsp;真：</td>\r\n	<td height=\"35\" valign=\"middle\">&nbsp;029-68206165</td>\r\n	</tr>\r\n	<tr>\r\n	<td height=\"35\" valign=\"middle\">&nbsp;Email：</td>\r\n	<td height=\"35\" valign=\"middle\">&nbsp;zxlhjt@zxlh.asia</td>\r\n	</tr>\r\n</tbody>\r\n</table>\r\n<div style=\"text-align: center;\">&nbsp;</div>\r\n<p style=\"text-align:center\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0906/20160906115038143.jpg\" /></p>\r\n<div id=\"map\" style=\"width: 700px; height: 550px; border: 1px solid rgb(204, 204, 204); font-size: 12px; text-align: center;\">&nbsp;</div>\r\n<script type=\"text/javascript\">\r\n    //创建和初始化地图函数：\r\n    function initMap(){\r\n      createMap();//创建地图\r\n      setMapEvent();//设置地图事件\r\n      addMapControl();//向地图添加控件\r\n      addMapOverlay();//向地图添加覆盖物\r\n    }\r\n    function createMap(){ \r\n      map = new BMap.Map(\"map\"); \r\n      map.centerAndZoom(new BMap.Point(108.855808,34.441176),11);\r\n    }\r\n    function setMapEvent(){\r\n      map.enableScrollWheelZoom();\r\n      map.enableKeyboard();\r\n      map.enableDragging();\r\n      map.enableDoubleClickZoom()\r\n    }\r\n    function addClickHandler(target,window){\r\n      target.addEventListener(\"click\",function(){\r\n        target.openInfoWindow(window);\r\n      });\r\n    }\r\n    function addMapOverlay(){\r\n      var markers = [\r\n        {content:\"我的备注\",title:\"我的标记\",imageOffset: {width:0,height:3},position:{lat:34.240218,lng:108.953903}}\r\n      ];\r\n      for(var index = 0; index < markers.length; index++ ){\r\n        var point = new BMap.Point(markers[index].position.lng,markers[index].position.lat);\r\n        var marker = new BMap.Marker(point,{icon:new BMap.Icon(\"http://api.map.baidu.com/lbsapi/createmap/images/icon.png\",new BMap.Size(20,25),{\r\n          imageOffset: new BMap.Size(markers[index].imageOffset.width,markers[index].imageOffset.height)\r\n        })});\r\n        var label = new BMap.Label(markers[index].title,{offset: new BMap.Size(25,5)});\r\n        var opts = {\r\n          width: 200,\r\n          title: markers[index].title,\r\n          enableMessage: false\r\n        };\r\n        var infoWindow = new BMap.InfoWindow(markers[index].content,opts);\r\n        marker.setLabel(label);\r\n        addClickHandler(marker,infoWindow);\r\n        map.addOverlay(marker);\r\n      };\r\n    }\r\n    //向地图添加控件\r\n    function addMapControl(){\r\n      var scaleControl = new BMap.ScaleControl({anchor:BMAP_ANCHOR_BOTTOM_LEFT});\r\n      scaleControl.setUnit(BMAP_UNIT_IMPERIAL);\r\n      map.addControl(scaleControl);\r\n      var navControl = new BMap.NavigationControl({anchor:BMAP_ANCHOR_TOP_LEFT,type:BMAP_NAVIGATION_CONTROL_LARGE});\r\n      map.addControl(navControl);\r\n      var overviewControl = new BMap.OverviewMapControl({anchor:BMAP_ANCHOR_BOTTOM_RIGHT,isOpen:true});\r\n      map.addControl(overviewControl);\r\n    }\r\n    var map;\r\n      initMap();\r\n  </script><br />\r\n','','0');
INSERT INTO `v9_page` VALUES('122','业务介绍',';','业务','<div style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1012/20161012030934117.jpg\" /></div>\r\n','','0');
INSERT INTO `v9_page` VALUES('97','公司简介',';','','<img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/20161011031917495.jpg\" style=\"float: right; margin-left: 20px;\" />\r\n<p>陕西中信蓝海企业集团，成立于2016年4月11日，注册资本3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。</p>\r\n<p>从2009年创业之初，经过8年的艰苦拼搏，历经创业和转型，现已发展成为立足陕北、走向全省的规模性民营企业。公司拥有200多名高科技管理人才，分工程项目管理、园林绿化、现代农业、创业孵化四大板块和15家子分公司，形成了以实业投资、企业管理，创业孵化、工程咨询、招标代理、造价咨询、项目管理、工程设计、园林景观、电子商务、现代农林业为主的多产业并举发展结构。</p>\r\n<p>中信蓝海企业集团秉承&ldquo;心诚至臻，专筑共生 &rdquo;的企业理念，不断完善自我，勇担社会责任，执着的追求，严谨的工作和扎实的脚步，为社会创造更大的财富和价值，共筑蓝海梦。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1021/20161021015414146.jpg\" /></p>\r\n','','0');
INSERT INTO `v9_page` VALUES('98','企业文化',';','文化 企业','<p><span style=\"font-size:16px;\"><span style=\"color:#0000ff;\"><strong>企业愿景</strong></span></span></p>\r\n<p>企业使命：把创业当成一生的事业去做；</p>\r\n<p>企业愿景：2018年成为陕西省内最有潜质的创新创业平台；<br />\r\n&nbsp;</p>\r\n<p><span style=\"font-size:16px;\"><span style=\"color:#0000ff;\"><strong>发展理念</strong></span></span></p>\r\n<p>创业理念：创业就是勇于去做不可能的事；</p>\r\n<p>创新理念：创业精神+科学精神=创新；</p>\r\n<p>发展理念：思维改变观念，眼界改变格局，既然选择，必定创造奇迹；</p>\r\n<p>风险理念：心要热，头要冷，步要稳；<br />\r\n&nbsp;</p>\r\n<p><span style=\"font-size:16px;\"><span style=\"color:#0000ff;\"><strong>工作理念</strong></span></span></p>\r\n<p>工作理念：认真生活，快乐工作；</p>\r\n<p>品质理念：人品创造品质，品质彰显人品；</p>\r\n<p>成长理念：在学习中不断成长，在成长中深化学习；</p>\r\n<p>执行理念：信守承诺到没有任何退路，成果导向到没有任何借口，精益求精到没有任何折扣；</p>\r\n<p>服务理念：自始至终以客户为中心是我们一贯的宗旨，设身处地为客户去着想是我们永恒的追求；</p>\r\n<p>用人理念：忠诚组织的人委以重任，成果惯性的人回报优厚，同心协力的人共享荣耀，心存感恩的人走的更远。<br />\r\n&nbsp;</p>\r\n<p><span style=\"font-size:16px;\"><span style=\"color:#0000ff;\"><strong>中信蓝海责任</strong></span></span></p>\r\n<p>企业必须承担社会责任，而什么是社会责任？</p>\r\n<p>跟正直善良的一帮人，互相关爱、尊重的一帮人一起合法干净的成功，</p>\r\n<p>过有尊严、有信心的生活，就是我们最实在的社会责任。</p>\r\n<p>创业就业 改变观念 服务三农 公益事业<br />\r\n&nbsp;</p>\r\n<p><span style=\"font-size:16px;\"><span style=\"color:#0000ff;\"><strong>中信蓝海创业理念：创业就是勇于去做不可能的事</strong></span></span></p>\r\n<p>每个人的成功都不会是一帆风顺的，其中需要艰辛的付出，充足的谋略和胆识，</p>\r\n<p>也需要足够的机遇和勇气。<br />\r\n&nbsp;</p>\r\n<p><span style=\"font-size:16px;\"><span style=\"color:#0000ff;\"><strong>中信蓝海语录</strong></span></span></p>\r\n<p>为梦想而来：一个人至少有一个梦想，有一个理由去坚强，心若没有栖息的地方，到哪里都是流浪！ &nbsp;&mdash;&mdash;项目管理公司总经理 &nbsp;郭春洋</p>\r\n<p>为成就而来：所有伟大的成就，都是战胜了看来不可能的事情而取得的，我为成就而来！ &nbsp;&mdash;&mdash;春禾绿科运营总监 &nbsp;郝巨杰</p>\r\n<p>为奉献而来：奉献是一种不求回报的给予，我们的奉献永不止步！ &nbsp;&mdash;&mdash;同乘设计营销总监 李栋</p>\r\n<p>为快乐而来：认真生活，快乐工作！ &nbsp;&mdash;&mdash;华春项目管理技术总监 &nbsp;刘旦</p>\r\n<p>为极致而来：100-1=0！ &nbsp;&mdash;&mdash;华春项目管理西安区营销总监 张博</p>\r\n<p>为感恩而来：我们生活在感恩的世界里，感谢一切使自己坚定的人！ &nbsp;&mdash;&mdash;华春项目管理延安区营销总监 张洋</p>\r\n<p>为幸福而来：选择创业，就要忍受痛苦，但这份痛苦是幸福的！ &nbsp;&mdash;&mdash;华春项目管理榆林区营销总监 赵芳</p>\r\n<p>为荣耀而来：成就梦想，共享荣耀！ &nbsp;&mdash;&mdash;集团董事长 郭春河</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('99','组织架构',';','','<p>陕西中信蓝海企业管理有限公司系有限责任公司，成立于2016年4月11日，位于陕西省西安市曲江新区雁南五路影视大厦10层，集团总部占地面积1500m<sup>2</sup>，全集团合计办公面积约占地约10000㎡。集团公司下设董事长办公室，常务总裁办公室，总经理办公室、总监、财务部、经营部、市场发展部。集团旗下有创业管理板块、项目管理板块、建筑设计板块、农业发展四大板块，共计九个分公司，由集团总部统一管理。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1111/20161111120407752.jpg\" /><br />\r\n<a href=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1111/20161111011500893.jpg\" target=\"_blank\"><span style=\"font-size:18px;\"><span style=\"font-family:微软雅黑;\">【点击查看大图】</span></span></a></p>\r\n','','0');
INSERT INTO `v9_page` VALUES('116','榆林市中信建筑设计有限公司',';','榆林市 中信 建筑设计','<p style=\"float:left; margin-right:30px;width: 182px;height:310px;\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1014/20161014044034313.jpg\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 公司经理：李栋</p>\r\n<p>重庆同乘工程咨询设计有限公司陕西分公司，榆林市中信建筑设计有限公司，是一家集建筑设计甲级、机械设计甲级、军工设计甲级、规划设计甲级、市政设计甲级、园林绿化设计甲级、工程咨询甲级于一体的设计咨询服务机构，公司设立于集团公司总部，现有员工50余名，其中研究员级高级工程师3名，高级工程师6名，一级注册建筑师2名，一级注册结构师2名，其他注册师3名。公司在陕西区域下设西安、延安、榆林三个分公司，各公司下设：BIM设计研究部、建筑设计部、市政公路设计部、园林景观设计、装饰设计部、工程咨询部、财务部、综合部、经营部。公司秉承&ldquo;心诚至臻，专筑共生&rdquo;的企业理念，以&ldquo;高质量、快响应&rdquo;的服务态度，专注各项工程服务，打造以&ldquo;专业、规范、高效、创新、共赢&rdquo;为工作理念的服务团队。</p>\r\n<p>资质等级：|BIM设计研究|工程设计 甲级|城乡规划 甲级|工程咨询 甲级|</p>\r\n<p>企业地址：西安市影视大厦10层</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<div><span style=\"color:#14a1fb;\"><span style=\"font-size:16px;\"><strong>公司部分项目：</strong></span></span></div>\r\n<br />\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1014/20161014035605199.jpg\" /></p>\r\n','','0');
INSERT INTO `v9_page` VALUES('188','陕西绿草地园林绿化有限公司简介',';','','<p>陕西绿草地园林绿化有限公司成立于2013年，公司年产值5000万以上。拥有风景园林设计甲级资质、城市园林绿化施工二级资质。公司现有员工80余人，园林景观专业人员占80%，中高级职称专业技术人才26人。公司拥有专业景观设计院、景观工程公司、绿草地苗木基地1000亩、三八苗木基地1000亩、拥有白于山区13万亩荒漠化生态治理区，形成&ldquo;以景观设计为先导、以工程施工为主体、以苗木基地为支撑、以绿化养护为延伸、以生态治理为长效&rdquo;的专业一体化产业链，是陕西目前有能力提供景观设计，景观工程施工，生态治理等专业服务的园林绿化企业。&nbsp;</p>\r\n<p>多年来，绿草地人始终践行&ldquo;景观生态艺术推动者&rdquo;的核心价值观，逐步赢得了客户和社会的认可。2016年，绿草地将迈上新的发展征程，向着更加专业化运营的更高目标进发！&nbsp;</p>\r\n<p>主营业务：|景观设计|园林绿化|生态治理|</p>\r\n<p>企业地址：西安市影视大厦10层</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('181','陕西中信蓝海企业集团',';','中信 陕西 企业集团','陕西中信蓝海企业集团，成立于2016年4月11日，注册资本3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。陕西中信蓝海企业集团，成立于2016年4月11日，注册资本3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。','','0');
INSERT INTO `v9_page` VALUES('118','延安区域公司',';','','<p style=\"float:left; margin-right:30px;width: 222px;\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1018/20161018113313930.jpg\" style=\"width: 222px; height: 294px;\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;公司经理：张洋</p>\r\n<p>延安区域公司下设项目管理延安分公司、项目管理吴起分公司、项目管理志丹分公司、行政中心、经财中心。</p>\r\n<p>项目管理延安区域分公司成立于2016年7月，位于延安市宝塔区枣园公园C区5栋，项目管理吴起分公司成立于2014年5月，位于陕西省延安市吴起县，项目管理志丹分公司成立于2016年4月，位于陕西省延安市志丹县。</p>\r\n<p>共汇集全省市相关土木工程，经济管理院校，工民建与工程造价类、人力资源管理类、财务管理类毕业生，国家注册造价师、招标师、注册评估师、工程咨询师、造价专职人员等100余人，现已在全省市范围内累计承接完成各类项目管理类业务800余项。公司下设招标部、造价部、项目管理部、经营部、财务部、综合部等。</p>\r\n<p style=\"text-indent:0px;\">陕西中信蓝海项目管理有限责任公司延安分公司<br />\r\n电话：0911-2581916<br />\r\n地址：延安市宝塔区枣园公园C区5栋</p>\r\n<p style=\"text-indent:0px;\">陕西中信蓝海项目管理有限责任公司吴起分公司<br />\r\n电话：18629282768<br />\r\n地址：陕西省延安市吴起县洛源大街住建局斜对面豪利华酒店二楼</p>\r\n<p style=\"text-indent:0px;\">陕西中信蓝海项目管理有限责任公司志丹分公司<br />\r\n电话：0911-6632326<br />\r\n地址：陕西省延安市志丹县城北马岔市场二楼</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('117','西安区域公司',';','西安 区域 公司','<p style=\"float:left; margin-right:30px;width: 222px;\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1018/20161018113253204.jpg\" style=\"width: 222px; height: 294px;\" /> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;公司经理：张博</p>\r\n<p>西安区域公司下设项目管理西安分公司、项目管理宝鸡分公司、项目管理安康分公司、行政中心、经财中心。</p>\r\n<p>项目管理西安区域分公司成立于2016年3月，位于西安市曲江新区雁南五路曲江影视大厦10层。</p>\r\n<p>共汇集全省市相关土木工程，经济管理院校，工民建与工程造价类、人力资源管理类、财务管理类毕业生，国家注册造价师、招标师、注册评估师、工程咨询师、造价专职人员等20余人。公司下设招标部、造价部、项目管理部、经营部、财务部、综合部等。</p>\r\n<p>项目管理宝鸡分公司、项目管理安康分公司正在筹建中。</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('119','榆林区域公司',';','榆林 区域 公司','<p>榆林区域公司下设项目管理定边分公司、项目管理靖边分公司、行政中心、经财中心。</p>\r\n<p>项目管理榆林区域定边分公司成立于2009年9月，位于定边县英华西路青年创业广场。共汇集全省市相关土木工程，经济管理院校，工民建与工程造价类毕业生，国家注册造价师、招标师、注册评估师、工程咨询师、造价专职人员等30余人，分支机构已完成在榆林市发改委和改革委员会，榆林市城乡建设局备案登记，现已在全省市范围内累计承接完成各类项目管理类业务600余项。公司下设经营部、财务部、综合部、招标部、造价部和项目管理部。</p>\r\n<p>项目管理榆林区域靖边分公司成立于2012年2月，位于靖边县统万路县政府斜对面，占地面积600平方米。共汇集全省市相关土木工程，经济管理院校，工民建与工程造价类、人力资源管理类、财务管理类毕业生，国家注册造价师、招标师、注册评估师、工程咨询师、造价专职人员等20余人，分支机构已完成在榆林市和延安市发改委和改革委员会，榆林市和延安市城乡建设局备案登记，现已在全省市范围内累计承接完成各类项目管理类业务800余项。公司下设招标部、造价部、项目管理部、设计部、经营部、财务部、综合部、党团支部等。</p>\r\n<p>公司自成立以来始终以&ldquo;为中国建设工程贡献全部力量&rdquo;为企业使命；以&ldquo;专业、规范、周全&rdquo;为企业核心价值；以&ldquo;自律、热情、专注、高效&rdquo;为执业理念；以&ldquo;品质彰显人品，人品创造品质&rdquo;为品质理念；以&ldquo;尽力努力使我们一丝不苟的完成工作，热情专注使我们忘乎所以做到极致&rdquo;为工作理念；以&ldquo;自始至终以客户为中心是我们一贯宗旨，设身处地为客户去想是我们永恒的追求&rdquo;为服务理念，为建设美丽新中国、新榆林贡献全部力量。</p>\r\n<p style=\"text-indent:0px;\">陕西中信蓝海项目管理有限责任公司定边分公司<br />\r\n电话：0912-4599105<br />\r\n地址：陕西省榆林市定边县定边镇英华西路青年创业广场</p>\r\n<p style=\"text-indent:0px;\">陕西中信蓝海项目管理有限责任公司靖边分公司<br />\r\n电话：0912-4645811<br />\r\n地址：陕西省靖边县统万路政府对面</p>\r\n<p align=\"center\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1012/20161012034223134.jpg\" /></p>\r\n','','0');
INSERT INTO `v9_page` VALUES('197','联系我们',';','联系我们','<div><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1110/20161110085444142.jpg\" style=\"width: 920px; height: 110px;\" /></div>\r\n<div>&nbsp;</div>\r\n<!--引用百度地图API-->\r\n<style type=\"text/css\">\r\n.iw_poi_title {color:#CC5522;font-size:14px;font-weight:bold;overflow:hidden;padding-right:13px;white-space:nowrap}\r\n    .iw_poi_content {font:12px arial,sans-serif;overflow:visible;padding-top:4px;white-space:-moz-pre-wrap;word-wrap:break-word}</style>\r\n<script type=\"text/javascript\" src=\"http://api.map.baidu.com/api?key=&v=1.1&services=true\"></script><!--百度地图容器-->\r\n<div id=\"dituContent\" style=\"width:920px;height:420px;border:#ccc solid 1px;\">&nbsp;</div>\r\n<script type=\"text/javascript\">\r\n    //创建和初始化地图函数：\r\n    function initMap(){\r\n        createMap();//创建地图\r\n        setMapEvent();//设置地图事件\r\n        addMapControl();//向地图添加控件\r\n        addMarker();//向地图中添加marker\r\n    }\r\n    \r\n    //创建地图函数：\r\n    function createMap(){\r\n        var map = new BMap.Map(\"dituContent\");//在百度地图容器中创建一个地图\r\n        var point = new BMap.Point(107.607848,37.600404);//定义一个中心点坐标\r\n        map.centerAndZoom(point,12);//设定地图的中心点和坐标并将地图显示在地图容器中\r\n        window.map = map;//将map变量存储在全局\r\n    }\r\n    \r\n    //地图事件设置函数：\r\n    function setMapEvent(){\r\n        map.enableDragging();//启用地图拖拽事件，默认启用(可不写)\r\n        map.enableScrollWheelZoom();//启用地图滚轮放大缩小\r\n        map.enableDoubleClickZoom();//启用鼠标双击放大，默认启用(可不写)\r\n        map.enableKeyboard();//启用键盘上下左右键移动地图\r\n    }\r\n    \r\n    //地图控件添加函数：\r\n    function addMapControl(){\r\n        //向地图中添加缩放控件\r\n	var ctrl_nav = new BMap.NavigationControl({anchor:BMAP_ANCHOR_TOP_LEFT,type:BMAP_NAVIGATION_CONTROL_LARGE});\r\n	map.addControl(ctrl_nav);\r\n        //向地图中添加缩略图控件\r\n	var ctrl_ove = new BMap.OverviewMapControl({anchor:BMAP_ANCHOR_BOTTOM_RIGHT,isOpen:1});\r\n	map.addControl(ctrl_ove);\r\n        //向地图中添加比例尺控件\r\n	var ctrl_sca = new BMap.ScaleControl({anchor:BMAP_ANCHOR_BOTTOM_LEFT});\r\n	map.addControl(ctrl_sca);\r\n    }\r\n    \r\n    //标注点数组\r\n    var markerArr = [{title:\"定边县春禾绿科农业发展有限公司\",content:\"陕西省榆林市定边县定边镇英华西路青年创业广场\",point:\"107.598937|37.606808\",isOpen:0,icon:{w:21,h:21,l:0,t:0,x:6,lb:5}}\r\n		 ];\r\n    //创建marker\r\n    function addMarker(){\r\n        for(var i=0;i<markerArr.length;i++){\r\n            var json = markerArr[i];\r\n            var p0 = json.point.split(\"|\")[0];\r\n            var p1 = json.point.split(\"|\")[1];\r\n            var point = new BMap.Point(p0,p1);\r\n			var iconImg = createIcon(json.icon);\r\n            var marker = new BMap.Marker(point,{icon:iconImg});\r\n			var iw = createInfoWindow(i);\r\n			var label = new BMap.Label(json.title,{\"offset\":new BMap.Size(json.icon.lb-json.icon.x+10,-20)});\r\n			marker.setLabel(label);\r\n            map.addOverlay(marker);\r\n            label.setStyle({\r\n                        borderColor:\"#808080\",\r\n                        color:\"#333\",\r\n                        cursor:\"pointer\"\r\n            });\r\n			\r\n			(function(){\r\n				var index = i;\r\n				var _iw = createInfoWindow(i);\r\n				var _marker = marker;\r\n				_marker.addEventListener(\"click\",function(){\r\n				    this.openInfoWindow(_iw);\r\n			    });\r\n			    _iw.addEventListener(\"open\",function(){\r\n				    _marker.getLabel().hide();\r\n			    })\r\n			    _iw.addEventListener(\"close\",function(){\r\n				    _marker.getLabel().show();\r\n			    })\r\n				label.addEventListener(\"click\",function(){\r\n				    _marker.openInfoWindow(_iw);\r\n			    })\r\n				if(!!json.isOpen){\r\n					label.hide();\r\n					_marker.openInfoWindow(_iw);\r\n				}\r\n			})()\r\n        }\r\n    }\r\n    //创建InfoWindow\r\n    function createInfoWindow(i){\r\n        var json = markerArr[i];\r\n        var iw = new BMap.InfoWindow(\"<b class=\'iw_poi_title\' title=\'\" + json.title + \"\'>\" + json.title + \"</b><div class=\'iw_poi_content\'>\"+json.content+\"</div>\");\r\n        return iw;\r\n    }\r\n    //创建一个Icon\r\n    function createIcon(json){\r\n        var icon = new BMap.Icon(\"http://app.baidu.com/map/images/us_mk_icon.png\", new BMap.Size(json.w,json.h),{imageOffset: new BMap.Size(-json.l,-json.t),infoWindowOffset:new BMap.Size(json.lb+5,1),offset:new BMap.Size(json.x,json.h)})\r\n        return icon;\r\n    }\r\n    \r\n    initMap();//创建和初始化地图\r\n</script>','','0');
INSERT INTO `v9_page` VALUES('127','联系我们',';','','<div><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1110/20161110091028619.jpg\" style=\"width: 920px; height: 110px;\" /></div>\r\n<div>&nbsp;</div>\r\n<style type=\"text/css\">\r\n.iw_poi_title {color:#CC5522;font-size:14px;font-weight:bold;overflow:hidden;padding-right:13px;white-space:nowrap}\r\n    .iw_poi_content {font:12px arial,sans-serif;overflow:visible;padding-top:4px;white-space:-moz-pre-wrap;word-wrap:break-word}</style>\r\n<script type=\"text/javascript\" src=\"http://api.map.baidu.com/api?key=&v=1.1&services=true\"></script><!--百度地图容器-->\r\n<div id=\"dituContent\" style=\"width:920px;height:420px;border:#ccc solid 1px;\">&nbsp;</div>\r\n<script type=\"text/javascript\">\r\n    //创建和初始化地图函数：\r\n    function initMap(){\r\n        createMap();//创建地图\r\n        setMapEvent();//设置地图事件\r\n        addMapControl();//向地图添加控件\r\n        addMarker();//向地图中添加marker\r\n    }\r\n    \r\n    //创建地图函数：\r\n    function createMap(){\r\n        var map = new BMap.Map(\"dituContent\");//在百度地图容器中创建一个地图\r\n        var point = new BMap.Point(108.961769,34.199121);//定义一个中心点坐标\r\n        map.centerAndZoom(point,18);//设定地图的中心点和坐标并将地图显示在地图容器中\r\n        window.map = map;//将map变量存储在全局\r\n    }\r\n    \r\n    //地图事件设置函数：\r\n    function setMapEvent(){\r\n        map.enableDragging();//启用地图拖拽事件，默认启用(可不写)\r\n        map.enableScrollWheelZoom();//启用地图滚轮放大缩小\r\n        map.enableDoubleClickZoom();//启用鼠标双击放大，默认启用(可不写)\r\n        map.enableKeyboard();//启用键盘上下左右键移动地图\r\n    }\r\n    \r\n    //地图控件添加函数：\r\n    function addMapControl(){\r\n        //向地图中添加缩放控件\r\n	var ctrl_nav = new BMap.NavigationControl({anchor:BMAP_ANCHOR_TOP_LEFT,type:BMAP_NAVIGATION_CONTROL_LARGE});\r\n	map.addControl(ctrl_nav);\r\n        //向地图中添加缩略图控件\r\n	var ctrl_ove = new BMap.OverviewMapControl({anchor:BMAP_ANCHOR_BOTTOM_RIGHT,isOpen:1});\r\n	map.addControl(ctrl_ove);\r\n        //向地图中添加比例尺控件\r\n	var ctrl_sca = new BMap.ScaleControl({anchor:BMAP_ANCHOR_BOTTOM_LEFT});\r\n	map.addControl(ctrl_sca);\r\n    }\r\n    \r\n    //标注点数组\r\n    var markerArr = [{title:\"重庆国际投资咨询集团陕西分公司\",content:\"西安市雁南五路曲江影视大厦\",point:\"108.961396|34.199293\",isOpen:0,icon:{w:21,h:21,l:0,t:0,x:6,lb:5}}\r\n		 ];\r\n    //创建marker\r\n    function addMarker(){\r\n        for(var i=0;i<markerArr.length;i++){\r\n            var json = markerArr[i];\r\n            var p0 = json.point.split(\"|\")[0];\r\n            var p1 = json.point.split(\"|\")[1];\r\n            var point = new BMap.Point(p0,p1);\r\n			var iconImg = createIcon(json.icon);\r\n            var marker = new BMap.Marker(point,{icon:iconImg});\r\n			var iw = createInfoWindow(i);\r\n			var label = new BMap.Label(json.title,{\"offset\":new BMap.Size(json.icon.lb-json.icon.x+10,-20)});\r\n			marker.setLabel(label);\r\n            map.addOverlay(marker);\r\n            label.setStyle({\r\n                        borderColor:\"#808080\",\r\n                        color:\"#333\",\r\n                        cursor:\"pointer\"\r\n            });\r\n			\r\n			(function(){\r\n				var index = i;\r\n				var _iw = createInfoWindow(i);\r\n				var _marker = marker;\r\n				_marker.addEventListener(\"click\",function(){\r\n				    this.openInfoWindow(_iw);\r\n			    });\r\n			    _iw.addEventListener(\"open\",function(){\r\n				    _marker.getLabel().hide();\r\n			    })\r\n			    _iw.addEventListener(\"close\",function(){\r\n				    _marker.getLabel().show();\r\n			    })\r\n				label.addEventListener(\"click\",function(){\r\n				    _marker.openInfoWindow(_iw);\r\n			    })\r\n				if(!!json.isOpen){\r\n					label.hide();\r\n					_marker.openInfoWindow(_iw);\r\n				}\r\n			})()\r\n        }\r\n    }\r\n    //创建InfoWindow\r\n    function createInfoWindow(i){\r\n        var json = markerArr[i];\r\n        var iw = new BMap.InfoWindow(\"<b class=\'iw_poi_title\' title=\'\" + json.title + \"\'>\" + json.title + \"</b><div class=\'iw_poi_content\'>\"+json.content+\"</div>\");\r\n        return iw;\r\n    }\r\n    //创建一个Icon\r\n    function createIcon(json){\r\n        var icon = new BMap.Icon(\"http://app.baidu.com/map/images/us_mk_icon.png\", new BMap.Size(json.w,json.h),{imageOffset: new BMap.Size(-json.l,-json.t),infoWindowOffset:new BMap.Size(json.lb+5,1),offset:new BMap.Size(json.x,json.h)})\r\n        return icon;\r\n    }\r\n    \r\n    initMap();//创建和初始化地图\r\n</script>','','0');
INSERT INTO `v9_page` VALUES('120','公司简介',';','中信 陕西 集团','<p>重庆国际投资咨询集团陕西分公司设立在集团公司总部，具有工程咨询甲级、招标代理甲级、造价咨询甲级、建设监理甲级、中央投资甲级、政府采购甲级等资质，开展以PPP项目咨询、项目管理、招标代理、造价咨询、建设监理等核心业务，分别在西安、榆林、延安、定边、靖边、吴起、志丹开设分公司。公司汇集全省市相关土木工程，经济管理院校，工民建与工程造价类毕业生，国家注册造价师、招标师、注册评估师、工程咨询师、造价专职人员等130余人，已在全省市范围内累计承接完成各类项目管理类业务3000余项。</p>\r\n<p>资质等级：|PPP项目咨询|项目管理 甲级|招标代理 甲级|造价咨询 甲级|建设监理 甲级|中央投资 甲级|政府采购 甲级|</p>\r\n<iframe frameborder=\"0\" height=\"498\" src=\"http://player.youku.com/embed/XMTcxNjE3MDcxMg==\" style=\"display:block; margin:0px auto;\" width=\"510\"></iframe>','','0');
INSERT INTO `v9_page` VALUES('129','招标代理经典项目',';','','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901050620581.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆国际博览中心</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901050630771.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆农村商业银行大厦</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901050645536.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆朝天门国际商贸城</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901050656850.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆市国资委办公大楼、渝富公司总部</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901050707590.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆轨道交通环线上浩站及区间隧道工程</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901050718346.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆市规划展览馆</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('131','投资咨询',';','投资咨询','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901045740479.jpg\" /></p>\r\n<p style=\"text-align:center\">工程咨询单位资格证书</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901045757578.jpg\" /></p>\r\n<p style=\"text-align:center\">2006年京津沪渝综合性工程咨询单位第一届年会</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901045808787.jpg\" /></p>\r\n<p style=\"text-align:center\">2010年西部工程咨询协作网第十一次会议</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901045823719.jpg\" /></p>\r\n<p style=\"text-align:center\">2011年京津沪渝综合性工程咨询单位第六届年会</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901045834654.jpg\" /></p>\r\n<p style=\"text-align:center\">2011年十六城市协作网第二十二次会议</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901054018528.jpg\" /></p>\r\n<p style=\"text-align:center\">重庆&middot;西部国际会展中心建设项目</p>\r\n<p>该项目为重庆市2009年100个重点建设项目的&ldquo;一号工程&ldquo;，定位为西部领先、国内一流、国际知名的会展中心，中西部地区国际国内贸易服务中心、中西部地区现代服务业基地，项目总用地面积1.3平方公里，建筑规模60.68万m2，主要建筑物包括展馆、酒店及会议中心，项目总投资65.5亿元人民币，经济社会效益显著。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901054038925.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆国际马戏城建设项目</p>\r\n<p>重庆国际马戏城是重庆市十大公益性项目之一，占地50亩，建设规模为1500座，总建筑面积约41513m2，总投资约4.8亿元人民币，项目建成后，将成为国内领先的高规格的综合马戏表演场所，成为重庆的一座标志性建筑。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901054058865.jpg\" /></p>\r\n<p style=\"text-align: center;\">乡城县五星级酒店建设项目（一期）</p>\r\n<p>该项目位于四川省甘孜州乡城县香巴拉镇，&ldquo;环亚丁机场两小时旅游圈&rdquo;南北环线的交汇点，毗邻著名的稻城亚丁风景区。酒店集商贸、住宿、餐饮、会议、娱乐、度假为一体，占地面积30亩，建筑面积3.8万m2，投资3.3亿元。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901054119581.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆西站城市综合交通枢纽工程1号地块市政建设工程</p>\r\n<p>该工程位于九龙坡区、沙坪坝区，占地总面积约265亩，建筑总面积约33万m2，总投资65亿元。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901054134776.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆两路寸滩保税港区一期工程建设项目</p>\r\n<p>重庆两路寸滩保税港区我国内陆的第一个保税港区，为重庆市政府2009年度&quot;一号工程&quot;。一期工程项目建设用地2.67平方公里，建设内容包括土地平整、道路、综合管网、保税港区设施、物流、环保等工程，项目总投资49亿元人民币，总收益70.59亿元人民币。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901054147659.jpg\" /></p>\r\n<p style=\"text-align: center;\">利用世行贷款重庆市统筹城乡发展与改革二期项目涪陵区人民医院住院综合大楼建设项目</p>\r\n<p>涪陵区人民医院住院综合大楼建设项目为重庆市世行贷款二期公共医疗卫生机构建设的八个子项目之一，项目总投资11263万元人民币，计划2015年投入使用。项目位于重庆市涪陵城区内，总建筑面积按22583m2设计，项目建成后预计新增床位500张，达到三甲医院标准。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901054159954.jpg\" /></p>\r\n<p style=\"text-align: center;\">两江新区天宝寨安置房工程</p>\r\n<p>该工程是两江新区龙兴工业园重要的民生工程。工程建成后，既有利于解决天堡寨片区征地拆迁居民的住房安置问题，改善其居住环境，提高生活配套水平；也有利于园区征地拆迁工作顺利进行，维护社会稳定，加快园区开发和城市化建设。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901054211243.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆市大渡口滨江老工业区重庆工业博物馆及文化创意产业园一期项目</p>\r\n<p>该项目为原重钢型钢厂老厂房第1-3跨改造项目，改造面积2.85万m2，评估后总投资1.7亿元。该项目通过建设工业博物馆及文化创意产业园方式，将工业主题融入商业、旅游、文化创意等业态，具有良好的社会效益和经济效益。</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('130','政府采购',';','政府采购','<p>政府采购严格执行法律法规，促进廉政建设，提高政采资金的使用效能，维护国家和社会公共利益。近年来，重咨集团在市财政局的大力支持下，服务政府采购的范围和规模不断扩大。2006年至2014年集团累计完成政府采购项目6000余个（批次），为政府节约资金约17亿元。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902023931139.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size:14px;\">中华人民共和国政府采购代理机构甲级资格证书</span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901051531283.jpg\" style=\"text-align: center;\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size:14px;\">重庆园博园门禁系统建设工程项目</span></p>\r\n<p>重咨集团承接的&quot;重庆园博园门禁系统建设工程&quot;政府采购项目，投资约360万元人民币，项目规模包含&quot;数据系统、软件、管理系统、售票系统、门检系统、电源保障系统&quot;6部分，其中主入口设售票口9个，门检闸机12个；东入口设售票口9个，门检闸机12个；西入口设售票口3个，门检闸机6个。本项目的采购工作在园博会开幕前根据实际情况采用了最合理的竞争性谈判方式进行政府采购，不仅满足了采购人的时间需要，也在保证了项目质量的情况下尺可能的节约了财政资金，采购效果显著。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901051544638.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size:14px;\">重庆市卫生局救护车采购项目</span></p>\r\n<p>2010年3月17日，重庆市卫生局救护车采购项目在重庆市政府采购中心进行了开、评标工作，本项目共计采购救护车598台。项目预算5980万元人民币，成交金额5435.82万元人民币，节约采购资金544.18万元人民币。这些救护车均统一配置有药品仪器柜、氧气瓶、护士操作台、可折叠输液系统污物桶、铝合金活动担架车、铲式担架、医疗仓日光灯照明系统等医疗急救设备。本批救护车以填平补齐的方式，为没有救护车的卫生院全部配备救护车，这批救护车投入使用后，改善了乡镇卫生院的基本装备条作，提高农村急诊急救水平和转诊服务能力。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901051556502.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size:14px;\">江北区北滨路黄嘉段景观提升工程项目</span></p>\r\n<p>重咨集团承接招标项目&quot;江北区北滨路黄嘉段景观提升工程&quot;位于北滨路黄花园大桥至嘉陵江大桥段，总投资约7000万元人民币，路段全长3.1公里，该路段是重庆市&quot;两江四岸&quot;城市规划的重要组成部分，也是江北区的重要门户和重要滨江休闲地带。本项目已于2011年3月3日完成开标、评标工作，2011年底该项目完成全部施工，一条崭新的北滨路黄嘉段已呈现在市民面前。</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('132','规划咨询',';','规划咨询','<p>集团围绕重庆市经济社会发展以及城市建设中的全局性、综合性、战略性问题，向各级政府和各类型企业提供规划咨询服务。服务内容包括区域经济和社会发展规划、行业发展规划、城市规划、专项建设规划和应用层面的课题研究等。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901055547503.jpg\" /></p>\r\n<p style=\"text-align: center;\">集团承接的《液化天然气（LNG）综合利用项目布局规划》项目通过验收</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901055604849.jpg\" /></p>\r\n<p style=\"text-align: center;\">集团承接的《重庆市生活垃圾焚烧发电规划（2014-2020）》通过专家评审</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901055738446.jpg\" /></p>\r\n<p style=\"text-align: center;\">集团承接的《长寿经开区循环化改造实施方案》，通过国家发改委评审， 为长寿经开区争取国家资金1.2亿元。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0901/20160901055803756.jpg\" /></p>\r\n<p style=\"text-align: center;\">集团承接的《重庆市高山生态扶贫搬迁总体实施规划（2013-2017年）》通过中咨公司专家组评审，获国家发改委肯定。</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('133','决策咨询',';','决策咨询','<p>集团以打造&ldquo;市场化、企业化、国际化&rdquo;的&ldquo;重庆智库&rdquo;为战略愿景，紧紧围绕经济社会热点难点问题开展深入研究，为党委政府科学决策提供了智力支撑较好地发挥了参谋助手作用。</p>\r\n<p>目前完成的标志性决策咨询成果有：</p>\r\n<p>中组部课题、重庆市科委软科学计划项目《国有企业党组织发挥政治核心作用的路径研究》；</p>\r\n<p>重庆市政府重大决策咨询课题《重庆发展方式转变的现实途径研究》、《重庆市政府购买公共服务面临的问题及对策研究》；</p>\r\n<p>市委督查室和市政府督查室委托课题《重庆市投资体制改革第三方评估研究》；</p>\r\n<p>重庆市政府发展研究中心委托课题《在公共决策中充分发挥第三方机构作用研究》；</p>\r\n<p>重庆市发改委委托课题《重庆市国家级区域粮食物流枢纽建设方案》、《重庆市LNG车船推广实施意见》、《重庆市推进环境染污第三方治理试点实施方案》、《重庆市矿产资源生态补偿实施方案》等。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902104727955.jpg\" /></p>\r\n<p style=\"text-align: center;\">集团承接的《2010重庆市重大决策咨询课题》通过验收</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902104743410.jpg\" /></p>\r\n<p style=\"text-align: center;\">集团承接的《重庆市重大行政决策社会风险效应评估研究》通过评审</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902104756945.jpg\" /></p>\r\n<p style=\"text-align: center;\">集团承接的《液化天然气（LNG）综合利用项目布局规划》项目通过验收</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902104808881.jpg\" /></p>\r\n<p style=\"text-align: center;\">集团承接的《重庆市生活垃圾焚烧发电规划（2014-2020）》通过专家评审</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('134','低碳咨询',';','低碳咨询','<p>在重庆市应对气候变化主管部门的指导下，集团纵深拓展低碳咨询服务，组建了国内首批开展低碳咨询和研究的专业团队，在重庆市率先开展低碳政策研究、温室气体清单编制、碳交易机制研究等研究项目，牵头完成了多项国家低碳重大课题、国际合作课题和重庆市低碳研究重点课题并在得到了国家和重庆市应对气候变化主管部门及相关业主的好评和认可，为重庆市低碳经济发展提供了重要智力支撑。</p>\r\n<p>目前完成的标志性低碳咨询成果有：</p>\r\n<p>国家发改委委托项目：</p>\r\n<p>《重庆市碳排放权交易试点项目》</p>\r\n<p>《重庆市低碳城市试点项目》</p>\r\n<p>《重庆市2005年温室气体清单编制项目》</p>\r\n<p>《重庆市&ldquo;十三五&rdquo;应对气候变化规划思路研究》</p>\r\n<p>《重庆市适应气候变化实施方案》</p>\r\n<p>《重庆市应对气候变化统计核算制度研究及能力建设》</p>\r\n<p>联合国开发计划署项目：</p>\r\n<p>《重庆市低碳产品认证试点项目》</p>\r\n<p>中英低碳合作备忘录项目：</p>\r\n<p>《重庆市低碳社区评价指标体系研究》</p>\r\n<p>其他市级项目：</p>\r\n<p>《重庆市低碳社区试点实施方案》等</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902104948378.jpg\" /></p>\r\n<p style=\"text-align: center;\">集团承接的&ldquo;重庆市碳排放权交易试点项目&rdquo;开市</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902105003744.jpg\" /></p>\r\n<p style=\"text-align: center;\">集团承接的&ldquo;重庆市低碳产品认证试点项目&rdquo;启动</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902105017596.jpg\" /></p>\r\n<p style=\"text-align: center;\">集团低碳专家出席&ldquo;能源基金会低碳发展伙伴年会&rdquo;</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902105032670.jpg\" /></p>\r\n<p style=\"text-align: center;\">集团低碳专家参加&ldquo;重庆市碳排放交易制度交流研讨会&rdquo;</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902105044860.jpg\" /></p>\r\n<p style=\"text-align: center;\">集团举办&ldquo;重庆市低碳发展规划编制专题培训会&rdquo;</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('135','节能咨询',';','节能咨询','<p>集团贯彻《重庆市发展和改革委员会关于贯彻落实&lt;固定资产投资项目节能评估和审查暂行办法&gt;的通知》要求，组建了重庆市节能咨询的主要技术机构。</p>\r\n<p>目前完成的标志性节能咨询成果有：</p>\r\n<p>1、受市财政局和市发改革委委托的《重庆市节能减排财政政策综合示范实施方案》顺利通过国家发改委和财政部审批，成功为我市申请国家资金约252亿元；</p>\r\n<p>2、重庆西站城市综合交通枢纽工程、华能重庆两江新区天然气冷热电三联供新建工程、重庆宜家家居北部新区商场项目、重庆市第三垃圾焚烧发电厂、成渝高速公路复线（重庆境）、重庆市轨道交通环线工程、重庆北站综合交通换乘枢纽建设项目、上汽通用五菱汽车股份有限公司第三基地（重庆）工程建设项目等200余项节能评估和节能评审项目获得业界好评，对重庆市下一阶段开展节能减排工作做出了重大贡献。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902105153688.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆北站综合交通换乘枢纽建设项目</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902105206959.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆西站城市综合交通枢纽工程</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902105220294.jpg\" /></p>\r\n<p style=\"text-align: center;\">华能重庆两江新区天然气冷热电三联供新建工程</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902024611502.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆宜家家居北部新区商场项目</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('136','风评咨询',';','风评咨询','<p>集团在重庆市率先开展社会风险评估专题研究和评估工作，完成市级课题研究三项，出版专著一部，完成行业规划、电厂及输变电、机场、铁路、轨道交通、土地征收、工业企业等百余项项目的风险分析及评估，助推一批国家和市级重点项目获批。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902105340985.jpg\" /></p>\r\n<p style=\"text-align: center;\">《重庆市轨道交通环线工程社会稳定风险分析报告》评估报告</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902105353126.jpg\" /></p>\r\n<p style=\"text-align: center;\">成渝城市群城际铁路网规划社会稳定风险（重庆境内）评估报告</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('138','项目管理',';','项目管理','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902105915459.jpg\" /></p>\r\n<p style=\"text-align: center;\">世行贷款重庆市统筹城乡项目</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902105950864.jpg\" /></p>\r\n<p style=\"text-align: center;\">亚行贷款重庆市统筹城乡项目</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902110003151.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆市机关事务管理局市党政专用通讯主机楼</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902110016593.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆上桥粮食库总体迁建工程</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902110028882.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆津滨再生资源有限公司再生塑料加工项目</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902110040641.jpg\" /></p>\r\n<p style=\"text-align: center;\">临江门景观天桥</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902110055624.jpg\" /></p>\r\n<p style=\"text-align: center;\">中国（重庆）职业技能公共实训中心一期工程</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902110108844.jpg\" /></p>\r\n<p style=\"text-align: center;\">民生现代综合物流中心厂房</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('139','环境影响评价',';','环境','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902110359891.jpg\" /></p>\r\n<p style=\"text-align: center;\">建设项目环境影响评价资质证书</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902110413834.jpg\" /></p>\r\n<p style=\"text-align: center;\">梁平体育公园</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902110424901.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆两路寸滩保税港区揽月小区公租房建设项目</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('140','投融资服务',';','投融资服务','<p>经市金融办批准，集团下属重庆市江北区国咨小额贷款有限公司于2013年8月成立，业务范围包括办理各项贷款、票据贴现、资产转让。公司牢牢把握&ldquo;以市场为导向，以客户为中心，以资金安全和经营效益为目标&rdquo;的指导思想，坚持&ldquo;规范运营，降低风险，利润合理，做久做优&rdquo;的经营方针，重点支持中小企业、微型企业、个体商户及个人，服务地方经济，努力做大做强成为行业知名品牌。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902110610129.jpg\" style=\"width: 660px; height: 469px;\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902110631947.jpg\" style=\"width: 660px; height: 450px;\" /></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902110645455.jpg\" style=\"width: 660px; height: 450px;\" /></p>\r\n','','0');
INSERT INTO `v9_page` VALUES('141','工程造价',';','工程造价','<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902111200491.jpg\" /></p>\r\n<p style=\"text-align: center;\">工程造价咨询企业甲级资质证书</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902111214830.jpg\" /></p>\r\n<p style=\"text-align: center;\">司法签定许可证</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902111226626.jpg\" /></p>\r\n<p style=\"text-align: center;\">&ldquo;两双&rdquo;工程（双碑大桥及双碑隧道）</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902111238878.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆火车北站综合交通枢纽项目</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902111250827.jpg\" /></p>\r\n<p style=\"text-align: center;\">上汽依维柯红岩商用车厂房工程</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902111301442.jpg\" /></p>\r\n<p style=\"text-align: center;\">江厦&middot;星光汇商业综合体项目</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902111314518.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆市黔江区老窖溪水库工程</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902111324593.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆（长寿）化工园区铁路专用线工程</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0902/20160902111337706.jpg\" /></p>\r\n<p style=\"text-align: center;\">重庆市轨道交通项目</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('165','董事长个人荣誉',';','','<strong style=\"text-align: center;\"><span style=\"font-size: 26px;\">坚持梦想 &nbsp;唤醒未来</span></strong>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 22px;\"><strong>&mdash;&mdash;记陕西中信蓝海企业管理有限公司董事长郭春河</strong></span></p>\r\n<p>既然选择，必定创造奇迹！我们年青人就是要发挥学业所长，为家乡建设贡献全部力量！面对新的起点，新的挑战，我们将以饱满的热情，昂扬的斗志、永往直前。</p>\r\n<p style=\"text-align: right; margin-right: 15px;\">&mdash;&mdash;郭春河</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0907/20160907115532247.jpg\" style=\"width: 360px; height: 422px;\" /></p>\r\n<p>郭春河，男，中共党员，1984年3月生于定边县郝滩乡，2007年毕业于陕西工业职业技术学院，2011年完成西安建筑科技大学本科成人教育。2006年3月至2008年7月在陕西建工集团第一建筑工程有限公司开始实习工作，2008年8月至2009年7月进入华春建设工程项目管理有限责任公司工作。</p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 22px;\"><strong>郭春河董事长个人荣誉</strong></span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/0907/20160907022224638.jpg\" style=\"width: 660px; height: 338px;\" /></p>\r\n','','0');
INSERT INTO `v9_page` VALUES('177','公司部分资质',';','资质 部分 公司','<div style=\"text-align: center;\"><br />\r\n<span style=\"font-size:28px;\"><span style=\"color:#ff0000;\">公 司 部 分 资 质</span></span><br />\r\n<br />\r\n&nbsp;</div>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1014/20161014033642319.jpg\" style=\"width: 920px; height: 222px;\" /></p>\r\n','','0');
INSERT INTO `v9_page` VALUES('182','测试',';','','陕西中信蓝海企业集团，成立于2016年4月11日，注册资本3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。陕西中信蓝海企业集团，成立于2016年4月11日，注册资本3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。','','0');
INSERT INTO `v9_page` VALUES('183','测试1',';','','陕西中信蓝海企业集团，成立于2016年4月11日，注册资本3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。陕西中信蓝海企业集团，成立于2016年4月11日，注册资本3000万元。总部坐落于陕西省西安市曲江新区雁南五路影视大厦10层，办公面积1500平方米。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。','','0');
INSERT INTO `v9_page` VALUES('190','联系我们',';','','<div><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1110/20161110090445633.jpg\" style=\"width: 920px; height: 110px;\" /></div>\r\n<div>&nbsp;</div>\r\n<style type=\"text/css\">\r\n.iw_poi_title {color:#CC5522;font-size:14px;font-weight:bold;overflow:hidden;padding-right:13px;white-space:nowrap}\r\n    .iw_poi_content {font:12px arial,sans-serif;overflow:visible;padding-top:4px;white-space:-moz-pre-wrap;word-wrap:break-word}</style>\r\n<script type=\"text/javascript\" src=\"http://api.map.baidu.com/api?key=&v=1.1&services=true\"></script><!--百度地图容器-->\r\n<div id=\"dituContent\" style=\"width:920px;height:420px;border:#ccc solid 1px;\">&nbsp;</div>\r\n<script type=\"text/javascript\">\r\n    //创建和初始化地图函数：\r\n    function initMap(){\r\n        createMap();//创建地图\r\n        setMapEvent();//设置地图事件\r\n        addMapControl();//向地图添加控件\r\n        addMarker();//向地图中添加marker\r\n    }\r\n    \r\n    //创建地图函数：\r\n    function createMap(){\r\n        var map = new BMap.Map(\"dituContent\");//在百度地图容器中创建一个地图\r\n        var point = new BMap.Point(108.961769,34.199121);//定义一个中心点坐标\r\n        map.centerAndZoom(point,18);//设定地图的中心点和坐标并将地图显示在地图容器中\r\n        window.map = map;//将map变量存储在全局\r\n    }\r\n    \r\n    //地图事件设置函数：\r\n    function setMapEvent(){\r\n        map.enableDragging();//启用地图拖拽事件，默认启用(可不写)\r\n        map.enableScrollWheelZoom();//启用地图滚轮放大缩小\r\n        map.enableDoubleClickZoom();//启用鼠标双击放大，默认启用(可不写)\r\n        map.enableKeyboard();//启用键盘上下左右键移动地图\r\n    }\r\n    \r\n    //地图控件添加函数：\r\n    function addMapControl(){\r\n        //向地图中添加缩放控件\r\n	var ctrl_nav = new BMap.NavigationControl({anchor:BMAP_ANCHOR_TOP_LEFT,type:BMAP_NAVIGATION_CONTROL_LARGE});\r\n	map.addControl(ctrl_nav);\r\n        //向地图中添加缩略图控件\r\n	var ctrl_ove = new BMap.OverviewMapControl({anchor:BMAP_ANCHOR_BOTTOM_RIGHT,isOpen:1});\r\n	map.addControl(ctrl_ove);\r\n        //向地图中添加比例尺控件\r\n	var ctrl_sca = new BMap.ScaleControl({anchor:BMAP_ANCHOR_BOTTOM_LEFT});\r\n	map.addControl(ctrl_sca);\r\n    }\r\n    \r\n    //标注点数组\r\n    var markerArr = [{title:\"陕西绿草地园林绿化有限公司\",content:\"西安市雁南五路曲江影视大厦\",point:\"108.961396|34.199293\",isOpen:0,icon:{w:21,h:21,l:0,t:0,x:6,lb:5}}\r\n		 ];\r\n    //创建marker\r\n    function addMarker(){\r\n        for(var i=0;i<markerArr.length;i++){\r\n            var json = markerArr[i];\r\n            var p0 = json.point.split(\"|\")[0];\r\n            var p1 = json.point.split(\"|\")[1];\r\n            var point = new BMap.Point(p0,p1);\r\n			var iconImg = createIcon(json.icon);\r\n            var marker = new BMap.Marker(point,{icon:iconImg});\r\n			var iw = createInfoWindow(i);\r\n			var label = new BMap.Label(json.title,{\"offset\":new BMap.Size(json.icon.lb-json.icon.x+10,-20)});\r\n			marker.setLabel(label);\r\n            map.addOverlay(marker);\r\n            label.setStyle({\r\n                        borderColor:\"#808080\",\r\n                        color:\"#333\",\r\n                        cursor:\"pointer\"\r\n            });\r\n			\r\n			(function(){\r\n				var index = i;\r\n				var _iw = createInfoWindow(i);\r\n				var _marker = marker;\r\n				_marker.addEventListener(\"click\",function(){\r\n				    this.openInfoWindow(_iw);\r\n			    });\r\n			    _iw.addEventListener(\"open\",function(){\r\n				    _marker.getLabel().hide();\r\n			    })\r\n			    _iw.addEventListener(\"close\",function(){\r\n				    _marker.getLabel().show();\r\n			    })\r\n				label.addEventListener(\"click\",function(){\r\n				    _marker.openInfoWindow(_iw);\r\n			    })\r\n				if(!!json.isOpen){\r\n					label.hide();\r\n					_marker.openInfoWindow(_iw);\r\n				}\r\n			})()\r\n        }\r\n    }\r\n    //创建InfoWindow\r\n    function createInfoWindow(i){\r\n        var json = markerArr[i];\r\n        var iw = new BMap.InfoWindow(\"<b class=\'iw_poi_title\' title=\'\" + json.title + \"\'>\" + json.title + \"</b><div class=\'iw_poi_content\'>\"+json.content+\"</div>\");\r\n        return iw;\r\n    }\r\n    //创建一个Icon\r\n    function createIcon(json){\r\n        var icon = new BMap.Icon(\"http://app.baidu.com/map/images/us_mk_icon.png\", new BMap.Size(json.w,json.h),{imageOffset: new BMap.Size(-json.l,-json.t),infoWindowOffset:new BMap.Size(json.lb+5,1),offset:new BMap.Size(json.x,json.h)})\r\n        return icon;\r\n    }\r\n    \r\n    initMap();//创建和初始化地图\r\n</script>','','0');
INSERT INTO `v9_page` VALUES('192','企业简介',';','企业简介','<p>定边县春禾绿科农业发展有限公司成立于2012年9月，以农业电子商务为核心业务，下设我家农超农村电商事业部、我家支付事业部、庄稼医院（检测和植保）事业部，其中农产品品牌电商部设立在集团总部。公司现有农林及电子商务类专业人才26名，农、林业专家4人，中青年技术骨干5人，大学毕业生17人。主要运营项目有我家农超城乡一体化服务平台（以下简称&ldquo;我家农超&rdquo;）和春禾庄稼医院。历经五年的发展，春禾人以&ldquo;为农&middot;春禾之第一&rdquo;为使命，坚持&ldquo;科技农业，智慧农业，创意农业&rdquo;的核心价值观，在春禾力量牵下，力争在2018年成为陕西省内最有潜质的农业科技创新型企业。&ldquo;春&rdquo;象征着开始、希望、方向；&ldquo;禾&rdquo;象征着新生、力（栗）量；&ldquo;春禾&rdquo;象征着我们拥有的不只是青春、创意和信念，同样倾注着春禾人的梦想、希望和力量。</p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1103/20161103091731718.jpg\" style=\"float: right;\" /></p>\r\n<p><strong><span style=\"font-size:16px;\">企业愿景</span></strong></p>\r\n<p><strong>春禾力量：</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&ldquo;春&rdquo;象征着开始、希望、方向；</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&ldquo;禾&rdquo;象征着新生、力（栗）量；</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&ldquo;春禾&rdquo;象征着我们拥有的不只是青春、创意和信念，同样倾注着春禾人的梦想、希望和力量。</p>\r\n<p><strong>春禾使命：</strong>农&middot;天下之第一本，为农&middot;春禾之第一使命；</p>\r\n<p><strong>核心价值：</strong>科技农业，智慧农业，创意农业；</p>\r\n<p><strong>春禾愿景：</strong>2018年成为陕西省内最有潜质的农业科技创新型企业&nbsp;</p>\r\n','','0');
INSERT INTO `v9_page` VALUES('195','我家农超',';','农超','<p>我家农超是一个服务三农的城乡一体化服务平台，通过互联网嫁接各种服务于农村的资源，拓展农村信息服务业务和领域，依托县级运营中心、村级体验店、农村消费顾问、城市社区店及电商平台、完成整个链条的无障碍流通，从而达到刺激农村发展、帮助农民致富、带动农业发展，实现网货下乡、农产品进城、城乡互通的目的。项目全国运营中心设于定边县，总投资1569万，以定边县为示范点，在全县进行推广运营，定边示范点总投资356万元，计划在定边建设1个总站、5个社区站和15-20个乡村站。</p>\r\n<p>庄稼医院利用移动互联网技术进行农产品检测认证及植保服务，通过统一检测认证将定边县农产品销往全国各地，从而打破了传统单一服务模式，独创农业植保服务(溯源体系)+农产品认证服务(检测体系)的一体化服务新模式。</p>\r\n<p><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101050241856.jpg\" style=\"float: left; margin-right: 20px;margin-left: 100px; \" /></p>\r\n<p style=\"width:300px;float:left;padding-top:100px;\">&radic; 推出我家支付，并采用银行卡，微信支付，支付宝等多种支付手段，实现O2O模式的完美闭环</p>\r\n<p style=\"clear:left\">&nbsp;</p>\r\n<p style=\"clear:left\">&nbsp;</p>\r\n<p style=\"clear: left; text-align: center;\"><span style=\"color:#ff0000;\"><strong>运用流程</strong></span></p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101030007564.jpg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><a href=\"http://www.chunhelvke.webportal.cc/\" target=\"_blank\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1101/20161101050840583.jpg\" /></a></p>\r\n','','0');
INSERT INTO `v9_page` VALUES('143','成长历程',';','历程','<style type=\"text/css\">\r\n.relative {\r\n    position: relative;\r\n    }\r\n    .about_lc .wz_list {\r\n    width: 398px;\r\n    padding-top: 20px;\r\n    }\r\n    .wz_list h1, .hr_i h1, .wz_box2 h1 {\r\n    color: #c7000a;\r\n    font-size: 22px;\r\n    padding-top: 28px;\r\n    }\r\n    .wz_list p {\r\n    background: url(../images/line.gif) no-repeat left top;\r\n    margin-top: 25px;\r\n    }\r\n    .w600 {\r\n    width: 463px;\r\n    }\r\n\r\n    .f_y20 {\r\n    right: -20%;\r\n    }\r\n    .f_z20 {\r\n        left: -20%;\r\n    }\r\n    .absolute {\r\n        position: absolute;\r\n    }\r\n    .web_widht {\r\n        height: 240px;\r\n        width: 100%;\r\n        overflow: hidden;\r\n    }\r\n    .a_box_2 {\r\n        padding:0 20px;\r\n    }</style>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_z20\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2009.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_y20\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2009年</h1>\r\n<p>&bull; 9月加盟华春，成立华春定边分公司。</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_y20\" style=\"opacity: 1; right: 0px;\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2010.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_z20\" style=\"opacity: 1; right: 0px;\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2010年</h1>\r\n<p>&bull; 9月业务赢得第一桶金。</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_z20\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2011.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_y20\" style=\"opacity: 1; right: 0px;\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2011年</h1>\r\n<p>&bull; 1月成立团支部，企业青年不断增加；<br />\r\n&bull; 3月公司被列为&ldquo;定边县高校毕业生见习基地&rdquo;；<br />\r\n&bull; 5月公司被团县委评为&ldquo;定边县青年文明号&rdquo;称号；总经理郭春河评为&ldquo;榆林市先进团干部&rdquo;称号。</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_y20\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2012.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_z20\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2012年</h1>\r\n<p>&bull; 3月华春建设工程项目管理有限责任公司靖边分公司成立；<br />\r\n&bull; 4月成立春禾现代农林科技发展有限公司；<br />\r\n&bull; 10月公司列为定边商会会员单位；<br />\r\n&bull; 12月中共华春建设工程项目管理有限责任公司定边分公司党支部成立。</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_z20\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2013.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_y20\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2013年</h1>\r\n<p>&bull; 4月公司收购榆林市中信建筑设计有限公司；<br />\r\n&bull; 5月公司总经理郭春河被团县委评为&ldquo;定边县十大杰出青年称号&rdquo;；<br />\r\n&bull; 9月成立中信建筑设计有限公司靖边分公司；<br />\r\n&bull; 12月&ldquo;春禾生态创意园&rdquo;项目荣获陕西省首届青年创业大赛，&ldquo;优秀青年创业奖&rdquo;。</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_y20\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2014.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_z20\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2014年</h1>\r\n<p>&bull; 1月春禾公司互联网交易平台正式全面上线；<br />\r\n&bull; 4月以&ldquo;我家菜园&rdquo;为载体的都市农业项目正式启动；<br />\r\n&bull; 5月成立华春建设工程项目管理有限责任公司吴起分公司；<br />\r\n&bull; 12月企业产品推向市场。</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_z20\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2015.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_y20\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2015年</h1>\r\n<p>&bull; 5月公司入驻定边青年创业广场，成立&ldquo;青创总公司&rdquo;；<br />\r\n&bull; 8月春禾绿科&ldquo;我家农超&rdquo;020电子商务启动，线下体验店开业。</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a_box h300 web_widht relative\">\r\n<div class=\"a_box_1 absolute back_white w600 h300 f_y20\"><img src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1011/2016.jpg\" /></div>\r\n<div class=\"a_box_2 absolute back_white w600 h300 f_z20\">\r\n<div class=\"wz_list m_auto\">\r\n<h1>2016年</h1>\r\n<p>&bull; 公司迁至古都西安，开启创业发展阶段美好篇章。</p>\r\n</div>\r\n</div>\r\n</div>\r\n<br />\r\n<script type=\"text/javascript\">\r\n        $(function(){\r\n            $(\'.nav li\').removeClass(\'current-cat\');\r\n            //内页块滑动效果\r\n            $(\'.a_box_1,.a_box_2\').css({\'opacity\':\'0\'});\r\n            function scrollbox(){\r\n                var st=$(window).scrollTop();\r\n                var wh=$(window).height();\r\n                $(\'.a_box\').each(function(index, element) {\r\n                    if(st>$(this).offset().top-wh+200){\r\n                        $(this).find(\'.f_z20\').stop().animate({\'left\':\'0\',\'opacity\':\'1\'},600,function(){});\r\n                        $(this).find(\'.f_y20\').stop().animate({\'right\':\'0\',\'opacity\':\'1\'},500,function(){});\r\n                    };\r\n                });\r\n            }\r\n            $(window).scroll(function(){\r\n                scrollbox();\r\n            })\r\n        });\r\n    </script>','','0');
