INSERT INTO `v9_page` VALUES('214','团委简介',';','','<p>共青团榆林青年创业管理咨询有限公司团委委员会是定边唯一一个企业团委，公司团委于2015年11月10日向定边县委会递交成立团委申请，经共青团定边县委会议研究，于2016年1月4日决定成立共青团榆林青年创业管理咨询有限公司委员会，推荐郭春河同志为书记，李栋同志为副书记，马超同志、王星同志、张博同志为委员候选人预备人选。团委下设华春建设工程项目管理有限责任公司西安分公司团支部；华春建设工程项目管理有限责任公司定边分公司团支部；华春建设工程项目管理有限责任公司延安分公司团支部；华春建设工程项目管理有限责任公司志丹分公司团支部；华春建设工程项目管理有限责任公司靖边分公司团支部；华春建设工程项目管理有限责任公司吴起分公司团支部；同承中信榆林建筑设计有限分公司团支部；同承中信西安建筑设计有限分公司团支部；定边春禾绿科农业发展有限公司团支部；青年创业广场团支部。榆林青年创业管理咨询有限公司统一管理青年创业广场，现有管理咨询人员10名，入住的华春建设工程项目管理有限责任公司定边分公司、榆林市中信建筑设计有限公司和定边春禾绿科农业发展有限公司，均已成立了团支部，现有共青团员102人，其中35周岁以下团青年3人，28周岁以下团员99人。</p>\r\n<p>团委自成立以来，深入学习贯彻党的十八大精神，全面落实科学发展观，坚持党建带团建，坚持服务青年、引导青年、教育青年，做好团的各项工作。团结带领公司团组织、团员青年创先争优，为富民强区，构建和谐企业做出更大贡献。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1102/20161102041113702.jpg\" /></p>\r\n','','0');
INSERT INTO `v9_page` VALUES('217','工会简介',';','','<p>榆林青年创业管理咨询管理有限公司工会（以下简称工会） ，是以榆林青年创业管理咨询管理有限公司全体职工会员为主体的联合工会，具有独立的法人资格。公司工会现在下设主席，工会联络员，宣传委员，学习委员及成员等。</p>\r\n<p>榆林青年创业管理咨询管理有限公司工会的工作思路是以提高经济效益为目的，同时广泛开展了群众经济创新活动；提高职工队伍素质为目的重点强化学习教育，稳定职工队伍为重点、广泛实施送温暖工程，发挥组织优势，用健康向上的文体活动占领职工思想阵地，同时坚持两个原则（&ldquo;坚持党组织的领导&rdquo;和&ldquo;全心全意依靠广大员工&rdquo;的两个根本原则）。</p>\r\n<p>榆林青年创业管理咨询管理有限公司工会的职责：</p>\r\n<p>1、建立主动，依法，科学的职工维权机制和和谐的劳动关系，履行维护并参与教育四项基本职能。</p>\r\n<p>2、制定工会工作计划，主持工会的日常工作。</p>\r\n<p>3、贯彻党的路线方针，执行公司的决议，传达上级工会的精神，发挥工会的桥梁纽带作用，努力完成本公司工会和上级工会布置的各项工作任务，同时做好工作计划和工作总结。</p>\r\n<p>4、提高工会会员政治觉悟和业务水平，发动会员参政议政，促使公司管理科学民主制度化。</p>\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1111/20161111102146861.png\" /></p>\r\n','','0');
