INSERT INTO `v9_picture` VALUES('199','163','0','招标代理','','http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1202/20161202101927189.jpg','','资质等级：国家甲级工程招标代理、国际甲级招标、中央投资项目招标代理甲级。业务范围：可承担各类工程的招标代理业务。包括：各类土木工程','0','http://zhingxinlh.d152.ptzygj.com/index.php?m=content&c=index&a=show&catid=163&id=199','1','99','1','0','zxlh','1480320649','1480645238');
INSERT INTO `v9_picture` VALUES('192','164','0','处世准则','','http://zhingxinlh.d152.ptzygj.com/uploadfile/2016/1111/20161111113114251.jpg','准则','以利相交，利尽则散；以势相交，势败则倾；以权相交，权失则弃；以情相交，情断则伤；唯以心相交，方能成其久远。','0','http://zhingxinlh.d152.ptzygj.com/index.php?m=content&c=index&a=show&catid=164&id=192','5','99','1','0','admin','1478833391','1478835076');
