INSERT INTO `v9_picture_data` VALUES('2','<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">2014年一季度人力资源部在全体员工的努力配合下，在人员配置、企业文化与员工培训、薪酬规划、组织工作、基础管理等方面按照公司的战略要求完成了相应的工作，现总结如下：</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　一、人员配置</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　1. 员工入职、离职(截止3月31日)</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　总部：各部门入职41人，离职13人。离职率为4%。2013年同期入职17人、离职人员25人。离职率为8%。离职率较去年同期降低4个百分点。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　加工厂：入职163人，离职76人，离职率为13%。2013年同期入职为112人，离职人数73人，离职率为15%。入职人数同比增长51人，增长46%，同比离职率下降2%。从以上数据可以看出来，工厂在招工难的外部环境压力下，还是招录相对较多的工人，且离职率同liuxue86.com比有所下降。充分体现了公司年初提高员工福利待遇、改善员工伙食等一系列的激励政策与人文关怀的良好结果。也体现了工厂对外宣传公司政策、吸引曾离职工人重返工作岗位的工作成果。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　办事处：(截止2月末，且不含临时人数。3月数据正在整理，中旬才能完成)，办事处共318个专柜，在职988人，入职108人，离职95人。离职率为9%。2013年同期离职人员为107人，入职为114人，离职率为10%。同比变化不大。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　专卖店：(截止到2月末，3月份人数正在整理中)，专卖店共有28个店铺，在职87人，离职率为13%。因专卖店的人事信息刚刚完善，暂没有前期的对应数据。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　综上，在公司的人力资源战略规划中，2013年是组织架构、人员结构调整年，2014年是人员能力提升及二次创业人才储备的一年，这一点从上述的入职数据中可见端倪。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2. 招聘</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　本季度公司招聘途径有四种，即：前程无忧网络招聘、晚报招聘、理工校园现场招聘、内部推荐。本季度共面试209人，复试 105 人，上岗 35 人，通过人力资源部招聘及内部推荐而入职35人(1月份3人，2月份15人，3月份17人)。其中：通过内部推荐入职3人。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　二、企业文化与员工培训</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　(一)企业文化活动</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　1.组织完成年会策划及实话</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2. 每月板报更新</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　3. 早会主题拟定及人员安排</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　(二)培训工作</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　1. 建立2014年度公司级、部门级培训计划</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2. 培训实施</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　1) 新员工入职培训2次</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2) 沙龙文化培训：《职场也要步步精心》、《沟通风格》。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　3) 公司级培训</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　已经完成了OA协同办公平台的使用培训。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　4)</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　协调相关部门培训工作：信息部：维富友升级系列培训、集团总部采购部质检周期、实验设备及产品执行标准的培训多品牌中心黑田副总讲解的色彩培训。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　三、薪酬福利规划</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　1. 绩效考核方案</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　制定办事处经理代管绩效草案框架;</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　制定并上报电子商务管理者绩效奖金计发办法(草案)。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　职员、导购增设月、季、年同比销售增长绩效;增加大区管理奖励;增加职员销售管理奖励;</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2.人力资源数据</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　人工成本预算：根据年初各体系调薪结果，调整各体系2014年度人工成本预算;</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　人工成本分析报告：形成各体系人工成本分析报告模板，完成2014年1月-2月办事处人工成本数据分析报告。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　3.薪酬、福利方案</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2014年度工厂工资调整方案;</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2014年度集团总部办事处职员、导购调薪方案;</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2014年度总部各体系调薪方案。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　4.外联工作</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　政策补贴：获得劳动局2万元就业贡献奖励，已入公司财务账户。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　外部评选：3月份将园区各部门参选甘井子区政府组织的三八妇女节评优活动，第一工厂生产一班荣获甘井子区&ldquo;巾帼文明岗&rdquo;先进女职工集体荣誉、第二工厂生产五班荣获甘井子区&ldquo;先进女职工集体&rdquo;荣誉、检查部刘部长荣获甘井子区&ldquo;巾帼文明岗&rdquo;荣誉。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　编制政协提案：从解决企业发展中的现实问题入手，人力资源部策划、撰写4项政协提案，已经提交区政协。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　《扩大品牌服装生产企业劳动用工补贴范围》</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　《对先就业再培训的品牌服装企业进行培训直补》</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　《在住房政策方面给予外来务工人员市民待遇》</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　《劳模或优秀技能人才评选要向品牌服装行业中小民营企业倾斜，提高民营企业技能人才获市级奖励的比例》</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　四、组织工作</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　1. 制度流程建设</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　OA人事系统的完善：一季度重点是完善了总部OA人事系统和办事处OA人事申请审批流程。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　质量体系文件修订：一季度重新完善、修改了《员工职务行为管理规定》，同时，制定了《办事处经理请休假管理规定》及《关于员工再次入职延续工龄的规定》。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2. 外审工作</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　3月21日-22日接受了莱因公司的外审，外审员对人力资源部的各方面工作都给予了肯定，但对于人力资源部提出3个建议项目，已经组织相关责任人做出改进时间计划。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　五、强化人事基础信息管理</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　1.健全专卖店人事信息管理</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2.加工厂计时人员、办事处职员编制纳入总部管理</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　在年初调薪的同时，将加工厂计时人员及办事处职员的编制规范管理，对增编增岗、入职提出管理要求。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　六、第二季度重点工作计划</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　1.完善人员岗位能力评价体系;</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2.细化新员工培训内容;</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　3.建立健全培训效果跟踪评价方法和内容</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　4.办事处2014年第2季度销售激励方案及操作细则</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　5.整合人力资源质量体系文件，建立完善办事处管理制度。</span>','0','','0','10000','','0','','','|0','1');
INSERT INTO `v9_picture_data` VALUES('3','<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">一季度的工作，随着时间的推移，已经接近尾声。这三个月的时间里，我们组的工作总体而言有进步的方面，也有很多做得不好的地方。在这一个季度的时间里，我觉得我们组和我个人都学到了更多的知识。四月份即将来临，我们所要面对的是人员和商品不同程度的变动，还有每天复核工作线路的变动，这些表明了一个问题：我们将一切从&ldquo;零&rdquo;开始，重新学习新的工作流程和适应新的工作环境。我们全组人员都已经做好了准备，为下一季度的工作做了规划。现结合下一季度的工作计划，将一季度的工作总结如下：</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　一、目标管理、沟通协调</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　1、对于我们组的工作量考核方面，我们全组的工作考核为8XX品项/月，个人目标为24000品项，每个人每一天要完成的目标为924品项，按照正常的工作量而言，基本上每个人都能完成。只是有时工作很小的情况下，晚班不能完成，在这种情况下，我们组的同事在晚班各项工作完成后，去其他工作尚未结束的班组去帮忙，同时也是努力完成当天的工作量目标。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2、工作目标考核的第二方面，为下货的差错率考核。对于下货的差错率控制方面，有许多的因素会影响，从我们复核员的工作方面来讲，能够控制的方面就是按照《出库装箱标准》来进行操作，那样的话，不但可以在数量差异方面得到很好的控制，而且在装车、运输、下货过程中能在一定程度上保证商品的安全性(即控制质量差异)。一季度的工作中，我们组在质量差异控制方面较上一年有了明显的进步，比如在用小纸箱装玻璃制品的隔离方面做的很好。但是也有做的不好的地方，例如有新商品发货，这种商品容易被压坏，而又盲目的将这类商品装在箱底导致商品被压坏，这些差异已由当事人负责承担。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　二、时间管理，日清日结</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　在时间管理方面，就我们复核组而言，就是能够在短时间内，按照出单顺序、装车线路来进行实施。我们每一天都能够尽可能的在保证质量的前提下提高工作效率。因为我们每一天只有三个人上早班，而且早上刚上班的时侯就要抽出两个人去装车，最先出单的都是药店的，药店补的货大多数有蜂蜜，因此，我们每天早上都安排一个复核速度快，但又精于装箱的人员先进行复核。装车人员都能尽快的装好车来参与复核。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　三、规范操作</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　刚从主楼搬到平面库的时侯，我们组的规范操作做的不是很好，经过上级领导的指导下，全组同事齐心协力，每天多做一点，多想一点，把我们的规范操作纳入日常工作来进行，现在已经成了一种习惯。大家都会观注每个人复核区域内的规范，比如卫生，整洁之类的。在各种表格填写方面，我们也做了不少的工作，每天下班前都会提醒大家把相关的表格填写完成后，做好下班前的交接工作。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　四、人员管理</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　在人员管理方面，我认为一月份做的是比较好的，从我自己开始，每个人对每天的工作都满怀热情，每天都能够做到任劳任怨，高效完成。在一季度的工作中，我感受比较深，对于员工而言，他们都时时在看着自己，我做为一名领导，应该起到带头模范作用，这种带头作用不是用在满腹报怨，更多的是充满信心。当然，人都会有烦躁的时侯，有时侯，我也感觉到很烦，为什么我做了大量的工作，但是我们组的业绩总是上不去。不过，这些都是我要去面对的，就如同领导所说的，我们要做就做最好，不做就直接不做。在三月分的工作中，我们组出现了一人未到岗的情况，据了解，是由于未安排好生活与工作的时间、关系造成的，也是一种工作态度不端正的具体表现。这些与我个人的工作不到位是分不开的。下个月我们面临着人员、商品的重新组合，便利店改成日配的情况下，相信工作量会骤然增大。我将全身心投入工作，做好每一位员工的工作，端正工作态度，以实现全组人员同心协力，共同完成每一天工作的目标。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　五、互帮互学，共同完成</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　在一季度的工作中，我们组总体效率还是高的，有时侯，工作量小时，我们会在下班前提前完成工作，这种情况下，领导会组织我们组到别的班组帮忙，在这个过程中，我们可以学到别的班组的规范操作和各种管理流程等。可以提高整个部门的工作效率，又可以让大家互相了解我们各班组的工作情况。周六的时间，我们会努力完成复核工作，有时间的话，可以帮助货区进行周末盘点和收货上架，他们也会帮我们准备复核时使用的各种小纸箱。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　六、学习与培训</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　1月31日，公司组织了配送中心全体员工到总部学习公司企业文化。蓝总主要为(2016国土资源局半年工作总结)我们进解了人生观，价值观以及细节决定成败。通过学习，我们对健之佳的未来更加充满信心，坚定工作信念，更加注重规范操作，以实现做好细节工作的目标。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2月14日，参加了由公司张总主持的《行政管理》方面的讲解，通过此次培训，使我感受很深，将这些理论来对照我们现在的工作，觉得自己的业务水平还是很低，对于管理的方方面面觉得还做得不好。在今后的工作中，我将会按照此次培训的一些内容来进行管理。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2月24日，仓管部经理对本部组长以上领导干部进行了各岗位的岗位描述的培训，使我们更加明白了自己的职责，并明确了责任，明白了日常工作流程和内容，以指导我们以后的工作。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　3月份，组织全组人员进行了岗位描述的培训，让每位员工都明确自己每一天应该做好的工作内容，以达成全组工作日清日结的工作目标。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　七、一季度盘点</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　3月28日，对仓库商品进行了全面准确的盘点，通过此次盘点，我们可以看到：1、我们组的下货差异较上一季度有了明显的上升;2、货区拣货差异也有所上升。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　八、二季度的工作计划：</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　鉴于仓库搬迁后，人员、商品、门店线路的调整，在人员的工作态度方面以及差异的控制方面，将会成为我们工作的重点，结合我们组的实际情况，将二季度的工作作如下计划：</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　1、做好人员的工作态度方面的工作;</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2、做好与运输部的协调交接工作，确保商品出库的准确性;</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　3、按照《商品复核装箱标准》完成每一天的工作，确保商品在运输、搬运过程中的安全性;</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　4、搬迁后，我们将面临工作量骤然增大以及人员重组的可能性，我们将会尽早的适应工作环境，努力实现每一天工作的日清日结。</span>','0','','0','10000','','0','','','|0','1');
