INSERT INTO `v9_picture_data` VALUES('8','<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">按照年初制定的工作目标，围绕县委、县府工作部署，第一季度我局主要抓了以下几项工作。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　一、深入贯彻学习党的十七大会议精神，广泛宣传、大力实施新修订的《义务教育法》。贯彻落实全省教育工作会议精神，全面实施《福建省&ldquo;十一五&rdquo;教育发展专项规划》和省政府《关于进一步推进义务教育均衡发展工作意见的通知》，规划我县教育布局调整，扎实落实&ldquo;两免一补&rdquo;等国家对义务教育的各项惠民措施，推进我县义务教育均衡发展。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　二、深化农村中小学寄宿生食宿改善工程。按照县委、县政府的要求，认真抓好农村寄宿生食宿改善工程的落实工作，在全县农村中小学校稳步推进农村中小学生食宿改善工程，县政府为全县3076名农村中小学校寄宿生每周提供5次免费早餐和5次肉食和豆腐。每人每周补给金额为17.5元，另外初中低保学生每天另补2元，小学低保学生每天另补1元。结合&ldquo;省农村寄宿制学校建设工程&rdquo;的实施，继续改造和完善农村学校食堂、澡房等有关寄宿生生活的配套设施。并着手解决农村劳动技能培训基地问题，做到农村乡镇每所学校有10亩的学生劳动技能培训基地。开学初，县委、县政府拨出专款12万元，购买2224床优质军用被，免费发放给全县农村中小学寄宿生。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　三、狠抓控辍保学工作。我局积极采取措施加强中小学控辍工作，一是及时做好《将乐县人民政府办公室转发省人民政府教育督导室关于进一步加强义务教育阶段控辍工作意见的通知》(将政办[2014]4号)转发工作，促进各乡镇各司其责，抓好&ldquo;控辍保学&rdquo;工作。二是成立&ldquo;控辍保学&rdquo;工作领导小组，分工明确，责任到人。县教育局机关干部分片分组到各中小学，协助学校这项工作。三是抓住时机做好大力宣传，营造良好的氛围。乡镇广大教师利用外出务工人员返乡过春节的时机，深入到他们家中进行家访。四是做好新生交接手续。各校将春季就读职业技术学校的学生组织起来，将学生送到职业学校，做好学生思想稳定及相关的交接工作。四是各校做好&ldquo;留守学生&rdquo;的关爱工作，各中学设立&ldquo;留守学生&rdquo;注册处，并建立起&ldquo;留守学生&rdquo;档案，及时了解和记录他们的家庭情况、心理状况以及诚信情况，把&ldquo;诚信档案&rdquo;作为学生操行的重要依据，并对他们生活求助及时帮助，对他们心理困惑及时疏导。截止到3月底，全县初中入学率达98.82%，小学入学率达99.98%。各乡(镇)正对未入学的学生进行逐个家访，及时动员学生返校学习。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　四、落实2014年&ldquo;为民办实事&rdquo;项目工作。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　1、完成对城区义务教育阶段学生免除学杂费工作。从2014年春季学期开始，免除城区义务教育阶段学生杂费，免除标准为中学生每年生均320元，小学生每年生均240元，惠及学生6868人，全年共计减免资金184.6万元。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　2、对农村义务教育阶段学生免费提供教科书和对城区义务教育阶段学生免除学杂费工作。我县从2014年秋季学期开始，免费向全县农村义务教育阶段学生提供国家课程的教科书，2014年春季学期开始，免费提供国家课程及地方课程的教科书(标准为：中学生每年生均156元，小学生每年生均71元)，惠及学生9098人，投入资金88.96万元。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　3、继续实施农村中小学危房改造工作。我县2013-2014年继续实施中小学危房改造工程，共计10个项目，规划建筑面积11430平方米，消除危房面积6074平方米，共需投入改造资金949万元。目前，已完成的项目有安仁中心校实验楼、大源中心校学生宿舍食堂餐厅、黄潭中心小学学生宿舍楼，其余的项目都在紧张的实施。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　4、完成将乐一中校园规划及图书馆建设方案工作。做好将乐一中校园规划及图书馆规划，新建4000平方米将一中图书馆。规划费用预算14万元，图书馆预算造价400万元，前期及附属工程约80万元，共需投入资金500万元。目前，已请三明境景建筑设计有限公司进行设计，所需资金正在筹措之中。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　五、顺利通过省农村中小学现代远程教育工程项目验收组的检查验收。3月15日，省现代远程教育工程项目验收组到我县验收现代远程教育工程项目实施情况，验收组到高唐、黄潭、水南等乡镇学校实地查看了全县37个办学点的光盘播放室、多媒体教室、计算机室及卫星接收室等现代远程教育设备安装使用情况，对我县现代远程教育工程项目实施工作给予了充分的肯定，同时就现代远程教育设备的保护和使用等方面提出了意见和建议。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　六、认真做好预防春季流行性传染病工作。针对我县部分农村中小学发生流感疫情，我局与县疾病防控中心启动预案，深入学校和部分行政村调查疫情，配合卫生部门做好相应工作，及时召开了全县中小学、幼儿园校(园)长紧急会议，组织大家学习了《将乐县教育局关于预防春季传染病的紧急通知》(将教综13号)和《将乐县卫生局关于在中小学开展预防流感活动的函》，要求全县各校高度重视春季预防流行性传染病工作，结合《将乐县人民政府办公室关于印发突发公共卫生事件应急预案的通知》(将政办〔2014〕71号)文件精神，采取有利措施确保师生安全。我县安仁、大源两校流感疫情得到有效的遏止。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　七、做好提前招收初中应届优秀毕业生前期准备工作。将乐一中今年将继续面向全县各初中校提前招收应届优秀毕业生108名。目前推荐报名、选拔考试等工作正在积极准备之中。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　八、2&mdash;3月，我局组织局机关干部就我县城区教育发展现状进行专题调研，厘清发展思路，明确发展目标，多次召开专题会议，征求不同阶层的意见，形成了《全县教育发展现状分析与对策》一文，为县委、县政府决策提供科学依据。</span><br style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\" />\r\n<span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 25px;\">　　九、认真做好教育工作自评和迎接市级复查工作。组织全县中小学校长、教导主任、局机关干部学习福建省人民政府办公厅《关于全面开展县级人民政府教育工作督导评估意见的通知》(闽政办〔2014〕15号)和《福建省教育厅关于做好2014年县级人民政府教育工作督导评估的通知》(闽政教督〔2014〕11号)文件，学习新修订的《福建省县级人民政府教育工作督导评估标准和计分方法》，准确把握评估标准内容。2014年全县教育自评报告和基础数据统计报表正在完成中。</span>','0','','0','10000','','0','','','|0','1');
