INSERT INTO `v9_picture_data` VALUES('194','<p><span style=\"color:#14a1fb;\"><span style=\"font-size:16px;\"><strong>资质等级：</strong></span></span></p>\r\n<p>风景园林工程设计专项乙级、环境工程（水污染防治工程）专项乙级、市政行业（道路工程）乙级、市政行业（城镇燃气工程、排水工程）专业丙级</p>\r\n','0','','0','10000','','0','','','|1','1');
INSERT INTO `v9_picture_data` VALUES('195','<p><span style=\"color:#14a1fb;\"><span style=\"font-size:16px;\"><strong>资质等级：</strong></span></span></p>\r\n<p>机械行业甲级、军工行业（弹、火工品及固体发动机工程、枪、炮工程）专业甲级。<br />\r\n&nbsp;</p>\r\n<p><span style=\"color:#14a1fb;\"><span style=\"font-size:16px;\"><strong>业务范围：</strong></span></span></p>\r\n<p>编制项目建议书、编制项目可行性研究报告、项目申请报告、资金申请报告、工程设计。</p>\r\n','0','','0','10000','','0','','','|0','1');
INSERT INTO `v9_picture_data` VALUES('196','<p><span style=\"color:#14a1fb;\"><span style=\"font-size:16px;\"><strong>资质等级：</strong></span></span></p>\r\n<p>建筑行业（建筑工程）设计甲级<br />\r\n&nbsp;</p>\r\n<p><span style=\"color:#14a1fb;\"><span style=\"font-size:16px;\"><strong>业务范围：</strong></span></span></p>\r\n<p>可承担相应范围相应等级的建筑装饰工程设计、建筑幕墙工程设计、轻型钢结构工程设计、建筑智能化系统设计、照明工程设计和消防设施工程设计相应范围的甲级专项工程设计业务。可从事资质证 书许可范围内相应的建筑工程总承包业务以及项目管理和相关的技术与管理服务。</p>\r\n','0','','0','10000','','0','','','|1','1');
INSERT INTO `v9_picture_data` VALUES('197','<p><span style=\"font-size:16px;\"><span style=\"color:#14a1fb;\"><strong>资质等级：</strong></span></span></p>\r\n<p>国家甲级工程造价咨询<br />\r\n&nbsp;</p>\r\n<p><span style=\"font-size:16px;\"><span style=\"color:#14a1fb;\"><strong>业务范围：</strong></span></span></p>\r\n<p>1）承接建设项目建议书与可行性研究投资估算、项目经济评价报告的编制和审核。</p>\r\n<p>2）建设项目概预算的编制与审核，并配合设计方案比选、优化设计、限额设计的工作进行工程造价分析与控制。</p>\r\n<p>3）建设项目合同价款的确定(包括招标工程工程量清单和标底、投标报价的编制和审核);合同价款的签订与调整(包括工程变更、工程洽商和索赔费用的计算)及工程款支付，工程结算及竣工结(决)算 报 告的编制与审核等。</p>\r\n<p>4）工程造价经济纠纷的鉴定和仲裁的咨询。</p>\r\n<p>5）提供工程造价信息咨询服务;工程造价咨询企业可以对建设项目的组织实施进行全过程或者若干阶段的管理和服务。</p>\r\n','0','','0','10000','','0','','','|1','1');
INSERT INTO `v9_picture_data` VALUES('198','<p><span style=\"color:#14a1fb;\"><span style=\"font-size:16px;\"><strong>业务范围：</strong></span></span></p>\r\n<p>1）工程项目设计咨询；</p>\r\n<p>2）工程项目招标代理；</p>\r\n<p>3）工程监理造价咨询；</p>\r\n<p>4）工程监理施工管理；</p>\r\n<p>5）工程监理施工决算；</p>\r\n<p>6）工程监理施工各阶段造价监控。</p>\r\n','0','','0','10000','','0','','','|1','1');
INSERT INTO `v9_picture_data` VALUES('199','<p><span style=\"font-size:16px;\"><strong><span style=\"color:#14a1fb;\">资质等级：</span></strong></span></p>\r\n<p>国家甲级工程招标代理、国际甲级招标、中央投资项目招标代理甲级。<br />\r\n&nbsp;</p>\r\n<p><span style=\"font-size:16px;\"><span style=\"color:#14a1fb;\"><strong>业务范围：</strong></span></span></p>\r\n<p>可承担各类工程的招标代理业务。包括：各类土木工程、建筑工程、线路管道和设备安装工程及装修工程项目的勘察、设计、施工、监理以及与工程建设有关的重要设备(进口机电设备除外)、材料采 购招标的代理。</p>\r\n','0','','0','10000','','0','','','|1','1');
