INSERT INTO `v9_picture_data` VALUES('93','<p><span style=\"font-size:16px;\"><span style=\"color:#14a1fb;\"><strong>咨询内容：</strong></span></span></p>\r\n<p><strong>一、政府方咨询服务</strong></p>\r\n<p>1）<strong>项目识别</strong>：收集项目相关资料和基础数据，编制可行性报告、物有所值评价（VFM）和财政可承受力论证等。</p>\r\n<p>2）<strong>实施方案：</strong>编制PPP项目投融资实施方案，进行财务测算。对PPP项目运作方式、交易结构、回报机制、定价与价格调整机制、合同结构、监管结构、重要边界条件、法律方案等 进行安排设计，作为后续项目工作的统领性指引。</p>\r\n<p>3）<strong>项目推介：</strong>进入采购程序之前征集潜在社会资本和金融机构意向，进行市场测试，为设计采购文件、确定项目交易结构和核心边界条件等提供市场基础。</p>\r\n<p>4）<strong>招标代理：</strong>编制资格预审公告、招标采购文件，组织项目采购、评审，协调解决此阶段出现的各种问题。</p>\r\n<p>5）<strong>合同签订：</strong>协助实施机构与社会资本谈判，与社会资本方签订PPP合同。</p>\r\n<p>6）<strong>项目管理：</strong>为PPP项目实施全过程，提供设计咨询、工程监理、项目管理等服务。</p>\r\n<p>7）<strong>政策研究及培训：</strong>为政府部门或投资平台提供投融资规划、PPP项目审批、监管等政策法规研究，以及实务培训等服务。</p>\r\n<p>8）<strong>其他咨询：</strong>就PPP项目所涉及的其他商务、财务、法律、税务问题提供专业咨询意见与建议等服务。</p>\r\n<p><strong>二、社会投资人咨询服务</strong></p>\r\n<p>1）<strong>尽职调查</strong>：收集项目相关资料，征询信息，与相关机构、人员进行访谈。</p>\r\n<p>2）<strong>投资策略：</strong>协助投资人组建项目团队，建立财务模型进行分析，提出投标策略和报价建议，编制投标文件等。</p>\r\n<p>3）<strong>常年顾问：</strong>为投资人提供行业趋势分析，最新政策解读、最新项目推荐、项目开发前期可行性分析、专业知识培训等。<br />\r\n&nbsp;</p>\r\n<p><span style=\"font-size:16px;\"><span style=\"color:#14a1fb;\"><strong>知识积累优势：</strong></span></span></p>\r\n<p>丰富的PPP咨询业绩</p>\r\n<p>各领域的融会贯通、有机衔接</p>\r\n<p>知识库积累和创新</p>\r\n<p>咨询理念和方法体系</p>\r\n<p>项目咨询经验和数据资源<br />\r\n&nbsp;</p>\r\n<p><span style=\"font-size:16px;\"><span style=\"color:#14a1fb;\"><strong>合作伙伴优势：</strong></span></span></p>\r\n<p>与众多金融机构、设计和科研单位、高等院校律师事务所、会计师事务所等形成协同合作伙伴关系。</p>\r\n<p>强大的专家合作资源，专家库规模逾2000人、包括院士和国内外著名学者、政府专家等300余人。</p>\r\n','0','','0','10000','','0','','','|1','1');
