INSERT INTO `v9_picture_data` VALUES('107','<p><strong>一、项目名称：</strong>定边-靖边原油输油管道三线工程通信系统采购项目</p>\r\n<p><strong>二、招标人：</strong>陕西延长石油（集团）有限责任公司管道运输公司</p>\r\n<p><strong>三、招标代理机构：</strong>华春建设工程项目管理有限责任公司</p>\r\n<p><strong>四、评标结果公示：</strong></p>\r\n<p>第一中标候选人：西安华盛通信有限公司</p>\r\n<p>第二中标候选人：南京普天通信股份有限公司</p>\r\n<p>第三中标候选人：西安信瑞达网络科技有限公司</p>\r\n<p><strong>五、注意事项：</strong></p>\r\n<p>5.1公示期为3日，若有异议，请于公示期内将书面材料递交至招标人。</p>\r\n<p>5.2书面材料应当包括下列内容：</p>\r\n<p>5.2.1质疑人的名称、地址及有效联系方式；</p>\r\n<p>5.2.2被质疑人的名称、地址及有效联系方式；</p>\r\n<p>5.2.3质疑事项的基本事实；</p>\r\n<p>5.2.4相关请求及主张；</p>\r\n<p>5.2.5有效线索和相关证明材料。</p>\r\n<p><strong>六、联系方式：</strong>陕西延长石油（集团）有限责任公司管道运输公司（联系电话：0911-8209925）。</p>\r\n<p style=\"text-align: center;\">二〇一六年十月十七日</p>\r\n','0','','0','10000','','0','','','|1','1');
